INSERT INTO `comments` VALUES (245, 70, 64, 'e***0', '非常好，很好！', NULL, 26, 0, 4.8, 4.4, 5, 4.2, 4.3, 4.5, '2024-02-21 23:36:25', NULL);
INSERT INTO `comments` VALUES (246, 70, 65, 'Z***5', '管理差服务差', NULL, 26, 1, 4.5, 4.9, 4.3, 4.6, 4.4, 4.5, '2023-08-14 12:13:03', NULL);
INSERT INTO `comments` VALUES (247, 70, 66, 'd***3', '酒店挺不错的，房间干净卫生，设备齐全，床品舒适，早餐精致好吃。', NULL, 26, 0, 4.3, 4.9, 4.4, 4.9, 4.2, 4.5, '2024-01-07 16:52:53', NULL);
INSERT INTO `comments` VALUES (248, 70, 67, 'a***6', '前台接待的M美女很好', NULL, 26, 1, 4.2, 4.2, 4.3, 4.2, 5, 4.4, '2023-07-22 14:06:58', NULL);
INSERT INTO `comments` VALUES (249, 70, 68, 'N***5', '位置好，房间现代、干净、漂亮！', NULL, 26, 0, 4.8, 4.2, 4.8, 4.4, 4.5, 4.5, '2023-08-26 16:39:01', NULL);
INSERT INTO `comments` VALUES (250, 70, 69, 'w***8', '前台的态度很好，升级了行政房 房间设备非常人性化，卫生间是自动感应的,房间温度调试的很舒适，淋浴间也得大。酒店位置很好，在会展中心的核心地带，周围有很多知名餐厅 ，吃、喝都方便。', NULL, 26, 1, 4.5, 4.7, 4.1, 4.2, 4.5, 4.4, '2023-07-05 15:37:16', NULL);
INSERT INTO `comments` VALUES (251, 70, 70, 'O***6', '目前全国住过印象最好的酒店', NULL, 26, 1, 4.6, 4.4, 4.1, 4.1, 4.3, 4.3, '2023-07-24 13:12:16', NULL);
INSERT INTO `comments` VALUES (252, 70, 66, 'D***3', '非常好的一次入住体验 前台办理入住的同事Susan非常高效 酒店的健身房和泳池也很棒 会再来的 Btw户外的泳池也开放了', NULL, 26, 1, 4.8, 4.8, 4, 4, 4.1, 4.3, '2023-08-04 22:01:35', NULL);
INSERT INTO `comments` VALUES (253, 70, 71, 'h***1', '本来入住很满意，前台一个男性服务员服务态度差的要死。前台留错我的电话，一直和我争杠。', NULL, 26, 0, 4.9, 4.6, 4.4, 4.6, 4.8, 4.7, '2023-07-07 11:36:53', NULL);
INSERT INTO `comments` VALUES (254, 70, 72, 'R***7', '服务一如既往的好，老客户客房做了升级，这个也是一直选择四季的原因之一，早餐如果增加一些地方特色美食会更好，另外请注重一下门童形象、举止，保持酒店的好印象', NULL, 26, 0, 4.2, 4.1, 5, 4.5, 4.6, 4.5, '2023-07-19 06:01:09', NULL);
INSERT INTO `comments` VALUES (255, 70, 73, 'U***8', '有点失望嘅体验！', NULL, 26, 1, 5, 4.5, 4.5, 4.2, 4.5, 4.5, '2024-02-13 14:46:55', NULL);
INSERT INTO `comments` VALUES (256, 70, 74, 't***9', '位于福田中心的优秀酒店，靠近Coco Park。总的来说一切都很出色。可能会说英语的人多一点？', NULL, 26, 1, 4.6, 5, 4.8, 4.8, 4.2, 4.7, '2024-02-16 10:25:22', NULL);
INSERT INTO `comments` VALUES (257, 70, 75, 'j***1', '整体来说非常棒，服务非常好，各个方面都很不错，特别干净舒适，果然是5星酒店啊。早餐挺不错的，中西式种类很多选择，很赞。还有周边环境，商场都很多，可以周围走走。下次可以再继续住。', NULL, 26, 1, 4, 4.8, 5, 4.5, 4.9, 4.6, '2024-03-09 09:50:39', NULL);
INSERT INTO `comments` VALUES (258, 70, 76, 'V***5', '很不错！非常好的入住体验！', NULL, 26, 1, 4.1, 4.5, 4.8, 4.6, 4.2, 4.4, '2024-02-17 16:22:43', NULL);
INSERT INTO `comments` VALUES (259, 70, 77, 'n***9', '地点环境适合旅游居住', NULL, 26, 1, 4.3, 4.7, 4.6, 4.6, 4.4, 4.5, '2024-02-19 16:05:19', NULL);
INSERT INTO `comments` VALUES (260, 70, 78, 'h***9', '四季酒店的水准，只是自助餐可以多点菜会更好', NULL, 26, 1, 4.3, 4.6, 4.9, 4.4, 4.5, 4.5, '2024-02-15 16:14:14', NULL);
INSERT INTO `comments` VALUES (261, 70, 79, 'g***4', '特意来深圳四季酒店过生日，“待人如己”的细致服务让我再次选择入住，感谢酒店赠送的生日蛋糕，早餐也美味可口，期待再次入住。', NULL, 26, 0, 4.8, 4.6, 4.3, 4.3, 4.4, 4.5, '2023-10-06 20:44:13', NULL);
INSERT INTO `comments` VALUES (262, 70, 80, 'c***2', '非常好，谢谢酒店安排布置房间,￼太太生日还送个生日蛋糕。酒店位置好附近多食市又多酒吧，到商场购物都好方便！', NULL, 26, 0, 4.3, 4.3, 4.2, 4.8, 4.9, 4.5, '2024-02-14 16:06:10', NULL);
INSERT INTO `comments` VALUES (263, 70, 81, 'D***1', '一直很想体验一下的酒店，这次价格还不错，大写字台满足办公需求，据说还有打印机等办公设备可用，这次没有体验，下次有需要时试试，旁边的皇庭广场很好逛，会展中心对面', NULL, 26, 0, 4.9, 4.3, 4.3, 4.1, 4.8, 4.5, '2024-02-20 09:42:05', NULL);
INSERT INTO `comments` VALUES (264, 70, 82, 'I***0', '四季酒店的床和枕头是最舒服的', NULL, 26, 0, 4.4, 4.4, 4.4, 4.1, 4.8, 4.4, '2024-02-15 20:28:44', NULL);
INSERT INTO `comments` VALUES (265, 71, 83, 'Y***8', '酒店位置较好', NULL, 29, 0, 4.4, 4.9, 4.8, 5, 4.8, 4.8, '2024-02-28 10:43:01', NULL);
INSERT INTO `comments` VALUES (266, 72, 84, 'F***1', '床品舒服，行政酒廊安静', NULL, 30, 0, 4.2, 4.6, 4.9, 4.3, 4.4, 4.5, '2021-11-22 22:48:42', NULL);
INSERT INTO `comments` VALUES (267, 73, 75, 'j***1', '环境好，干净卫生，下次还会再来', NULL, 31, 1, 4, 4.4, 4.1, 4.5, 4.9, 4.4, '2024-03-30 14:36:20', NULL);
INSERT INTO `comments` VALUES (268, 73, 85, 'i***6', '一如既往的品质保证', NULL, 31, 1, 4.5, 4.4, 4.1, 5, 4.6, 4.5, '2024-04-18 19:20:47', NULL);
INSERT INTO `comments` VALUES (269, 73, 86, 'N***3', '很一般的老5星', NULL, 31, 0, 4.1, 4.9, 4.3, 4.7, 4.7, 4.5, '2024-04-07 14:47:57', NULL);
INSERT INTO `comments` VALUES (270, 73, 87, 'F***5', '又是相当满意的一次入住！这次由于要在南山那边先处理事务，然后再过来福田，所以只住三天两宿！不过这几天体验还是非常好的！从入住的办理就感到了酒店的亲切感，前台的主管小姐姐既专业又热情，帮我这个老客户提前准备了房间升级，还提醒我携程兑换了一个行政礼遇。办理很快，很高效。到了房间有欢迎甜点和果盘，后面还送来了我每次都要的熨衣板和hdmi线，细节决定一切！房间有小小的细节变化，包括洗浴用品有换成新的品牌木兰沁夏系列的，很好用也很环保。之前的很高大上，不过要拧盖就有点尴尬。行政礼遇也非常的好，有下午茶，还有相对楼下更安静的早餐，这次由于有一个小型电话会议的需要，借用了一个小时的会议室，行政楼层的Max小姐姐给安排的非常周到！Max小姐姐感觉就是福田四季的标杆，还记得我的小宝宝的名字，感觉非常亲切，宾至如归，又没有过度服务干扰客人，恰到好处！下回还会入住，四季都快成为我在深圳的半个家/公寓的感觉了，希望深圳四季越来越好吧～', NULL, 31, 0, 4, 4.1, 4.8, 4.3, 4.5, 4.3, '2024-04-12 13:28:40', NULL);
INSERT INTO `comments` VALUES (271, 73, 88, 'x***3', '好好好好好好好好好好好好好好好好好好好好好好好好好好好好好好好好好好好好好好好好好好好好好好好好好好好', NULL, 31, 0, 4.8, 4.1, 4.6, 4.8, 4.5, 4.6, '2024-04-18 10:16:23', NULL);
INSERT INTO `comments` VALUES (272, 73, 89, 'f***9', '来住过两次，感觉都很棒！房间和服务都很符合我的要求，性价比高. 前台客服专员服务很专业，给Johnny一个大好评！之后还会来住！', NULL, 31, 0, 4.2, 4.9, 4.5, 4.7, 4.3, 4.5, '2024-04-16 11:35:34', NULL);
INSERT INTO `comments` VALUES (273, 73, 90, 'K***8', '我对贵酒店的服务感到非常失望，没想到五星级酒店会是这样。入住时，那个人对我们很粗鲁。我被错误地预订了一张特大号床，并告诉办理入住手续的人我们想把它改成一张 2 床，那人用不耐烦的语气说我们应该在到达之前完成这个请求并告诉我们今天他们的房间入住率为 90%。我很无语，他居然当着我们的面说这话。由于我们强烈要求一张 2 床，他说我们需要等待房间，但会将我们的房间升级到一个类别，但他再次强调我们应该提前告诉他们。', NULL, 31, 0, 4.2, 4.4, 4.5, 4.9, 4.3, 4.5, '2024-04-18 10:21:19', NULL);
INSERT INTO `comments` VALUES (274, 73, 91, 'I***2', '这个四季的设施略微有点一般，但是服务什么的都是很在线的，而且也不定时有一些活动，整体值得推荐', NULL, 31, 0, 4.8, 4.5, 4.8, 4.5, 4.1, 4.5, '2024-04-16 11:35:05', NULL);
INSERT INTO `comments` VALUES (275, 73, 92, 'L***9', '体验感受很好', NULL, 31, 0, 4.5, 4.1, 4.9, 4, 4.9, 4.5, '2024-04-16 19:29:58', NULL);
INSERT INTO `comments` VALUES (276, 73, 93, 'u***4', '靠近CBD和展览馆，周边环境非常现代化，房间面积虽然是40多，但进门口多过道浪费了面积。电动厕所和窗帘。整体不错，价格合理', NULL, 31, 0, 4.7, 4, 4.5, 4.2, 4, 4.3, '2024-04-16 12:29:51', NULL);
INSERT INTO `comments` VALUES (277, 73, 94, 'g***0', '位置很好，我是来庆祝生日，不过设备一般！', NULL, 31, 0, 4.4, 4.5, 4.7, 4.2, 4.6, 4.5, '2024-04-18 10:21:38', NULL);
INSERT INTO `comments` VALUES (278, 73, 95, 'v***3', '这次是我第二次入住,今次住了3天休闲享受深圳舒适生活,酒店位置就在地铁4号线的会展中心站与1号线购物公园站之间十分方便,附近有3个大型商场食肆很多.', NULL, 31, 0, 4.6, 4.2, 4.7, 4.9, 4.4, 4.6, '2024-04-18 19:19:32', NULL);
INSERT INTO `comments` VALUES (279, 73, 82, 'I***0', '来深必住在的酒店、早晨餐的咖啡师付用用心做、拉花出品！面包也做得特别好⋯⋯哈、点赞！', NULL, 31, 0, 4, 4.5, 4, 4, 4.9, 4.3, '2024-04-11 23:02:30', NULL);
INSERT INTO `comments` VALUES (280, 73, 96, 'S***0', '其他都五分好评，但前台不是很专业。好在携程712236攸何很给力，圆满解决。', NULL, 31, 0, 4.4, 4.8, 4.1, 5, 4.1, 4.5, '2024-04-25 14:37:43', NULL);
INSERT INTO `comments` VALUES (281, 73, 97, 'S***2', '房间有点年头了，其他都不错', NULL, 31, 0, 4.8, 4.8, 4.2, 4.4, 4.7, 4.6, '2024-04-25 09:01:44', NULL);
INSERT INTO `comments` VALUES (282, 73, 98, 'f***7', '酒店餐饮环境不错', NULL, 31, 0, 4, 4.6, 4, 4.2, 4.4, 4.2, '2024-04-26 18:43:27', NULL);
INSERT INTO `comments` VALUES (283, 73, 99, 'q***8', '因为是纪念日订的四季酒店，酒店安排很到位，房间有布置，还送了蛋糕和气泡酒，而且经理们手写了心意卡给我们，最后到中菜厅吃了午餐，还参加了他们酒店的会员。非常满意的一次住宿', NULL, 31, 0, 4.1, 4.2, 4.5, 4.3, 4.2, 4.3, '2024-04-26 18:43:18', NULL);
INSERT INTO `comments` VALUES (284, 73, 100, 'b***7', '细节差，服务反应慢', NULL, 31, 0, 4.7, 4.6, 4.5, 4.5, 4.6, 4.6, '2024-04-18 19:17:27', NULL);
INSERT INTO `comments` VALUES (285, 73, 101, 'e***6', '去深圳大多住这个酒店，很不错。', NULL, 31, 0, 4.4, 4.3, 4.7, 4.2, 4.7, 4.5, '2024-03-15 15:37:55', NULL);
INSERT INTO `comments` VALUES (286, 73, 102, 't***7', '给升级了房间，但是说好的水果就没了', NULL, 31, 0, 4.8, 4.9, 4.2, 4.7, 4.3, 4.6, '2024-04-12 13:30:32', NULL);
INSERT INTO `comments` VALUES (287, 74, 103, 'w***6', '服务很好，环境很好。', NULL, 31, 1, 4.6, 4.7, 5, 4.1, 4.6, 4.6, '2024-03-07 21:50:49', NULL);
INSERT INTO `comments` VALUES (288, 74, 104, 'W***0', '深圳四季是最有家的感觉的酒店，非常温暖！感谢Max！', NULL, 31, 1, 4.6, 4.5, 4.4, 4.6, 4.5, 4.5, '2024-04-19 17:25:23', NULL);
INSERT INTO `comments` VALUES (289, 74, 105, 'h***7', '深圳四季酒店无论是设施、职员的贴心服务，还是酒店的房间都会是令宾客想再次入住的酒店！一踏入地下大堂，便感觉为何没有酒店职员接待（顿时有点失落）。后来，有职员告知是要上六楼的接待大堂。因这次入住的是行政房，所以亲切的酒店职员-Max已经早前给我电邮告知是可以直接到29楼办理入住。但是，我的好奇心驱使下，我还是到了六楼办理，酒店职员得知是入住行政房，他们也礼貌地说（酒店职员是能说广东话的）可以到29楼办理入住。到了29楼的行政lounge,接待我们的是Vincent，他知道我是香港来的，所以跟我说广东话和非常有礼。他得知这次是庆祝小儿的生日,为他送上祝福，亦为没有生日布置而道歉（早前Mara and Max在电邮已经有提及），所以酒店把客房升级和送上蛋糕！他在我们等待期间亦为我们送上饮料，服务贴心到位！入住行政房间包括两位成人的下午茶tea set,黄昏cocktail 和早餐。先说下午茶tea set,味道和卖相都是五星酒店的水准，我最喜欢scones！黄昏cocktail有沙律、包类甜点雪糕、寿司、pizza、热食和咖啡汽水酒精类饮品……款式多样化，要吃饱一定是可以。下午茶时，接待过我们的职员姐姐（我忘记了她的名字+_+）,她竟然记得我们，非常窝心，她还有询问：为何不见两位小朋友前来品尝cocktail。早餐是在六楼的馥就餐，一到门口便见到琳瑯满目的甜点，已经充满期待！期间有位大厨还为我们介绍每款甜点的口味，足以知道他对自己的出品是充满信心！果然，味道一流无可挑剔，我最喜爱的是各口味的雪葩、肉松面包、紫薯包和杏仁可颂！餐饮经理姐姐（我忘记看她的名字-_-）接待我们，非常有礼又充满笑容，相隔着口罩我也感受到！她也是和我们说广东话（我好奇一问，原来她是看欧阳震华的剧集自学广东话，厉害！）早餐款项应有尽有，琳瑯满目，多', NULL, 31, 1, 4.6, 4.1, 4.2, 4.4, 4.7, 4.4, '2024-04-16 08:15:02', NULL);
INSERT INTO `comments` VALUES (290, 74, 106, 'm***0', '四季酒店一如既往的好，环境好，服务好，卫生好', NULL, 31, 1, 4.9, 4.2, 4.9, 4.2, 4.9, 4.6, '2024-04-16 08:14:00', NULL);
INSERT INTO `comments` VALUES (291, 74, 107, 'H***5', '酒店服务一流，工作人员态度热情专业，我们是为庆祝生日而来，酒店还贴心地为我们准备了生日蛋糕，非常感谢，我们在酒店度过了一个难忘的生日，感谢！', NULL, 31, 0, 4.6, 4.9, 4.3, 4.7, 4.3, 4.6, '2024-04-20 09:58:19', NULL);
INSERT INTO `comments` VALUES (292, 74, 108, 'Y***0', '每个为我们提供服务的员工都超赞。卫生小哥训练有素；前台的值柜特别祝我们生日之旅快乐、感谢选择深圳四季；生日晚上回到酒店，房间里还有漂亮的生日蛋糕，真是惊喜。同样我们感谢酒店的品质和细节服务！', NULL, 31, 0, 4.3, 4.7, 4.8, 4.9, 4.2, 4.6, '2024-04-20 16:53:19', NULL);
INSERT INTO `comments` VALUES (293, 74, 109, 'c***8', '每次到深圳一直住四季', NULL, 31, 0, 4.6, 4.7, 4.2, 4.8, 4.9, 4.6, '2024-04-19 17:36:31', NULL);
INSERT INTO `comments` VALUES (294, 74, 110, 'i***4', '四季老牌子了，各方面都很稳当', NULL, 31, 0, 4.5, 4.1, 4.7, 4.7, 4.8, 4.6, '2024-04-09 17:45:16', NULL);
INSERT INTO `comments` VALUES (295, 74, 111, 'm***6', '房间宽敞明亮干净布局合理时尚，饭菜色香味俱佳，看着有食欲吃着好吃，所有工作人员服务意识强，入住整个时间段都体验舒服，价格也不贵，果断连续三天套房，值得入住赞赞赞', NULL, 31, 0, 4.6, 4.8, 4.5, 4.4, 4.5, 4.6, '2024-04-22 18:31:44', NULL);
INSERT INTO `comments` VALUES (296, 74, 67, 'a***6', '酒店服务人员很有国际酒店服务意识，前台和客房部员工亲切的微笑和到位的服务，酒店的设施到位和干净。这次酒店入住体验很舒服。', NULL, 31, 0, 4.3, 4.9, 4.8, 4.5, 4.8, 4.7, '2024-04-22 18:31:12', NULL);
INSERT INTO `comments` VALUES (297, 74, 78, 'h***9', '深圳顶级酒店的存下，六楼大堂和露台很舒服，盆友聊天聚会可以选择这里！', NULL, 31, 0, 4.1, 4.7, 4, 4.9, 4.5, 4.4, '2024-04-17 15:29:31', NULL);
INSERT INTO `comments` VALUES (298, 74, 100, 'b***7', '舒适安静干净', NULL, 31, 0, 4.6, 4.7, 4.3, 4.3, 4.7, 4.5, '2024-04-21 12:43:03', NULL);
INSERT INTO `comments` VALUES (299, 74, 112, 'l***7', '设施略旧 地段一流 服务周到 早餐很棒', NULL, 31, 0, 4.7, 4.6, 4.9, 4.1, 4.3, 4.5, '2024-04-28 12:42:22', NULL);
INSERT INTO `comments` VALUES (300, 74, 113, 'W***4', '观展方便，环境优美', NULL, 31, 0, 4.4, 4.2, 4.4, 4.7, 4.3, 4.4, '2024-04-23 18:03:46', NULL);
INSERT INTO `comments` VALUES (301, 74, 114, 'q***6', '很好，智能马桶用的特别舒适，装修也好', NULL, 31, 0, 4.8, 4.4, 4.6, 4.7, 4.7, 4.6, '2024-04-23 18:03:31', NULL);
INSERT INTO `comments` VALUES (302, 74, 115, 'j***7', '第一次住四季，离会展中心很近，很方便！床垫非常舒服，早餐款式丰富多样，服务也非常好！第一次wifi连接有一点困难，后来在工作人员的安排下顺利解决！', NULL, 31, 0, 4, 4.1, 5, 5, 5, 4.6, '2024-04-25 17:30:33', NULL);
INSERT INTO `comments` VALUES (303, 74, 101, 'E***6', '自助早饭还是挺好的。但是入住体验不愉快，先放了行李，留了电话说一个多小时打扫好房间会给我打电话，但是过了八小时都没打，我们晚上七点直接回去入住。接下来进了房间听到楼下震天的酒吧音乐，告知前台，换到16层，房间也离酒吧远了一些，但是满屋烟味，又换了一次房间，但是因为可能没有预计有人入住，所以设备不齐全，比如在洗手间，浴缸处没有任何沐浴液之类，浴巾不足，只有洗手间有纸巾，客厅及卧室都没有。', NULL, 31, 1, 4.1, 4.4, 4, 4.3, 4.6, 4.3, '2024-03-06 13:32:56', NULL);
INSERT INTO `comments` VALUES (304, 74, 90, 'k***8', '好开心今年生日是选择了入住深圳四季酒店。', NULL, 31, 0, 4.2, 4.5, 4.2, 4.6, 4.2, 4.3, '2024-03-14 19:04:01', NULL);
INSERT INTO `comments` VALUES (305, 74, 116, 'c***6', '很好～很舒服，厕所很大', NULL, 31, 0, 4.5, 4.6, 4.5, 4, 4.4, 4.4, '2024-03-08 17:16:27', NULL);
INSERT INTO `comments` VALUES (306, 74, 117, 'E***4', '第一次入住前台给免费升级了房型，房间够大设施也不算旧，就是那个卫生间地漏回臭味真的受不了 晚上洗澡时把卫生间空调关了 夜里上了趟厕所拉开门一股子地漏的浊气臭味冲鼻子回来大概是卫生间的门没有关好 那个气味就飘进了房间凌晨4点多被那味熏醒真的冲鼻子 起来跑去卫生间空调打开后早晨起床后味道就好很多。第一次这体验感真不太好', NULL, 31, 0, 4.5, 4.6, 4.7, 4.7, 5, 4.7, '2024-03-21 14:31:32', NULL);
INSERT INTO `comments` VALUES (307, 75, 118, 'o***4', '服务态度很好，所有东西都不错，以后来深圳还会再入住', NULL, 32, 0, 4.6, 4.5, 4.3, 4.7, 4.9, 4.6, '2024-04-11 20:48:17', NULL);
INSERT INTO `comments` VALUES (308, 75, 119, 'X***7', '地段是核心竞争力，超级方便！', NULL, 32, 0, 4.7, 4.4, 4.4, 4.7, 4.8, 4.6, '2024-04-17 14:54:36', NULL);
INSERT INTO `comments` VALUES (309, 75, 115, 'j***7', '漂亮的装饰和热情的工作人员。非常方便，可轻松前往别致的主要购物区。返回福田的一家酒店。', NULL, 32, 0, 4, 4.4, 4.8, 4.1, 4.8, 4.4, '2024-04-24 10:05:34', NULL);
INSERT INTO `comments` VALUES (310, 75, 120, 'e***2', '酒店位置临近coco park和皇庭广场，购物吃饭泡吧都方便。但是酒店隔音效果不那么好，房间晚上还能清晰听到街上的传来的歌声音乐声。', NULL, 32, 0, 4.2, 4.9, 4.4, 4.5, 4.2, 4.4, '2024-04-24 10:06:00', NULL);
INSERT INTO `comments` VALUES (311, 75, 121, 'd***5', '性价比超低，除了地段好，其他真心差，十年前应该不错，现在你就睡着默默流泪吧', NULL, 32, 0, 4.1, 4.4, 4.2, 4.4, 4.6, 4.3, '2024-04-09 18:13:39', NULL);
INSERT INTO `comments` VALUES (312, 75, 122, 's***6', '一如既往的舒适和豪华，房间干净卫生！', NULL, 32, 0, 4.4, 4.7, 4.7, 4.7, 4.9, 4.7, '2024-04-07 09:52:01', NULL);
INSERT INTO `comments` VALUES (313, 75, 83, 'y***8', '酒店地处福田中心区，城市景观非常好，建议住高楼层（22层还不够高）。大堂和公区的服务不错，工作人员总能在你需要的时候出现，且不打扰你，值得赞一个。', NULL, 32, 0, 4.8, 4.5, 4.2, 4.2, 4.9, 4.5, '2024-04-07 14:00:24', NULL);
INSERT INTO `comments` VALUES (314, 75, 123, 'P***7', '性价比比较低。这个价格的房，环境和景色都很普通了。胜在地理位置优越。另外枕头真的很不舒服，落枕了。', NULL, 32, 0, 4.5, 4.7, 4.5, 4.8, 5, 4.7, '2024-04-25 20:54:20', NULL);
INSERT INTO `comments` VALUES (315, 75, 124, 'V***9', '完美的入住体验', NULL, 32, 1, 4.6, 4.4, 4.6, 4.4, 5, 4.6, '2024-01-04 16:45:34', NULL);
INSERT INTO `comments` VALUES (316, 75, 125, 'U***6', '很美的酒店，体验无敌。', NULL, 32, 0, 4.6, 4.2, 4.8, 4, 4.2, 4.4, '2024-04-01 18:08:52', NULL);
INSERT INTO `comments` VALUES (317, 75, 76, 'v***5', '今次是去深圳旅行是庆祝生的,酒店特别升级了一间有客厅的房间给我们并送上一个蛋糕,房间很大有独立淋浴及浸浴间.酒店位置十分方便在两条地鉄线之上,附近亦有高速鉄路福德站由香港西九龙站出发15分钟便到达,酒店附近有多个大型购物商场亦有很多食肆.酒店设施齐备有24小时开放的健身室及室内恒温泳池和一个室外大泳池,酒店员工态度友善唯一的是不懂说广东话希望日后能改善.', NULL, 32, 0, 4.3, 4.8, 4.4, 4.1, 4.8, 4.5, '2024-04-05 15:50:33', NULL);
INSERT INTO `comments` VALUES (318, 75, 71, 'h***1', '前台热情，房间免费升级，整体达到了四季的水准，很好。', NULL, 32, 0, 5, 4.6, 4.7, 4.5, 4.9, 4.7, '2024-03-13 09:40:27', NULL);
INSERT INTO `comments` VALUES (319, 75, 121, 'd***5', '挺不错', NULL, 32, 0, 4.2, 4.7, 4.4, 4.5, 4.9, 4.5, '2024-03-24 18:50:46', NULL);
INSERT INTO `comments` VALUES (320, 75, 104, 'W***0', '棒棒棒棒棒棒', NULL, 32, 0, 4.1, 4.8, 4.4, 4.3, 4.3, 4.4, '2024-04-08 18:02:02', NULL);
INSERT INTO `comments` VALUES (321, 75, 126, 'r***3', '服务：前台哥哥的服务特别好 另外当天是父母的周年纪念也安排的很好 爸妈很开心 很用心的服务', NULL, 32, 0, 4.1, 4.8, 4.8, 4.6, 4.4, 4.5, '2024-03-08 15:17:53', NULL);
INSERT INTO `comments` VALUES (322, 75, 122, 'S***6', '深圳的四季比北京四季好太多', NULL, 32, 0, 4.3, 4, 4.2, 4.7, 4.2, 4.3, '2024-03-08 15:18:24', NULL);
INSERT INTO `comments` VALUES (323, 75, 127, 'B***5', '景色很棒，服务很一般', NULL, 32, 0, 4.2, 4.5, 4.9, 4.7, 4.3, 4.5, '2024-04-01 18:08:15', NULL);
INSERT INTO `comments` VALUES (324, 75, 66, 'd***3', '酒店服务一如往昔的好，在外面借了充电宝忘了还，因第二天一早上飞机来不及还，前台下午帮忙还的，点赞', NULL, 32, 0, 4.1, 4.3, 4.2, 4.2, 4, 4.2, '2024-03-12 00:04:31', NULL);
INSERT INTO `comments` VALUES (325, 75, 68, 'n***5', '我在他们发的调查问卷写了点负面评价，结果被打电话质问，为了反驳我，他们竟然还查了酒店监控，把我在酒店的一举一动都看了一遍，好恐怖，再也不会住这家酒店，毫无隐私……', NULL, 32, 0, 4.1, 4.6, 4.1, 4.9, 4.4, 4.4, '2024-03-08 15:19:22', NULL);
INSERT INTO `comments` VALUES (326, 75, 128, 'y***2', 'check in直接升档 服务超赞 非常贴心的服务 四季一直都是如此超规格的待遇 夜景很美 视野开阔', NULL, 32, 0, 4.3, 4.4, 4.3, 4.2, 4.8, 4.4, '2024-04-06 08:48:08', NULL);
INSERT INTO `comments` VALUES (327, 76, 129, 'A***4', '环境：舒服温馨', NULL, 33, 1, 4.3, 4.3, 4.6, 4.1, 4.5, 4.4, '2024-03-31 16:44:28', NULL);
INSERT INTO `comments` VALUES (328, 76, 87, 'f***5', '早餐比疫情前大大退步了', NULL, 33, 1, 4.8, 4.7, 4.6, 4.4, 4.6, 4.6, '2024-02-24 07:43:46', NULL);
INSERT INTO `comments` VALUES (329, 76, 130, '3***0', '房间很好的', NULL, 33, 1, 4.1, 4.8, 4.3, 4.9, 4.4, 4.5, '2024-04-10 18:23:21', NULL);
INSERT INTO `comments` VALUES (330, 76, 118, 'o***4', '前台大堂的迎宾服务还可以吧 没有原上海四季的体贴周到热情 早餐还可以 还算符合这个房价的', NULL, 33, 0, 4, 4.7, 4.4, 4.4, 4.2, 4.3, '2024-04-15 18:05:57', NULL);
INSERT INTO `comments` VALUES (331, 76, 131, 'P***1', '环境一流，位置极佳！', NULL, 33, 0, 4.4, 4, 4.2, 4.1, 4.6, 4.3, '2024-04-15 18:06:49', NULL);
INSERT INTO `comments` VALUES (332, 76, 132, 'k***0', '设施：齐全', NULL, 33, 0, 4.1, 4.3, 4.9, 4.3, 4.6, 4.4, '2024-04-19 16:49:17', NULL);
INSERT INTO `comments` VALUES (333, 76, 133, 'J***9', '位置很好，早餐和行政酒廊很好，中餐厅推荐叉烧', NULL, 33, 0, 4.7, 4.5, 4.1, 4.6, 4.5, 4.5, '2024-04-08 21:10:10', NULL);
INSERT INTO `comments` VALUES (334, 76, 66, 'd***3', '总体上都满意，高于期望。', NULL, 33, 0, 4.5, 4.7, 4.7, 4, 4.6, 4.5, '2024-04-16 15:06:25', NULL);
INSERT INTO `comments` VALUES (335, 76, 134, 'K***4', '对于细节控来说住四季绝对是不错的选择喝胶囊咖啡的时候不小心把酒店的杯子打碎了，告知前台服务生小哥后他只问我有没有受伤，并没有跟我讲过多的话，这点让我觉得他们对客人的服务态度真的很到位！下次出差还会选择住的酒店', NULL, 33, 0, 4.6, 4.4, 4.6, 4.6, 4.7, 4.6, '2024-04-25 14:00:55', NULL);
INSERT INTO `comments` VALUES (336, 76, 122, 's***6', '感谢前台Cola、Anna和经理Clarence的热情服务，这次住的非常开心，下次还会再回来Fourseasons。', NULL, 33, 0, 4.9, 4.2, 4.3, 4.3, 4.4, 4.4, '2024-04-22 21:14:27', NULL);
INSERT INTO `comments` VALUES (337, 76, 87, 'F***5', '房大，床垫舒服！设施齐全，值得入住！', NULL, 33, 0, 4.8, 4.4, 4.3, 4.3, 4.8, 4.5, '2024-04-17 21:08:27', NULL);
INSERT INTO `comments` VALUES (338, 76, 69, 'W***8', '设施一流，但是退房的时候通常酒店都可以下午两点退房，但是协调半天只能延到一点，稍微有些麻烦。同样的设施，朗庭的性价比更高一些', NULL, 33, 1, 4.5, 4.1, 4.7, 4.8, 4.4, 4.5, '2023-11-06 14:17:03', NULL);
INSERT INTO `comments` VALUES (339, 76, 135, 'w***2', '地理位置佳，商务活动方便', NULL, 33, 0, 5, 4.1, 4.1, 4.3, 4.5, 4.4, '2024-03-09 19:42:34', NULL);
INSERT INTO `comments` VALUES (340, 76, 73, 'U***8', '住在这里真的很好，工作人员很好，他们真的很愿意提供帮助', NULL, 33, 0, 4.2, 4.4, 4.4, 4.2, 4.9, 4.4, '2024-03-27 19:06:43', NULL);
INSERT INTO `comments` VALUES (341, 76, 136, 't***1', 'Guest Relations 服务亲切，令客人宾至如归！', NULL, 33, 1, 5, 4.5, 4.7, 4.3, 4.3, 4.6, '2024-01-31 22:20:32', NULL);
INSERT INTO `comments` VALUES (342, 76, 113, 'W***4', '各个方面都很好', NULL, 33, 0, 4.8, 4, 4.2, 4.5, 4.8, 4.5, '2024-03-29 14:27:39', NULL);
INSERT INTO `comments` VALUES (343, 76, 137, 'L***3', '很细致的服务，非常好', NULL, 33, 0, 4.7, 4.8, 4.3, 4.8, 4.1, 4.5, '2024-03-11 15:50:28', NULL);
INSERT INTO `comments` VALUES (344, 76, 126, 'R***3', '深圳四季酒店总体服务挺不错的，地理位置非常方便，酒店用品质量不错，酒店服务人员态度良好！下次还会订四季酒店的', NULL, 33, 0, 4.2, 4.5, 4.9, 4.4, 4.4, 4.5, '2024-03-31 09:10:07', NULL);
INSERT INTO `comments` VALUES (345, 76, 76, 'V***5', '都狠不错，非常满意！', NULL, 33, 0, 4.7, 4.1, 4.1, 4.8, 4.8, 4.5, '2024-03-16 15:09:00', NULL);
INSERT INTO `comments` VALUES (346, 76, 138, 't***3', '第一次入住四季，大堂接待的小哥很有礼貌也很热情！整体风格大方优雅，没有刻意的追求奢华，但也确实把五星的底蕴淋漓尽致地展现出来。前台小哥可能看见我捧着一束花，知道我来提前过节，贴心地安排了高楼层的房间，风景很好，也很安静。异地恋的打工人没办法一起过情人节，提前在深圳相聚，四季的安排，给了我们一次美好的回忆，十分感谢各位！', NULL, 33, 0, 4.8, 4.4, 4.2, 4.8, 4.8, 4.6, '2024-03-07 18:33:59', NULL);
INSERT INTO `comments` VALUES (347, 77, 86, 'n***3', '对此次的入住体验非常满意，由于此行是为小孩庆祝生日，在携程预定了两间豪华双床房后电邮给酒店，希望安排相邻房间以及为房间布置一下。酒店的宾客体验经理Marmara Ge给我打来电话，电话中详细给我讲解他们会如何给我安排房间，还给我们作了客房升级。入住当天给我们精心布置了房间，给小孩准备了精美的生日蛋糕，还有Mara亲手写的贴心小卡片，这次的入住体验非常好，早餐也非常丰富，还有拉花咖啡，下次还会继续入住！酒店附近吃喝玩乐非常方便，有皇庭广场，连城新天地，领展中心城，星河COCO Park。', NULL, 32, 1, 4.3, 4.1, 4.6, 4.9, 4.1, 4.4, '2024-01-10 19:19:06', NULL);
INSERT INTO `comments` VALUES (348, 77, 139, 'Z***3', '酒店工作人员很热情，房间备品很到位，每天免费的矿泉水都有补充，这点很优秀，美中不足就是餐巾纸只有厕所有，每次都要到厕所拿，这个建议外面也提供一个，设备方面厕所淋浴设备可能有段时间了，花洒真的是到处开花所以有点小小拉，不过无伤大雅', NULL, 32, 0, 4.2, 4.4, 4.3, 4.7, 4, 4.3, '2024-04-10 17:12:01', NULL);
INSERT INTO `comments` VALUES (349, 77, 102, 'T***7', '一如既往的优秀，挑不出什么问题', NULL, 32, 0, 4.8, 4.9, 4.5, 4.6, 4, 4.6, '2024-04-09 19:25:37', NULL);
INSERT INTO `comments` VALUES (350, 77, 64, 'E***0', '招待朋友订的，不错', NULL, 32, 0, 4.5, 4.7, 4.5, 4.7, 4.8, 4.6, '2024-04-15 12:04:24', NULL);
INSERT INTO `comments` VALUES (351, 77, 81, 'D***1', '唯一不足的地方是没有水果送，住其他这个价位和星级的酒店，每天都有水果送到房间！四季这点是个小缺陷吧', NULL, 32, 0, 4.8, 4.5, 4, 5, 4.3, 4.5, '2024-04-15 08:52:41', NULL);
INSERT INTO `comments` VALUES (352, 77, 94, 'g***0', '路过深圳住了两晚，每天在行政酒廊喝一杯感觉还不错，工作人员Max很nice，有特别介绍每一款酒，也很细心', NULL, 32, 0, 4.7, 4.9, 4.1, 4.1, 5, 4.6, '2024-04-10 17:48:30', NULL);
INSERT INTO `comments` VALUES (353, 77, 71, 'H***1', '极致的体验！', NULL, 32, 0, 4.6, 4.4, 4.1, 4.2, 4.2, 4.3, '2024-04-17 14:03:43', NULL);
INSERT INTO `comments` VALUES (354, 77, 112, 'L***7', '酒店的设施：非常非常完善！！！', NULL, 32, 0, 4.5, 4.6, 4.2, 4.2, 4.5, 4.4, '2024-04-20 21:42:03', NULL);
INSERT INTO `comments` VALUES (355, 77, 67, 'A***6', '环境好，位置方便', NULL, 32, 0, 4.7, 5, 4.9, 4.8, 4.3, 4.7, '2024-04-15 08:53:09', NULL);
INSERT INTO `comments` VALUES (356, 77, 102, 't***7', '完美服务质量保证', NULL, 32, 0, 4.7, 5, 4.6, 4.4, 4.3, 4.6, '2024-04-15 08:08:29', NULL);
INSERT INTO `comments` VALUES (357, 77, 126, 'R***3', '住的感觉好棒，孩子喜欢', NULL, 32, 1, 4.6, 4.4, 4.9, 4.2, 4.5, 4.5, '2023-12-26 16:57:40', NULL);
INSERT INTO `comments` VALUES (358, 77, 140, 'C***4', '冲凉间排水很差 洗澡必淹水', NULL, 32, 0, 4.5, 4.6, 4.8, 5, 4.9, 4.8, '2024-04-01 13:19:22', NULL);
INSERT INTO `comments` VALUES (359, 77, 141, 'g***8', '感觉不错服务也不错，希望下次可以再去吃', NULL, 32, 0, 4.7, 4.8, 4.8, 4.3, 4.7, 4.7, '2024-03-11 09:26:36', NULL);
INSERT INTO `comments` VALUES (360, 77, 142, 'N***1', '免费升级了四季大床房，但沐浴间真的超级无语，下水道根本去不了水，水塘一样，我是站在了沐浴间的石凳上洗澡，“居高临下”，水都要快满浸到外面浴室，超级超级无语！！！想象脚就站在水塘一样 超级恶心，为什么上一个顾客退房后，酒店搞卫生的，没发现此问题吗？哎……..', NULL, 32, 0, 4.2, 4.8, 4.3, 4.1, 4.9, 4.5, '2024-03-16 14:12:37', NULL);
INSERT INTO `comments` VALUES (361, 77, 143, 'K***6', '前台小伙很灵，服务很到位。', NULL, 32, 0, 4.5, 4.5, 4.8, 4.4, 4.6, 4.6, '2024-03-21 11:13:47', NULL);
INSERT INTO `comments` VALUES (362, 77, 136, 't***1', '位置很不错，距离各大商场非常近', NULL, 32, 0, 4, 4.1, 4.5, 4.3, 4.4, 4.3, '2024-03-12 11:43:11', NULL);
INSERT INTO `comments` VALUES (363, 77, 137, 'l***3', '升级了房间 服务非常满意', NULL, 32, 0, 4.4, 4, 4.8, 4.8, 4.9, 4.6, '2024-03-21 17:10:26', NULL);
INSERT INTO `comments` VALUES (364, 77, 125, 'U***6', '酒店位置好，床品舒适，服务礼貌，就是冲凉房的下水堵了，由于时间太晚我就没有通知前台，第二天忘记了', NULL, 32, 0, 4.8, 4.4, 4.9, 4.2, 4.1, 4.5, '2024-03-30 20:48:33', NULL);
INSERT INTO `comments` VALUES (365, 77, 118, 'O***4', '住了两次都很满意，如果可以提前入住或推迟退房就更好了。以后还会住的。', NULL, 32, 0, 4.7, 4.3, 4.8, 4.9, 4.9, 4.7, '2024-03-20 14:11:48', NULL);
INSERT INTO `comments` VALUES (366, 77, 144, 'J***3', '这是从香港回来住的一家深圳酒店。环境设施和服务和在香港刚住的同价位差的不是一点。首先，入住给房间的时间晚了两个小时，酒店解释是很多员工回家过年，没那么多人服务。其次，给的房间就在四部电梯旁边，房间隔音很差，夜里睡觉听见电梯上上下下的，像飞机从楼旁边掠过。再就是房间的布置，对着床有一面大镜子，很渗人，衣柜的镜子也是对着床，不知当时怎么考虑要这么布置。完全不讲究风水吗？房间内浴缸黑色污渍擦不掉，马桶边的垃圾桶打不开。总之，这次入住体验不太好。', NULL, 32, 1, 4.7, 4.9, 4.5, 4.1, 4.3, 4.5, '2024-01-20 23:19:49', NULL);
INSERT INTO `comments` VALUES (367, 78, 145, 'o***2', '房间超级大，城景很美，出行方便', NULL, 34, 1, 5, 4, 4.9, 4.9, 4.4, 4.6, '2024-01-28 16:30:15', NULL);
INSERT INTO `comments` VALUES (368, 78, 116, 'C***6', '四季这个品牌堕落得太快了。房间有霉味，忍了，后来送了净化器稍微好点。酒店走的暗黑风格，包括早餐厅也是，没有明亮的感觉，只有各种明晃晃的射灯，让人不舒服。酒店本身楼层不高，周围都是高楼，房间看出去很压抑，完全比不上旁边的柏悦。特别是到了晚上对面大楼的灯光秀晃得人眼睛要瞎掉了。到酒店办入住的时候前台说我们订的房间还没打扫好让我们加钱升级了行政房间，但行政酒廊可以用的下午茶食物非常有限，没什么可吃的，性价比极低。总之入住体验非常一般，跟北京的四季酒店一样让人不愉快，以后不会选择了。', NULL, 34, 1, 4.7, 4.5, 4.6, 4.3, 4.2, 4.5, '2024-02-16 21:03:31', NULL);
INSERT INTO `comments` VALUES (369, 78, 120, 'E***2', '交通方便 但下午四点入住还需要等候二十分钟才能拿房 服务还有提升空间', NULL, 34, 1, 4.8, 4.2, 4.7, 4.3, 4.4, 4.5, '2024-04-05 13:12:57', NULL);
INSERT INTO `comments` VALUES (370, 78, 84, 'F***1', '房间很宽敞，风景很好。礼宾服务很好，住得很愉快。我想再次入住。', NULL, 34, 1, 4.9, 4.2, 4.6, 4.7, 4, 4.5, '2024-03-20 16:35:56', NULL);
INSERT INTO `comments` VALUES (371, 78, 146, 'q***4', '深圳住了4家酒店，属四季酒店最满意了，设施新，服务也很好，泳池也很棒。下次还会入住的。', NULL, 34, 1, 4.4, 4.2, 4.4, 4.2, 4.5, 4.3, '2024-03-28 15:30:57', NULL);
INSERT INTO `comments` VALUES (372, 78, 80, 'c***2', '春节带女儿一家人出游，福田中心区域', NULL, 34, 1, 4.4, 4.8, 4.4, 4.7, 4.9, 4.6, '2024-04-10 15:24:24', NULL);
INSERT INTO `comments` VALUES (373, 78, 76, 'V***5', '前台值班经理服务好，庄立建很热情特别热', NULL, 34, 1, 4.4, 4.3, 4.4, 4.5, 5, 4.5, '2024-04-13 21:40:17', NULL);
INSERT INTO `comments` VALUES (374, 78, 147, 'F***3', '酒店环境优越，位于核心区域，视野开阔，公园环市，酒店服务到位，但是我们有间房等了3个小时才入住，希望以后能提升', NULL, 34, 0, 4.7, 4.4, 4.9, 4.3, 4.6, 4.6, '2024-04-13 21:36:15', NULL);
INSERT INTO `comments` VALUES (375, 78, 141, 'G***8', '房间隔音非常差，安排的豪华双人房房间位于电梯旁，24小时不停的电梯声音让人无法入睡，要求换房间无果。然后，一个晚上听着楼上的住客跑来跑去到1点多，下次绝不会再预订入住。', NULL, 34, 0, 4.5, 4.6, 4.2, 4.6, 4.6, 4.5, '2024-04-17 17:46:51', NULL);
INSERT INTO `comments` VALUES (376, 78, 70, 'o***6', '很棒的住宿体验', NULL, 34, 0, 4.1, 4.9, 4.8, 4.2, 4.4, 4.5, '2024-04-22 18:06:00', NULL);
INSERT INTO `comments` VALUES (377, 78, 133, 'J***9', '地理位置非常好。', NULL, 34, 0, 4.4, 4.5, 4.7, 4.4, 4.4, 4.5, '2024-04-24 15:11:55', NULL);
INSERT INTO `comments` VALUES (378, 78, 145, 'o***2', '早餐还有比较大的提升空间', NULL, 34, 1, 4.9, 4.2, 4.4, 4.9, 4.9, 4.7, '2024-02-19 17:38:38', NULL);
INSERT INTO `comments` VALUES (379, 78, 73, 'U***8', '在节假日人很多的时候依旧非常有序，工作人员也提供了细致热情的服务，真的很赞。', NULL, 34, 1, 4.5, 4.1, 4.6, 4.3, 5, 4.5, '2024-03-29 14:08:06', NULL);
INSERT INTO `comments` VALUES (380, 78, 148, 'u***0', '非常完美的住宿体验，服务到位，餐厅出品也很不错，下次还会再来！', NULL, 34, 0, 4.5, 4.9, 4.5, 4.1, 4.8, 4.6, '2024-04-06 19:20:48', NULL);
INSERT INTO `comments` VALUES (381, 78, 149, 'b***1', '离市民广场很近，还看了灯光秀', NULL, 34, 1, 4.2, 4.7, 4.9, 4.5, 4.5, 4.6, '2024-02-14 15:32:38', NULL);
INSERT INTO `comments` VALUES (382, 78, 92, 'L***9', '地理位置很方便，房间很大很干净，酒店服务也很好，下次还会再入住', NULL, 34, 0, 4.6, 4.2, 4.6, 4.6, 4.6, 4.5, '2024-04-05 16:27:55', NULL);
INSERT INTO `comments` VALUES (383, 78, 143, 'K***6', '服务注意细节，卫生到位', NULL, 34, 0, 4.6, 4.8, 4.2, 4.8, 4.9, 4.7, '2024-04-22 18:08:22', NULL);
INSERT INTO `comments` VALUES (384, 78, 75, 'j***1', '设计有特色，环境一流，服务热情', NULL, 34, 0, 4.8, 4.1, 4.5, 4.9, 4.1, 4.5, '2024-04-17 16:46:43', NULL);
INSERT INTO `comments` VALUES (385, 78, 117, 'E***4', '酒店硬件及客房服务一如既往的好，但因为春节爆房早餐等了半个多小时才能进去餐厅，体验极差，酒店应提早告知早餐可能会出现排队等候的时段，便于住客根据自己行程安排就餐时间，同时针对于大规模的排队等候应有及时对策，而不是全部在餐厅外等候。', NULL, 34, 0, 4.6, 4.8, 4.3, 4.3, 4.7, 4.5, '2024-04-05 13:14:18', NULL);
INSERT INTO `comments` VALUES (386, 78, 88, 'x***3', '春节期间入住，服务非常贴心细致。推荐。', NULL, 34, 0, 4.3, 5, 4.4, 4.3, 4.2, 4.4, '2024-04-15 15:14:11', NULL);
INSERT INTO `comments` VALUES (387, 79, 150, 'o***8', '城市夜景很漂亮，刚好坐在房间可以看到城市灯光秀，服务也是一级棒，可以自己做胶囊咖啡，泡茶看看景！早餐精致，算是酒店早餐味道很好的了！以后再到深圳会再入住', NULL, 35, 1, 4.3, 4.9, 4.1, 5, 4.7, 4.6, '2023-12-03 08:39:39', NULL);
INSERT INTO `comments` VALUES (388, 79, 69, 'w***8', '硬件设施已经不是最新的了，服务较为满意，交通便利。', NULL, 35, 1, 4.2, 4.5, 4.5, 4.6, 4.1, 4.4, '2024-02-07 15:21:58', NULL);
INSERT INTO `comments` VALUES (389, 79, 122, 'S***6', '除了浴缸的热水放起来太慢之外（酒店反馈说是专门这么设置的），其它基本上都是这个级别匹配的水准，满分5分可以给4.8分。下次还会来住。', NULL, 35, 1, 4.3, 5, 4.8, 4.5, 4.9, 4.7, '2024-02-08 22:17:48', NULL);
INSERT INTO `comments` VALUES (390, 79, 134, 'k***4', '四季品质，值得保证！', NULL, 35, 1, 4.3, 4.1, 4.7, 4.5, 4.6, 4.4, '2024-02-23 20:32:08', NULL);
INSERT INTO `comments` VALUES (391, 79, 142, 'N***1', '泳池桑拿房挺好的，住宿的床也比较舒服', NULL, 35, 0, 4.2, 4.7, 4.6, 4.5, 4.2, 4.4, '2024-04-05 17:26:38', NULL);
INSERT INTO `comments` VALUES (392, 79, 111, 'm***6', '夜景不错，离高铁站很近，泳池也不错，周围逛街休闲也很方便，地铁也在一边，唯一就是房间太干燥，额外要求了加湿器就好很多。', NULL, 35, 1, 4.6, 4.4, 4.7, 4.1, 4.6, 4.5, '2024-03-06 14:45:04', NULL);
INSERT INTO `comments` VALUES (393, 79, 128, 'Y***2', '卫生干净，服务OK', NULL, 35, 1, 5, 4.5, 4.8, 4.6, 4.6, 4.7, '2024-02-09 22:32:05', NULL);
INSERT INTO `comments` VALUES (394, 79, 107, 'h***5', '经常来四季住，周到的服务，前台的服务非常好！谢谢Jacky和小杨Susan对老客人的细心安排', NULL, 35, 1, 4.5, 4.5, 4.4, 4.6, 4.3, 4.5, '2024-02-14 22:09:50', NULL);
INSERT INTO `comments` VALUES (395, 79, 151, 'n***7', '设施好，床品舒适，市中心很方便，前台一般', NULL, 35, 0, 4.4, 4.5, 4.6, 4.8, 4, 4.5, '2024-03-02 16:54:39', NULL);
INSERT INTO `comments` VALUES (396, 79, 152, 'v***1', '四季酒店是一直以来最最放心的酒店。服务没的说非常赞，客房一如既往舒适，卫生非常干净，温馨，七八年都会选择四季酒店，夜景也是福田cbd 周边都是shopping mall  推荐推荐推荐，susan小姐非常周到', NULL, 35, 1, 4.3, 4.9, 4.1, 4.4, 4.2, 4.4, '2024-04-20 16:49:42', NULL);
INSERT INTO `comments` VALUES (397, 79, 121, 'd***5', '四季虽然酒店设施有点旧，服务非常好，早餐也很精致', NULL, 35, 0, 4.4, 4.3, 4.9, 4.6, 4.5, 4.5, '2024-03-06 14:48:48', NULL);
INSERT INTO `comments` VALUES (398, 79, 119, 'x***7', '早餐很丰盛精致，房间大，服务五星。', NULL, 35, 1, 4.5, 4.4, 4.2, 4.5, 4.3, 4.4, '2023-11-23 07:50:42', NULL);
INSERT INTO `comments` VALUES (399, 79, 124, 'V***9', '酒店很舒适，服务很好！', NULL, 35, 0, 4.9, 4.8, 4.6, 4.3, 4.9, 4.7, '2024-03-29 14:53:48', NULL);
INSERT INTO `comments` VALUES (400, 79, 153, 'r***5', '很好！地理位置好性价比高', NULL, 35, 0, 4.7, 4.7, 4.8, 5, 4.7, 4.8, '2024-03-03 12:06:29', NULL);
INSERT INTO `comments` VALUES (401, 79, 86, 'n***3', '深圳的四季真的比其他城市住的舒适，很像家的感觉。每次深圳办事一定首选他家，办事游玩都方便，对面商场交通也好。', NULL, 35, 0, 4.4, 4.5, 5, 4.8, 4.8, 4.7, '2024-03-31 17:09:12', NULL);
INSERT INTO `comments` VALUES (402, 79, 73, 'U***8', '环境环境环境环境', NULL, 35, 0, 4.1, 4.7, 4.6, 4, 4.8, 4.4, '2024-02-25 17:15:59', NULL);
INSERT INTO `comments` VALUES (403, 79, 73, 'U***8', '服务：贴心周到', NULL, 35, 0, 4.2, 4.9, 4.1, 5, 4.3, 4.5, '2024-02-17 14:51:18', NULL);
INSERT INTO `comments` VALUES (404, 79, 154, 'q***2', '房间很宽敞 卫生可以 就是有些旧 设施中规中矩 没有什么很出色的地方', NULL, 35, 0, 4.8, 4.4, 4.1, 4.5, 4.6, 4.5, '2024-02-19 14:41:28', NULL);
INSERT INTO `comments` VALUES (405, 79, 114, 'Q***6', '都挺好，房间也还好，商务了一些，电热马桶盖有点热，不太喜欢', NULL, 35, 0, 4.9, 4.8, 4.6, 4.7, 4.6, 4.7, '2024-02-21 15:34:19', NULL);
INSERT INTO `comments` VALUES (406, 79, 155, 'X***9', '本来是比较愉快的入住体验，但在退房后的经历让我感到无比震惊与愤怒。', NULL, 35, 0, 4.3, 4.7, 4.2, 4.6, 4.7, 4.5, '2024-02-26 13:46:15', NULL);
INSERT INTO `comments` VALUES (407, 80, 156, 'I***8', '服务热情周到 环境干净整洁卫生 虽然设施有点老旧 但完全不影响它整体的舒适感 宝宝很喜欢', NULL, 36, 1, 5, 4.9, 4.9, 5, 4.7, 4.9, '2024-02-15 23:37:10', NULL);
INSERT INTO `comments` VALUES (408, 80, 157, 'O***0', '碰到了停电也是大无语', NULL, 36, 1, 4.5, 4.3, 4.9, 4.3, 4.6, 4.5, '2024-04-27 15:10:22', NULL);
INSERT INTO `comments` VALUES (409, 80, 95, 'v***3', '卫生干净，空间大！早茶好吃', NULL, 36, 1, 4.6, 4.3, 4.7, 4.5, 4.1, 4.4, '2024-04-28 15:35:49', NULL);
INSERT INTO `comments` VALUES (410, 80, 125, 'U***6', '只能说服务不够细心', NULL, 36, 1, 4.2, 4.6, 4.2, 4.7, 4.6, 4.5, '2024-02-19 09:40:09', NULL);
INSERT INTO `comments` VALUES (411, 80, 119, 'x***7', '酒店很不错，设施也很棒，酒店干净整洁，地理位置也很优越，服务也很好，住宿体验很好，不愧是四季。下次来深圳还会选择四季酒店', NULL, 36, 1, 4.1, 5, 4.7, 4.3, 4.5, 4.5, '2024-01-20 09:02:57', NULL);
INSERT INTO `comments` VALUES (412, 80, 158, 'l***5', '很好的服务意识，完善的设施。顶级舒适的被子，床。奢华大气的酒店。', NULL, 36, 1, 5, 4.3, 4.7, 5, 4.9, 4.8, '2024-03-07 14:41:45', NULL);
INSERT INTO `comments` VALUES (413, 80, 144, 'J***3', '非常满意的一次酒店住宿，地理位置不错，卫生也特别干净！酒店工作人员特别热情，服务态度特别好，选房都照顾到了我们的需求。因为对酒店的认可本想着住一晚就换酒店的，结果连续住了4晚。这次是我带儿子去玩，我家小朋友都很喜欢，通常小朋友都对住没什么感想，他都很满意。如果还去深圳一定首选深圳四季酒店！也会推荐给朋友的！特别要给客户经理Jacky Zhang好评，真得服务态度特别赞！！！有机会再见啊！', NULL, 36, 0, 4.1, 5, 4.3, 4.3, 4.7, 4.5, '2024-04-03 19:09:24', NULL);
INSERT INTO `comments` VALUES (414, 80, 159, 'k***2', '大堂庄经理人特别好，整体来说是四季质量还是不错的，早餐很棒 尤其甜品超级好吃，征服了我挑剔的味蕾。泳池也很棒，还是很舒服的，', NULL, 36, 0, 4.2, 4.9, 4.8, 4.9, 4.4, 4.6, '2024-04-24 19:58:39', NULL);
INSERT INTO `comments` VALUES (415, 80, 87, 'f***5', '房间大且舒适', NULL, 36, 0, 4.6, 4.9, 4.3, 4.9, 4.7, 4.7, '2024-04-03 15:42:14', NULL);
INSERT INTO `comments` VALUES (416, 80, 148, 'U***0', '俺觉得都差不多', NULL, 36, 0, 4.3, 5, 4.1, 4.6, 4.1, 4.4, '2024-04-24 20:05:38', NULL);
INSERT INTO `comments` VALUES (417, 80, 150, 'O***8', '尽管是开业十年的老酒店，但是维护的很好，地理位置优越，景观也棒，最吸引我的是酒店的服务和管理，每位员工都让你感觉很舒服，还有床品超舒服呀，智能马桶很好，老酒店的品牌文化底蕴真的是很多新酒店无法比的，下次还会再去', NULL, 36, 0, 4.2, 4.3, 4.1, 4.8, 4.3, 4.3, '2024-04-03 19:05:46', NULL);
INSERT INTO `comments` VALUES (418, 80, 77, 'N***9', '性价比很高。值得推荐', NULL, 36, 0, 4.2, 4.2, 5, 4.5, 4.1, 4.4, '2024-04-21 09:27:19', NULL);
INSERT INTO `comments` VALUES (419, 80, 147, 'F***3', '很好下次再来', NULL, 36, 0, 4.1, 4.2, 4.2, 4.1, 4.3, 4.2, '2024-04-03 15:41:07', NULL);
INSERT INTO `comments` VALUES (420, 80, 129, 'a***4', '服务非常不错', NULL, 36, 0, 4, 4, 4.1, 4.4, 4.7, 4.2, '2024-04-15 15:22:37', NULL);
INSERT INTO `comments` VALUES (421, 80, 4, 'kg', '超级惊喜 一到前台check in 居然给我们升级了 一家三口给了个大套房 挺爽的 谢谢', NULL, 36, 0, 4.6, 4.6, 4.4, 4.1, 4.7, 4.5, '2024-04-04 16:42:51', NULL);
INSERT INTO `comments` VALUES (422, 80, 156, 'I***8', '交通便利干净整洁设施齐全', NULL, 36, 0, 4.3, 4.6, 4, 4.5, 4, 4.3, '2024-04-11 16:47:33', NULL);
INSERT INTO `comments` VALUES (423, 80, 101, 'e***6', '这个酒店一切老化，服务除了门童可以五分，其他的都是2分，吃早餐要个面条，先说时间比较长，这哪里是五星级的服务啊！', NULL, 36, 0, 4.1, 4.4, 4.6, 4.9, 4.9, 4.6, '2024-04-18 17:57:56', NULL);
INSERT INTO `comments` VALUES (424, 80, 160, 'a***2', '礼貌和组织，是在深圳度过周末的不错选择。靠近购物中心和娱乐场所。', NULL, 36, 0, 4.4, 4.5, 4.2, 4.6, 4.9, 4.5, '2024-04-10 15:39:48', NULL);
INSERT INTO `comments` VALUES (425, 80, 110, 'I***4', '服务很到位，房型也很好，中餐厅也不错。可惜硬件太老了，甚至房间灯一体化。', NULL, 36, 0, 4.9, 4.7, 4.3, 4.5, 4.4, 4.6, '2024-04-16 20:34:49', NULL);
INSERT INTO `comments` VALUES (426, 80, 72, 'r***7', '夜景不错，交通便利！', NULL, 36, 0, 4.6, 4.6, 4.3, 4.3, 4.8, 4.5, '2024-04-20 14:22:41', NULL);
INSERT INTO `comments` VALUES (427, 81, 120, 'e***2', '附近环境不错.就是房间卫生比较差.在座椅后面发现一个避孕套.太恶心了', NULL, 37, 1, 4.3, 4.7, 4.1, 4.3, 4.9, 4.5, '2024-01-28 08:43:43', NULL);
INSERT INTO `comments` VALUES (428, 81, 146, 'q***4', '带孩子去深圳跨年，酒店服务很周到，知道后升级了房间，还摆放了小孩的用品，床品也很舒服，各种满意。', NULL, 37, 1, 4.1, 4.1, 4.3, 4.8, 4.5, 4.4, '2024-04-18 15:06:00', NULL);
INSERT INTO `comments` VALUES (429, 81, 128, 'Y***2', '推荐级别：持保留意见。', NULL, 37, 1, 4, 4.1, 4.5, 4.4, 4.4, 4.3, '2024-04-17 19:56:31', NULL);
INSERT INTO `comments` VALUES (430, 81, 81, 'D***1', '前台客房服务都特别好，需要一次性浴缸套也会提供，还有浴盐，房间特别干净，还有胶囊咖啡，茶包等，下一次还会选择', NULL, 37, 1, 5, 4.2, 4.5, 4.4, 4.4, 4.5, '2024-03-04 18:15:41', NULL);
INSERT INTO `comments` VALUES (431, 81, 84, 'f***1', '中规中矩吧', NULL, 37, 1, 4, 4.6, 4.6, 4.9, 4.1, 4.4, '2024-03-01 15:30:56', NULL);
INSERT INTO `comments` VALUES (432, 81, 106, 'm***0', '设施旧，服务一般，除了地理位置好，早餐可能因为疫情什么都没有，也没有像瑞吉和朗廷提供打包回房用餐的服务。', NULL, 37, 1, 4.3, 4, 4.8, 4.5, 4.2, 4.4, '2024-03-01 14:46:51', NULL);
INSERT INTO `comments` VALUES (433, 81, 74, 't***9', '一如既往地高品质。', NULL, 37, 1, 4.9, 4.1, 4.7, 4.2, 4.5, 4.5, '2023-12-13 19:56:32', NULL);
INSERT INTO `comments` VALUES (434, 81, 161, 'M***8', '超级好的酒店，酒店经理alan人非常好，准备了果盘，给了很好的房间。一切都很舒服，床品也很好，睡眠质量很高。深圳酒店首选。', NULL, 37, 0, 4.9, 4.7, 4.3, 4.4, 4.4, 4.5, '2024-04-21 19:20:09', NULL);
INSERT INTO `comments` VALUES (435, 81, 156, 'I***8', '再次入住酒店，前台Anna和Max非常热情，直接给升级房型更宽敞，主动给客户提供饮用水，说明客观情况因为疫情不一定能有服务员来更换房间被套。会继续选择四季酒店。', NULL, 37, 0, 4, 4.3, 4.9, 4.1, 4.7, 4.4, '2024-04-17 18:18:37', NULL);
INSERT INTO `comments` VALUES (436, 81, 107, 'H***5', '没有暖气的', NULL, 37, 0, 4, 4.8, 4.6, 4.7, 4.7, 4.6, '2024-04-16 12:12:12', NULL);
INSERT INTO `comments` VALUES (437, 81, 162, 'Y***4', '好o', NULL, 37, 0, 4.9, 4.9, 4.1, 4.3, 4, 4.4, '2024-04-09 10:56:01', NULL);
INSERT INTO `comments` VALUES (438, 81, 163, 'x***5', '我在深圳最喜欢的酒店！', NULL, 37, 1, 4.5, 4, 4.4, 4.3, 4.3, 4.3, '2024-03-30 21:13:40', NULL);
INSERT INTO `comments` VALUES (439, 81, 117, 'e***4', '设施：总体不错，因为是首次入住，给我升级了房型，房间超大。走廊里地毯侧面有完整的瓷砖带，通到各个房间，推行李箱很省力。房间是两个洗手池，智能马桶。在公共卫生间里，洗手后用于擦手的是手绢。', NULL, 37, 0, 4.3, 4.8, 4.7, 4.1, 4.6, 4.5, '2024-04-18 06:17:34', NULL);
INSERT INTO `comments` VALUES (440, 81, 164, 'z***1', '非常舒适，早餐很好', NULL, 37, 0, 4.1, 4.6, 4.6, 4.5, 4.6, 4.5, '2024-04-24 17:40:19', NULL);
INSERT INTO `comments` VALUES (441, 81, 119, 'X***7', '设施：泳池 健身房等都有 并且餐厅 平台景色不错', NULL, 37, 0, 4.9, 4.4, 4.2, 4.9, 4.4, 4.6, '2024-04-10 15:03:56', NULL);
INSERT INTO `comments` VALUES (442, 81, 4, 'kg', '还凑合，只是有些老旧，餐饮服务比较差', NULL, 37, 0, 4, 4.4, 4.7, 4.9, 4.5, 4.5, '2024-04-06 16:20:35', NULL);
INSERT INTO `comments` VALUES (443, 81, 105, 'H***7', '差到极致！叫了清理房间 一回来看到留个抹布在房间 衣物该怎么乱怎么乱 补充了新洗漱用品就叫清理房间的话 建议你们学习一下别的五星级酒店是怎么做的！还有 在没退房和按了免打扰的情况下 服务员敲两遍门就猛刷卡猛开门也就你们四季能做出来的事！深圳四季一生黑！', NULL, 37, 0, 4.4, 4.5, 4.8, 4.7, 4.7, 4.6, '2024-04-06 18:39:53', NULL);
INSERT INTO `comments` VALUES (444, 81, 73, 'U***8', '深圳出差，入住体验很好', NULL, 37, 0, 4.8, 4.7, 4.7, 4.3, 5, 4.7, '2024-04-04 17:12:25', NULL);
INSERT INTO `comments` VALUES (445, 81, 120, 'e***2', '领完证选择了四季酒店 然后提前打电话给酒店说能不能麻烦帮我们布置一下场景 酒店方面本来说只能简单布置一下 结果一到发现根本不简单！！ 在此再次感谢一下礼宾部的Max和Mara～ 两位可爱的小姐姐给了我们一次难忘的回忆！', NULL, 37, 0, 4.4, 4.3, 4.8, 5, 4.8, 4.7, '2024-04-04 17:12:50', NULL);
INSERT INTO `comments` VALUES (446, 81, 153, 'R***5', '四季酒店一生黑，住了很多次酒店了，第一次被人催着退房。中午12点左右回来想要收拾一下，就问能不能延迟退房，说什么客流量大，不太能延迟退房。回到房间后又有人打电话过来问我什么时候退房。说客人多，我不早退房别人住不了。我很好奇哈，我服了房费，住酒店，别人要办理入住那需要酒店去协调，为什么要客人去买单。我住过不少酒店，但深圳四季真的烂啊。', NULL, 37, 0, 4.1, 4.1, 4.9, 4.7, 4.3, 4.4, '2024-04-06 14:08:07', NULL);
INSERT INTO `comments` VALUES (447, 82, 66, 'D***3', '挺好的感觉', NULL, 38, 0, 4.7, 4, 4.4, 4.1, 4.3, 4.3, '2024-04-10 14:25:43', NULL);
INSERT INTO `comments` VALUES (448, 82, 86, 'n***3', '谢谢前台Jacky经理和Tony的服务，', NULL, 38, 0, 4.2, 4.7, 4.8, 4.1, 4.5, 4.5, '2024-04-13 20:53:01', NULL);
INSERT INTO `comments` VALUES (449, 82, 111, 'M***6', '非常满意哦！', NULL, 38, 0, 4.4, 4.4, 4.7, 4.3, 4.7, 4.5, '2024-04-21 00:40:39', NULL);
INSERT INTO `comments` VALUES (450, 82, 161, 'M***8', '很愉快的体验！选酒店的时候纠结了好久，看到four seasons有可以看世界杯的公共区域就果断选择了！环境也特别好！', NULL, 38, 0, 4.6, 4.3, 4.8, 4.9, 4.1, 4.5, '2024-04-07 15:55:26', NULL);
INSERT INTO `comments` VALUES (451, 82, 70, 'o***6', '四季一直在品控内 很不错 总是选择四季过几天又要去啦', NULL, 38, 0, 4.3, 4.1, 4.4, 4.5, 4.5, 4.4, '2024-04-11 12:49:49', NULL);
INSERT INTO `comments` VALUES (452, 82, 120, 'e***2', '干净整洁性价比高，比杭州四季便宜太多了，每次朋友来都安排四季', NULL, 38, 0, 4.2, 4.7, 5, 4.5, 4.8, 4.6, '2024-04-14 17:08:07', NULL);
INSERT INTO `comments` VALUES (453, 82, 115, 'J***7', '非常不错。', NULL, 38, 0, 4.2, 4.9, 4.3, 4.7, 4.4, 4.5, '2024-04-23 15:54:34', NULL);
INSERT INTO `comments` VALUES (454, 82, 124, 'v***9', '要不是朋友住这里了，真的是不能接受超级差的服务。没有五星级酒店的水准。', NULL, 38, 0, 4.8, 4.6, 4.6, 4.3, 4.6, 4.6, '2024-04-10 14:26:13', NULL);
INSERT INTO `comments` VALUES (455, 82, 88, 'X***3', '总体还行，好也算还行，差肯定不算差', NULL, 38, 0, 4.8, 4.3, 4.4, 4.7, 4.4, 4.5, '2024-04-23 15:52:53', NULL);
INSERT INTO `comments` VALUES (456, 82, 120, 'e***2', '非常非常推荐四季酒店。服务非常好，前台很helpful，几乎有求必应，房间打扫得很干净。印象最深的是送餐服务。有一天早晨我按了免打扰，接到电话，说餐已经送到房间门口，我以为就放在房门口了，过了好一会儿才开门，竟然发现那个小帅哥在等在门口……', NULL, 38, 0, 4, 4.4, 4.2, 4.9, 4.7, 4.4, '2024-04-27 14:52:42', NULL);
INSERT INTO `comments` VALUES (457, 82, 104, 'w***0', '大牌酒店 离家很近 出来玩可以住 但有些房间可能因疫情明显很久没客人住 进去后要好久才能把霉味散出去。', NULL, 38, 1, 4.2, 4.3, 4.1, 4.4, 4.9, 4.4, '2024-03-02 16:08:14', NULL);
INSERT INTO `comments` VALUES (458, 82, 109, 'c***8', '打扫卫生人员很好', NULL, 38, 0, 4.2, 4.2, 4.4, 5, 4.3, 4.4, '2024-03-31 22:06:29', NULL);
INSERT INTO `comments` VALUES (459, 82, 109, 'c***8', '服务很好，尤其是礼宾部小哥Johnny zeng特别热情，帮忙把所有行李都装车，服务相当到位哈', NULL, 38, 0, 4.3, 4.4, 4.8, 4.8, 4.3, 4.5, '2024-03-25 17:15:57', NULL);
INSERT INTO `comments` VALUES (460, 82, 165, 'V***7', '这次是跟太太庆生和刚好20周年纪念，特意选定四季酒店住宿和卓粤轩晚餐。感谢礼宾部Miley和Mara的热情安排，在这特别日子里增添不少气氛。卓粤轩的岀品味道还是保持一贯高水平，但服务就要跟上一下。', NULL, 38, 0, 5, 4.9, 4.8, 4.3, 4.4, 4.7, '2024-04-05 18:30:29', NULL);
INSERT INTO `comments` VALUES (461, 82, 67, 'a***6', '前台小康工作人员服务无敌好！常客入住，非常满意，世界杯看球好地方！', NULL, 38, 0, 4.2, 4.7, 4.9, 4.1, 4.3, 4.4, '2024-03-18 11:42:47', NULL);
INSERT INTO `comments` VALUES (462, 82, 65, 'Z***5', '地理位置好，周围的交通很方便，去哪里都很便捷，设施和服务也好，连住四天，下次出差到深圳还会选择这里。', NULL, 38, 0, 4.3, 4.5, 4.7, 4.6, 5, 4.6, '2024-03-31 14:39:15', NULL);
INSERT INTO `comments` VALUES (463, 82, 145, 'O***2', '还行，四季有些年头了，不过软硬件设施齐全。', NULL, 38, 0, 4.5, 4.5, 4.9, 4.5, 4.4, 4.6, '2024-03-23 15:55:04', NULL);
INSERT INTO `comments` VALUES (464, 82, 110, 'I***4', '可以的，价格好。质量不错，早餐很赞', NULL, 38, 0, 4.7, 5, 4.5, 4.7, 4.1, 4.6, '2024-03-31 16:34:02', NULL);
INSERT INTO `comments` VALUES (465, 82, 166, 'z***7', '四季是最喜爱酒店名单之一，服务很好，硬件设施也很棒', NULL, 38, 0, 4.1, 4.9, 4.5, 4.8, 4.3, 4.5, '2024-03-30 18:23:57', NULL);
INSERT INTO `comments` VALUES (466, 82, 113, 'W***4', '老旧', NULL, 38, 0, 4.2, 4.8, 4.1, 4.2, 4.1, 4.3, '2024-03-23 15:52:52', NULL);
INSERT INTO `comments` VALUES (467, 83, 77, 'n***9', '一如即往的好,日料餐厅不错，可惜点套餐优惠卷不能用。', NULL, 39, 1, 4.3, 4.5, 4.4, 4.4, 4.9, 4.5, '2024-02-14 14:32:03', NULL);
INSERT INTO `comments` VALUES (468, 83, 88, 'x***3', '服务好 位置好', NULL, 39, 1, 4.5, 4.9, 4.3, 4.1, 4.7, 4.5, '2024-04-08 17:17:17', NULL);
INSERT INTO `comments` VALUES (469, 83, 95, 'v***3', '出来玩的和朋友一起，环境OK的、谢谢宾客体验部提供的服务哈 ！帮我升级了房型和满足了我的一些小要求 ，非常感谢、下次还会来', NULL, 39, 1, 4.4, 4.3, 4.1, 4.7, 4.5, 4.4, '2024-04-11 14:19:37', NULL);
INSERT INTO `comments` VALUES (470, 83, 75, 'J***1', '行政酒廊Max和Amanda服务很周到', NULL, 39, 1, 4.1, 4.4, 5, 4.2, 4.9, 4.5, '2024-04-14 14:45:55', NULL);
INSERT INTO `comments` VALUES (471, 83, 61, 'A***0', '酒店总是干净而友好。他们总是欢迎我的访问。他们很细心，并不断检查不便之处。虽然晚上吵得我睡不着觉，但值班经理克拉伦斯还是小心翼翼地推迟了我的退房时间，保证我的休息。客户关系经理 Jackie 一直负责我剩下的旅程，直到我离开的那一刻，并承诺在我返回的那一天仔细考虑。我会在深圳的任何时候回到这个地方。', NULL, 39, 1, 4.9, 4.6, 4.9, 4.5, 4.9, 4.8, '2024-02-04 17:16:04', NULL);
INSERT INTO `comments` VALUES (472, 83, 167, 'Q***0', '挺好，五星标准位置佳。', NULL, 39, 1, 4.9, 4.3, 4.7, 5, 5, 4.8, '2024-02-08 09:33:01', NULL);
INSERT INTO `comments` VALUES (473, 83, 106, 'M***0', '之前出差一直住在四季酒店，还是一如既往的好，不管硬件还是软件都相当不错的。服务方面更不用说，而且四季酒店内就有核酸检测这点很难的。', NULL, 39, 1, 4.9, 4.6, 4.5, 4.5, 4.7, 4.6, '2024-03-03 15:56:46', NULL);
INSERT INTO `comments` VALUES (474, 83, 168, 'S***8', 'simon前台小哥哥服务很好，说话声音很有磁性，非常满意，5星好评 酒店的服务理念也很不错 会继续选择', NULL, 39, 1, 4.7, 5, 4.1, 4.9, 4.9, 4.7, '2024-02-18 14:33:45', NULL);
INSERT INTO `comments` VALUES (475, 83, 105, 'H***7', '这家酒店虽然时间比较久了，但好在有一群可爱的人，从入住的时候前台的小康，主动给升级了房间，还有大堂吧酒廊的小邓，调的软饮很好喝，一直等我们很晚。还有临走帮我叠衣服的小游。很细心，下次还会选择入住四季。谢谢。', NULL, 39, 1, 4, 4.6, 4.9, 5, 4.7, 4.6, '2024-04-25 15:19:47', NULL);
INSERT INTO `comments` VALUES (476, 83, 126, 'r***3', '深圳的四季酒店在我心中的地位等于澳门的文华东方，房间很好，但是我最喜欢的还是酒廊，真的很赞！谢谢Lawrence的爱尔兰咖啡', NULL, 39, 1, 4.2, 4.6, 4.5, 4.7, 4.2, 4.4, '2023-12-09 22:01:55', NULL);
INSERT INTO `comments` VALUES (477, 83, 149, 'B***1', '环境好 服务热情', NULL, 39, 1, 4.2, 4.2, 4.4, 4.5, 4.7, 4.4, '2024-03-01 14:57:34', NULL);
INSERT INTO `comments` VALUES (478, 83, 115, 'j***7', '很好，环境不错，卫生很好，很静音，交通方便。', NULL, 39, 1, 4.6, 4.5, 4, 4.4, 4.4, 4.4, '2024-02-21 18:21:48', NULL);
INSERT INTO `comments` VALUES (479, 83, 76, 'v***5', '挺不错的酒店，每位工作人员都很亲切！', NULL, 39, 1, 4.9, 4.5, 4, 4.4, 4.3, 4.4, '2024-03-24 15:24:19', NULL);
INSERT INTO `comments` VALUES (480, 83, 122, 'S***6', '深圳四季是我住过的国内继北京和广州之后的第三家，全球包含马拉喀什度假和新加坡之后的第五家，依然几乎无暇的服务及环境，依然是我心中酒店行业的天花板，于我而言，同城会稍领先丽思卡尔顿作为首选，推荐尝试。', NULL, 39, 1, 4.7, 4.1, 4.3, 4.3, 4.4, 4.4, '2024-04-19 10:17:22', NULL);
INSERT INTO `comments` VALUES (481, 83, 166, 'z***7', '服务很差，下次绝不再去', NULL, 39, 1, 4.9, 4.8, 4.3, 4.5, 4.6, 4.6, '2024-01-01 15:20:28', NULL);
INSERT INTO `comments` VALUES (482, 83, 114, 'Q***6', '一切皆美好', NULL, 39, 1, 4.9, 4.9, 4.4, 4.8, 4.6, 4.7, '2024-02-18 14:52:49', NULL);
INSERT INTO `comments` VALUES (483, 83, 157, 'o***0', '帮我免费升等了', NULL, 39, 1, 4.1, 4.2, 5, 4.4, 4.4, 4.4, '2024-03-05 18:26:23', NULL);
INSERT INTO `comments` VALUES (484, 83, 105, 'h***7', '挺好的，就是是老酒店了', NULL, 39, 1, 4.7, 4.3, 4.7, 4.9, 4.2, 4.6, '2024-03-24 15:17:14', NULL);
INSERT INTO `comments` VALUES (485, 83, 157, 'O***0', '首先、非常庆幸本次选择入住深圳四季酒店。由于疫情问题、一直犹豫着是否到外地帮爱人庆生、直到入住当日才决定出行，所以临时透过客服联系酒店、希望能在房间协助进行简单布置、刚开始回覆因为布置工作均需提前预约、故未必能满足要求、对此本人也表示理解。在稍后时间、正当以为无法布置时、接到贵酒店人员电话联系、由于时间仓促、但也希望尽量能带给我们一个美好的生日纪念、所以进行了简单布置及准备了生日蛋糕、对此本人由衷感谢及感动、高度表扬酒店员工的热情态度、尤其是一直电话联系协调的工作人员、前堂协助办理入住我朱经理、及画得一幅好画的Miss. Mara Ge, 贵至如宾、这是本次入住的最佳体验、祝愿各工事业顺利、身体健康、幸福美满、期待下次入住。', NULL, 39, 1, 4.6, 4.8, 5, 4.6, 4.9, 4.8, '2024-02-05 14:26:49', NULL);
INSERT INTO `comments` VALUES (486, 83, 70, 'o***6', '办理入住的时候是前台林小姐接待的，人美心善又亲切的小姐姐，服务非常棒，还给我们升了级，真的非常感谢！', NULL, 39, 1, 4.1, 4.6, 4, 4.4, 4.2, 4.3, '2024-02-17 17:16:44', NULL);
INSERT INTO `comments` VALUES (487, 84, 83, 'y***8', '最近疫情严重，宝宝生日本来准备去长隆结果不接待深圳的客人，又答应了带他去酒店，订了个市内的staycation。', NULL, 40, 1, 4.1, 4.8, 4.1, 4.8, 4.7, 4.5, '2024-03-08 17:22:44', NULL);
INSERT INTO `comments` VALUES (488, 84, 149, 'B***1', '干净卫生服务不错', NULL, 40, 1, 4.4, 5, 4.4, 4.7, 4.8, 4.7, '2024-03-22 14:04:32', NULL);
INSERT INTO `comments` VALUES (489, 84, 147, 'f***3', '其他都很好的 就是早餐的时候出现一些不该在四季出现的问题 甚至觉得有点离谱 不过瑕不掩瑜 还是值得推荐一下', NULL, 40, 1, 4.5, 4.8, 4.1, 4.5, 4.9, 4.6, '2023-11-23 15:55:36', NULL);
INSERT INTO `comments` VALUES (490, 84, 167, 'Q***0', '首先收说好的，豪华套房房间很大，虽然楼层不高，但窗外没有太多高楼挡着所以夜景也还不错。酒店服务人员的素质和意识也不错。', NULL, 40, 1, 4.6, 4.3, 4, 4.2, 4.3, 4.3, '2024-02-12 16:58:08', NULL);
INSERT INTO `comments` VALUES (491, 84, 135, 'w***2', '都非常满意哦', NULL, 40, 1, 4.6, 4.5, 4.1, 4.5, 4.9, 4.5, '2024-04-09 14:58:23', NULL);
INSERT INTO `comments` VALUES (492, 84, 125, 'U***6', '四季酒店的服务很棒，只是到了半夜有点迷糊，前台小哥哥帮助我租用了充电宝，送了我一瓶水，还帮我升级了房型', NULL, 40, 1, 4.9, 4.3, 4.3, 4.3, 4.5, 4.5, '2024-03-10 19:11:38', NULL);
INSERT INTO `comments` VALUES (493, 84, 169, 'M***4', '酒店的前台小姐姐Hailey非常nice，热情并且很有耐心，细心介绍酒店的设施，帮我升级房间，即使带着口罩，也能感受到她真诚的微笑，还没入住已经很开心了。窗户看到平安大厦全景，可以欣赏城市的建筑丛林之美，大堂吧的传统提拉米苏好吃极了，简直可以说是难以忘怀，早餐的环境很好，阳光照在桌上吃什么都香，洗衣服务比其他酒店快很多，非常棒的酒店', NULL, 40, 0, 4.9, 4.1, 4.5, 4, 4.8, 4.5, '2024-04-16 13:48:15', NULL);
INSERT INTO `comments` VALUES (494, 84, 163, 'X***5', '很愉快的体验。预定的时候写了自己要去过生日，于是打电话来询问我有什么需求。帮我布置了房间还送了小蛋糕。感谢Pete。Max是帮我办理入住的，非常热情，细心还帮忙升级了房间。房间很大，把办公，休息还有洗漱的分割开来。枕头上还有生日快乐的刺绣，浴缸也很大。十分感谢', NULL, 40, 1, 4.3, 4.5, 4.3, 4.7, 4.3, 4.4, '2023-12-31 17:06:47', NULL);
INSERT INTO `comments` VALUES (495, 84, 72, 'r***7', '挺好挺好的', NULL, 40, 0, 4.6, 4.8, 5, 4.1, 4.9, 4.7, '2024-04-21 15:19:20', NULL);
INSERT INTO `comments` VALUES (496, 84, 170, 'S***4', '非常棒的酒店，体验也一如既往的精彩！', NULL, 40, 0, 5, 4.4, 4.1, 4.5, 5, 4.6, '2024-04-06 14:09:42', NULL);
INSERT INTO `comments` VALUES (497, 84, 140, 'c***4', '深圳四季在服务、环境、卫生和早餐品质都做到了极致的好，床品也非常舒服，以后还会选择四季酒店！', NULL, 40, 0, 4.4, 4.2, 4.5, 4.4, 5, 4.5, '2024-04-13 08:38:22', NULL);
INSERT INTO `comments` VALUES (498, 84, 74, 't***9', '入住时非常快前台给于最好的房间房间东西非常齐全现代化水平很高设置一流，偶然的预定带来了意想不到的惊喜', NULL, 40, 0, 4.5, 4.4, 4.2, 4.3, 4.1, 4.3, '2024-04-13 19:46:21', NULL);
INSERT INTO `comments` VALUES (499, 84, 4, 'kg', '五星好评的酒店 服务非常好很贴心 酒店很安静干净 地理位置方便 附近很多餐厅 泳池很赞 有室内和室外的', NULL, 40, 1, 4.1, 4.3, 5, 5, 4.8, 4.6, '2024-03-07 07:44:15', NULL);
INSERT INTO `comments` VALUES (500, 84, 144, 'j***3', '要是送个早餐就更好了。', NULL, 40, 0, 4.7, 4.2, 4, 4.1, 4.9, 4.4, '2024-03-24 11:39:26', NULL);
INSERT INTO `comments` VALUES (501, 84, 96, 'S***0', '下次还会再来入住，加油。', NULL, 40, 1, 4.7, 4.1, 5, 4.1, 4.2, 4.4, '2024-02-28 15:07:47', NULL);
INSERT INTO `comments` VALUES (502, 84, 93, 'u***4', '值得推荐的豪华酒店', NULL, 40, 0, 4.5, 4.9, 4.5, 4.8, 4.5, 4.6, '2024-03-27 04:47:50', NULL);
INSERT INTO `comments` VALUES (503, 84, 61, 'a***0', '早餐没什么东西吃', NULL, 40, 0, 4.4, 4.9, 4.8, 4.7, 4.9, 4.7, '2024-03-31 07:55:39', NULL);
INSERT INTO `comments` VALUES (504, 84, 123, 'p***7', '餐厅很差，没有人性化服务。不专业。', NULL, 40, 0, 5, 4.4, 4, 4.7, 4.2, 4.5, '2024-04-18 13:45:14', NULL);
INSERT INTO `comments` VALUES (505, 84, 123, 'p***7', '满意满意满意', NULL, 40, 0, 4.2, 4.5, 4.9, 4.7, 4.2, 4.5, '2024-02-06 20:38:29', NULL);
INSERT INTO `comments` VALUES (506, 84, 165, 'v***7', '入住体验可以说是非常的差。办入住的时候，前台有个脑袋不太灵光的。房间的毛巾绝对没有消*干净，我和女朋友两天后就同时尿道感染，不会再来了z真的特别垃圾，居然检验出了支原体病毒。毛巾安全质量都保障不了，做什么酒店？都不住', NULL, 40, 0, 4.6, 4.1, 4.9, 4.6, 4.3, 4.5, '2024-03-15 07:13:58', NULL);
INSERT INTO `comments` VALUES (507, 85, 99, 'q***8', '前台接待服务态度好', NULL, 41, 0, 4.1, 4.6, 4.8, 4.9, 4.4, 4.6, '2024-04-26 09:07:38', NULL);
INSERT INTO `comments` VALUES (508, 85, 64, 'E***0', '酒店服务，环境都挺好，服务很贴心。地理位置去哪里都方便，夜景也不错', NULL, 41, 0, 4.6, 5, 4.6, 4.1, 4.5, 4.6, '2024-03-07 18:15:12', NULL);
INSERT INTO `comments` VALUES (509, 85, 164, 'Z***1', '工作人员非常耐心、热情，感觉很轻松。', NULL, 41, 0, 4.4, 4.1, 4.6, 4.6, 4.5, 4.4, '2024-04-06 14:21:50', NULL);
INSERT INTO `comments` VALUES (510, 85, 77, 'n***9', '体验很好，细节服务不错', NULL, 41, 0, 4.5, 4.6, 4.1, 4.6, 4.2, 4.4, '2024-02-29 20:21:41', NULL);
INSERT INTO `comments` VALUES (511, 85, 160, 'A***2', '特别感谢前台的王东民先生', NULL, 41, 0, 4.5, 4.1, 4.8, 4.2, 4.3, 4.4, '2024-02-29 20:20:38', NULL);
INSERT INTO `comments` VALUES (512, 85, 64, 'e***0', '环境很好，睡眠舒服，安静舒适', NULL, 41, 1, 4.1, 4.3, 4.9, 4.8, 4.1, 4.4, '2023-11-28 14:23:55', NULL);
INSERT INTO `comments` VALUES (513, 85, 64, 'e***0', '到每一个城市，可以的话都是首选四季，深圳四季虽然开业早，但房间设施维护保养很好，最喜欢四季的床上用品，睡得踏实。', NULL, 41, 1, 4.8, 4.1, 4.1, 5, 4.3, 4.5, '2023-12-25 09:53:35', NULL);
INSERT INTO `comments` VALUES (514, 85, 4, 'kg', '位置好服务给力', NULL, 41, 0, 4.8, 4.5, 4.7, 4.1, 4, 4.4, '2024-01-21 11:10:31', NULL);
INSERT INTO `comments` VALUES (515, 85, 95, 'v***3', '超一流的服务，在疫情期间还能做到如此细致的服务，我要对四季酒店全体员工表示感谢和赞许。其实最近一段时间打卡了深圳柏悦、MO等一众新奢华酒店，但是对比下来，即便是开业已有些许年头的四季，房间到大堂的硬件设施的维护还是很到位的。另外，四季的餐饮真的超一流。', NULL, 41, 0, 4.3, 4.5, 4.6, 4.7, 4.9, 4.6, '2023-12-25 18:25:17', NULL);
INSERT INTO `comments` VALUES (516, 85, 133, 'j***9', '酒店挺舒服', NULL, 41, 0, 4.8, 4.2, 4.2, 4.7, 4.6, 4.5, '2024-03-09 23:01:48', NULL);
INSERT INTO `comments` VALUES (517, 85, 68, 'N***5', '愉快地四天结束，再这里要感谢一下四季的整个服务。还是一如既往地高标准。每一个地方都要夸，从门童开始，到打扫的阿姨，再到餐厅的工作人员，还有泳池的两位保护人员，每一个人都印象深刻。这里还要特别感觉前台的Tonty Wang先生。第一天来的时候房间还没有打扫好，我要求也比较多，一定要离电梯口近，王先生都一一满足。下次来深圳肯定还是选四季了。', NULL, 41, 0, 4.7, 4.5, 4.6, 5, 4.1, 4.6, '2023-12-04 22:40:16', NULL);
INSERT INTO `comments` VALUES (518, 85, 89, 'F***9', '网红酒店，亲子游首选，各方面都很好，我定了两个房间，都不错，很满意，吃饭也不错，大套房view相当好，很满意。', NULL, 41, 0, 4.7, 4, 4.3, 4.3, 4.2, 4.3, '2023-12-27 15:44:55', NULL);
INSERT INTO `comments` VALUES (519, 85, 111, 'M***6', '领导出差，代订的。但是第二晚领导要求续住，这个酒店应该不错。', NULL, 41, 0, 4.6, 4.7, 4.4, 4.3, 4.6, 4.5, '2024-01-07 20:25:08', NULL);
INSERT INTO `comments` VALUES (520, 85, 150, 'o***8', '满意 你可以永远相信四季。', NULL, 41, 0, 4.4, 4.9, 4.4, 4.9, 4.9, 4.7, '2023-12-26 12:50:50', NULL);
INSERT INTO `comments` VALUES (521, 85, 171, 'X***1', '很少写差评，但是这次真的忍不了，说真的这设施和服务还比不上亚朵之类的酒店。房间感觉就是灰蒙蒙脏兮兮，吹风机还不如快捷酒店的。两件浴袍挂墙上，早餐的布局更是奇奇怪怪晕头转向。第二天就住隔壁的丽思卡尔顿，整个人都舒服多了。', NULL, 41, 0, 4.1, 4.7, 4.1, 4.1, 4.5, 4.3, '2023-12-25 18:25:52', NULL);
INSERT INTO `comments` VALUES (522, 85, 119, 'X***7', '虽然是商务酒店，但是对于一拖二的我来说很友好。特别要夸下前台的小林（女生），先是给我们升级到豪华套房，又为专门为小朋友准备了儿童牙膏牙刷及鞋子，还送了水果，超贴心的，很nice！房间里面也很舒适干净，酒店里既有室内的泳池，还有室外的泳池，娃儿们随时随地切换，玩的不亦乐乎！整体的体验值蛮不错的！唯一不足就是早餐不够丰富！', NULL, 41, 0, 4.1, 4.9, 4.5, 4.3, 4.8, 4.5, '2023-12-03 23:11:10', NULL);
INSERT INTO `comments` VALUES (523, 85, 151, 'N***7', '老牌酒店装修过时了，服务还是不错的人员素质很高。', NULL, 41, 0, 4.8, 4.8, 4.4, 4.9, 4.1, 4.6, '2024-01-07 20:26:01', NULL);
INSERT INTO `comments` VALUES (524, 85, 120, 'e***2', '交通方便，环境不错，服务尚可房间设施不错', NULL, 41, 1, 4, 4.2, 4.8, 5, 4.1, 4.4, '2023-12-30 00:46:14', NULL);
INSERT INTO `comments` VALUES (525, 85, 67, 'a***6', '第二次来住深圳四季了。依旧很满意！不论是前台工作人员还是客房服务人员都很nice，会很贴心得询问有什么需要帮助的吗。入住期间整个心情都是很好的，因为见到每一位工作人员都会被很亲切的问好。行政餐厅的工作人员也很热情，我们吃完下午茶落下手机特地帮我送来房间还询问我小朋友的用品有没有，需不需要她们帮忙，太贴心啦～ 点名表扬Melody还有Miley，非常热情加贴心，Happyhour time还主动询问小朋友要不要喝一杯睡前牛奶，对四季的爱又多了几分！下次来深圳一定还是毫不犹豫定四季酒店，服务一流，酒店位置也很方便，餐品也绝对能打！', NULL, 41, 0, 4.5, 4.7, 4.3, 4.4, 4.1, 4.4, '2023-10-16 21:47:15', NULL);
INSERT INTO `comments` VALUES (526, 85, 161, 'M***8', '四季是我很喜欢的一个品牌了，特别是深圳四季。从从四季开业就一直是会员，平时无论吃饭还是宴请，都觉得是个挺不错的选择。这次朋友来深，又住了一晚看看。感觉很多小硬件已经跟不上了，例如吹风机、咖啡机、烧水壶。这些配些好点的品牌吧，真希望自己喜欢的酒店能越做越好，而不是只想来吃饭。', NULL, 41, 0, 4.8, 4.8, 4.2, 4.6, 4.8, 4.6, '2023-10-17 21:38:24', NULL);
INSERT INTO `comments` VALUES (527, 86, 118, 'o***4', '干净，舒服，很好很好。', NULL, 32, 0, 4.6, 4.4, 4.3, 5, 4, 4.5, '2024-04-11 20:48:17', NULL);
INSERT INTO `comments` VALUES (528, 86, 119, 'X***7', '酒店整体还可以，也符合预期。泳池有室内外两个，满足不同需求的客人。早餐中规中矩，没有特别之处，吃了五天有点吃腻了，如价格贵的话不建议订购。房间携程给免费升级了房型，比较宽敞，服务不错。', NULL, 32, 0, 4.1, 4.3, 4.8, 4.8, 4.3, 4.5, '2024-04-17 14:54:36', NULL);
INSERT INTO `comments` VALUES (529, 86, 115, 'j***7', '酒店装修比较豪华，体验还可以。', NULL, 32, 0, 4.7, 4.3, 4.5, 5, 4.8, 4.7, '2024-04-24 10:05:34', NULL);
INSERT INTO `comments` VALUES (530, 86, 120, 'e***2', '自驾去深圳，一路上每天都有做核酸，健康码和行程卡均是绿色，持24小时核酸阴性，到了酒店不让进停车场，说是必须落地核酸检测，凭采样回执单才可以进停车场。我说能不能先进停车场把车停了，自驾挺累的，然后马上打车去做检测，拿到采样回执单之后办理入住手续。依然被拒绝！你们智商掉线了吗?检测结果都是24内出，早几分钟做跟晚几分钟做有什么区别?服务太差劲了！差评', NULL, 32, 0, 4.2, 4.1, 4.1, 5, 4.9, 4.5, '2024-04-24 10:06:00', NULL);
INSERT INTO `comments` VALUES (531, 86, 121, 'd***5', '什么都好就是1楼那保安态度巨差 好像客人欠他多少钱一样 大声审问客人是什么人什么房间 像审问人一样让人很不舒服 很没素质 很没礼貌 住过很多次四季了第一次有这么糟糕的体验', NULL, 32, 0, 4.3, 4.9, 4.4, 4.6, 4.8, 4.6, '2024-04-09 18:13:39', NULL);
INSERT INTO `comments` VALUES (532, 86, 122, 's***6', '非常愉快的体验，纪念日入住希望仪式感满满，接待官Mara精心布置香槟、鲜花、气球、水果，中心区夜景迷人令人陶醉；六楼餐厅出品稳定美味；四季的服务亲切、不打扰，给人一种像家一样的舒适感，点赞', NULL, 32, 0, 4.8, 4, 4.6, 4.2, 4, 4.3, '2024-04-07 09:52:01', NULL);
INSERT INTO `comments` VALUES (533, 86, 83, 'y***8', '不仅满意，还有点小感动，四季的Mara服务超越了满分水平，因为这次途径深圳，碰上儿子生日，所以提前跟酒店备注了一下生日布置，本来想酒店只会有简单的生日布置，谁知道Mara提前一天询问孩子的喜好，手工画了孩子喜欢的塞罗奥特曼贺卡，画得还非常好看，第二天自助晚餐不但提前帮忙预定好位置，还亲手画了一个奥特曼面包和礼物，受宠若惊，真种草了，住了好多品牌酒店，四季服务目前我感觉最好的一家，以后还会选择四季。（还有Max Lin等等，四季酒店服务真的不能用语言来表达的好，很开心的一次入住体验）', NULL, 32, 0, 4.6, 4.5, 4, 4, 4.8, 4.4, '2024-04-07 14:00:24', NULL);
INSERT INTO `comments` VALUES (534, 86, 123, 'P***7', '感谢前台小姐姐Anna的安排，四季床品服务都是一如既往的好~虽然设计不潮了，但是睡个舒服安稳觉更重要', NULL, 32, 0, 4.1, 4.7, 4.3, 4.7, 4.3, 4.4, '2024-04-25 20:54:20', NULL);
INSERT INTO `comments` VALUES (535, 86, 124, 'V***9', '非常好的一晚上，免费升房', NULL, 32, 1, 4.7, 4.7, 4.5, 4.1, 4.3, 4.5, '2024-01-04 16:45:34', NULL);
INSERT INTO `comments` VALUES (536, 86, 125, 'U***6', '嗯嗯还好八', NULL, 32, 0, 4.3, 4.8, 4.7, 4.3, 4.3, 4.5, '2024-04-01 18:08:52', NULL);
INSERT INTO `comments` VALUES (537, 86, 76, 'v***5', '服务很棒棒，小孩不小心碰伤了小腿，两位小姐姐哥哥上来送药和创可贴很贴心', NULL, 32, 0, 4.6, 4.3, 4.4, 4.2, 4.6, 4.4, '2024-04-05 15:50:33', NULL);
INSERT INTO `comments` VALUES (538, 86, 71, 'h***1', '酒店交通方便，离平安大厦和cocopark几分钟路程即到，美食和购物两不误，商业恰谈附近多场所。酒店枕头无可挑剔，不会觉得颈椎难受。', NULL, 32, 0, 4.4, 4.5, 4.1, 4.2, 4.7, 4.4, '2024-03-13 09:40:27', NULL);
INSERT INTO `comments` VALUES (539, 86, 121, 'd***5', '房间舒适，景观精彩，卫生间标配是智能马桶。这在中国酒店里凤毛麟角。服务人员态度很好，综合整个酒店感觉，与日本东京的五星级酒店非常接近了。不容易，值得点赞。', NULL, 32, 0, 4.7, 4.5, 4.2, 4.9, 4.6, 4.6, '2024-03-24 18:50:46', NULL);
INSERT INTO `comments` VALUES (540, 86, 104, 'W***0', '深圳四季酒店超级值得入住！喜欢四季的服务，喜欢四季的房间，更喜欢她们细致入微的服务；', NULL, 32, 0, 4.2, 4.6, 4.3, 4.7, 4.8, 4.5, '2024-04-08 18:02:02', NULL);
INSERT INTO `comments` VALUES (541, 86, 126, 'r***3', '环境好 服务好', NULL, 32, 0, 4.6, 4.5, 4.6, 4.1, 4.7, 4.5, '2024-03-08 15:17:53', NULL);
INSERT INTO `comments` VALUES (542, 86, 122, 'S***6', '非常好！会再住。', NULL, 32, 0, 4.8, 4, 4.2, 4.1, 4.5, 4.3, '2024-03-08 15:18:24', NULL);
INSERT INTO `comments` VALUES (543, 86, 127, 'B***5', '交通位置便利，就在会展中心旁边，给升级了房型，入住体验特别好。', NULL, 32, 0, 4.2, 4.8, 4.6, 4.1, 4.1, 4.4, '2024-04-01 18:08:15', NULL);
INSERT INTO `comments` VALUES (544, 86, 66, 'd***3', '酒店住的非常舒服  一如既往的好 位置方便 房间也是比较宽 不会有压迫 礼宾部的黄经理 很不错 帮忙提行李 有什么需要都会招呼好', NULL, 32, 0, 4.2, 4.6, 4.5, 4.5, 4.9, 4.5, '2024-03-12 00:04:31', NULL);
INSERT INTO `comments` VALUES (545, 86, 68, 'n***5', '服务态度真的是非常好，深圳住过的酒店里服务感觉也算数一数二了。', NULL, 32, 0, 5, 4.8, 4.1, 4.7, 4.5, 4.6, '2024-03-08 15:19:22', NULL);
INSERT INTO `comments` VALUES (546, 86, 128, 'y***2', '感觉四季年限有点久了，但是最喜欢住的还是四季', NULL, 32, 0, 4.6, 4, 4.3, 4.7, 4.9, 4.5, '2024-04-06 08:48:08', NULL);
INSERT INTO `comments` VALUES (547, 87, 60, '匿名用户', '房间漂亮，早餐丰富', NULL, 42, 1, 4.1, 4.5, 4, 4.6, 4.7, 4.4, '2024-04-12 19:24:40', NULL);
INSERT INTO `comments` VALUES (548, 87, 83, 'Y***8', '非常非常高级', NULL, 42, 0, 4.9, 4.1, 4.3, 5, 4.5, 4.6, '2024-04-12 17:22:46', NULL);
INSERT INTO `comments` VALUES (549, 87, 109, 'c***8', '住的行政房，整体还是挺满意的，房间够大，能看到对面的平安金融和会展中心，位置很好。行政酒廊的下午茶和欢乐时光也还不错，去哪都挺方便的，早餐很丰富', NULL, 42, 0, 5, 4, 4.7, 4.1, 4.7, 4.5, '2024-03-13 20:33:07', NULL);
INSERT INTO `comments` VALUES (550, 87, 172, 'z***9', '非常不错，可以', NULL, 42, 0, 4.8, 4.3, 4.7, 4.8, 4.7, 4.7, '2024-03-12 14:23:46', NULL);
INSERT INTO `comments` VALUES (551, 87, 171, 'X***1', '交通方便 夜景好看', NULL, 42, 0, 4.2, 4.6, 4.1, 4.6, 4.4, 4.4, '2018-11-04 07:59:10', NULL);
INSERT INTO `comments` VALUES (552, 87, 151, 'n***7', '大大啊啊啊啊啊', NULL, 42, 0, 4.2, 4.9, 4.6, 4.6, 4.9, 4.6, '2022-07-26 15:43:14', NULL);
INSERT INTO `comments` VALUES (553, 87, 173, 'H***3', '核酸检测报告24', NULL, 42, 0, 4.3, 4.4, 4.7, 4.6, 4.9, 4.6, '2022-01-06 20:12:20', NULL);
INSERT INTO `comments` VALUES (554, 87, 167, 'Q***0', '四季的接待能力和服务意识都很强', NULL, 42, 0, 4.4, 4.2, 4.2, 4.8, 4.6, 4.4, '2021-05-18 12:38:11', NULL);
INSERT INTO `comments` VALUES (555, 87, 128, 'Y***2', '一如既往的好，每次来福田肯定选四季酒店，安静整洁温馨，主要还是床睡的舒服，五星里价格比较实惠的性价比超高。', NULL, 42, 0, 5, 4, 4.2, 4.9, 4.5, 4.5, '2018-03-01 21:18:14', NULL);
INSERT INTO `comments` VALUES (556, 87, 106, 'M***0', '房间中规中矩，卫生很不错，服务也在线。', NULL, 42, 0, 4.2, 4.7, 4.3, 4.7, 4.6, 4.5, '2022-04-22 09:40:47', NULL);
INSERT INTO `comments` VALUES (557, 87, 92, 'L***9', '服务非常好！除了房间旧了点有点霉味', NULL, 42, 0, 4, 4.8, 4.6, 4.6, 4.6, 4.5, '2022-04-23 09:44:35', NULL);
INSERT INTO `comments` VALUES (558, 87, 112, 'l***7', '四季不会令你失望', NULL, 42, 0, 4.5, 4.5, 4.8, 4.1, 4.6, 4.5, '2022-04-17 14:33:47', NULL);
INSERT INTO `comments` VALUES (559, 87, 71, 'H***1', '与会展中心一路之隔 非常方便，附近好吃的购物的地方也特别的多，不管是乘坐地铁还是私家车出行都非常方便。', NULL, 42, 0, 5, 4.6, 4.7, 4.3, 4.5, 4.6, '2022-04-17 14:33:14', NULL);
INSERT INTO `comments` VALUES (560, 87, 73, 'U***8', '服务真的很好 价格合理', NULL, 42, 0, 4.3, 4.1, 4.7, 4.8, 4.2, 4.4, '2018-02-22 18:56:41', NULL);
INSERT INTO `comments` VALUES (561, 87, 111, 'm***6', '开瓶器不完美 一点小错误 酒店当做大事处理 换开瓶器 送酒 副经理亲自道歉 光是这个态度 就令人对他们以客为尊的敬业精神 点赞 也为他们求好心切的服务态度致敬', NULL, 42, 0, 4.5, 4.1, 4.5, 4.8, 4.2, 4.4, '2018-04-07 21:46:50', NULL);
INSERT INTO `comments` VALUES (562, 87, 174, '雄***0', '很棒的酒店，很值得推荐，服务超级好！', NULL, 42, 0, 4.1, 4.2, 4.8, 4.8, 4.6, 4.5, '2019-06-01 00:02:11', NULL);
INSERT INTO `comments` VALUES (563, 87, 104, 'W***0', '交通方便，周边吃饭可选择多', NULL, 42, 0, 4.1, 4.5, 4.9, 4.5, 4.2, 4.4, '2022-04-20 22:21:59', NULL);
INSERT INTO `comments` VALUES (564, 87, 175, 'p***9', '还是很不错的一家星级酒店，老板住的还算满意，基本上每次到深圳出差，老板都会让定这家酒店。主要方便设施好，服务业到位。', NULL, 42, 0, 4.8, 5, 4.9, 4.6, 4.8, 4.8, '2018-08-15 15:50:56', NULL);
INSERT INTO `comments` VALUES (565, 87, 61, 'A***0', '很好，下次还会入住', NULL, 42, 0, 4.2, 4, 4.8, 4.3, 4.9, 4.4, '2021-12-27 16:55:28', NULL);
INSERT INTO `comments` VALUES (566, 88, 58, 'b***9', '特别的好，很喜欢，下次还住这', NULL, 43, 1, 5, 4.2, 4.4, 4.7, 4.9, 4.6, '2024-03-17 00:25:19', NULL);
INSERT INTO `comments` VALUES (567, 88, 157, 'O***0', '很满意，早餐很好吃，有停车场，周边有很多适合打卡的美食，也有核酸检测点', NULL, 43, 1, 4.7, 4.1, 4.4, 4.5, 4.6, 4.5, '2024-03-16 19:56:47', NULL);
INSERT INTO `comments` VALUES (568, 88, 107, 'H***5', '时隔三年第二次入住，服务态度好，房间设施齐全，毛巾枕头很舒服，大人和孩子都喜欢。疫情期间的消毒工作做得好。', NULL, 43, 1, 4.2, 4.9, 4.6, 4.8, 4.6, 4.6, '2024-03-20 14:34:54', NULL);
INSERT INTO `comments` VALUES (569, 88, 85, 'i***6', '住的非常舒服的酒店，服务一流。', NULL, 43, 1, 4.5, 4.8, 4.9, 4.8, 4.7, 4.7, '2024-03-18 14:11:30', NULL);
INSERT INTO `comments` VALUES (570, 89, 77, 'n***9', '不错 干净 温馨', NULL, 30, 0, 4.6, 4.2, 4.1, 4.8, 4.7, 4.5, '2024-02-13 18:23:17', NULL);
INSERT INTO `comments` VALUES (571, 89, 121, 'D***5', '服务热情，当有困难时，前台的Toni Wang先生积极地帮忙协调并圆满解决；干净卫生；房间超赞；地理位置好', NULL, 30, 1, 4.8, 4.7, 4, 4.9, 4.7, 4.6, '2021-02-27 17:06:02', NULL);
INSERT INTO `comments` VALUES (572, 89, 65, 'Z***5', '酒店自助早餐种类极少，服务跟不上，房间内的热水壶有上一客人留下的水和污垢都没有清理打扫也都很随意', NULL, 30, 0, 4.6, 4.6, 4.2, 5, 4.9, 4.7, '2021-10-19 20:02:33', NULL);
INSERT INTO `comments` VALUES (573, 89, 176, '1***9', '个人住过第二喜欢的酒店，超级实力。', NULL, 30, 0, 4.4, 4.9, 4.6, 4.6, 4.8, 4.7, '2023-03-09 16:30:09', NULL);
INSERT INTO `comments` VALUES (574, 89, 137, 'l***3', '这是不错的酒店', NULL, 30, 0, 4.3, 4.5, 4.8, 4.3, 4.9, 4.6, '2021-10-20 15:39:17', NULL);
INSERT INTO `comments` VALUES (575, 89, 166, 'Z***7', '专程为了新荣记来的', NULL, 30, 0, 4.5, 4.9, 4.8, 4.5, 4.3, 4.6, '2021-10-18 21:23:36', NULL);
INSERT INTO `comments` VALUES (576, 89, 108, 'Y***0', '在同等价位在五星级酒店里面，总体感觉一般。包括酒店的设施，房间的布局都比较一般。跟其他城市的四季也没法比。', NULL, 30, 0, 4.1, 4.1, 4.8, 4.5, 4.9, 4.5, '2021-05-22 22:16:46', NULL);
INSERT INTO `comments` VALUES (577, 89, 177, 'A***8', '四季真是靠谱无论年限多久，四季的品质都在。前台的Tony服务很专业贴心，推荐升级了房型很舒心很值得。健身房是选择入住四季最喜欢的原因之一，设计合理干净舒适。停车免费，酒店位置得天独厚，平安金融中心.皇庭…过路即是。four season 明智选择。', NULL, 30, 0, 4.7, 4.5, 4.4, 4.4, 4.7, 4.5, '2021-10-26 15:37:46', NULL);
INSERT INTO `comments` VALUES (578, 89, 109, 'c***8', '前台lucy人特别好', NULL, 30, 0, 4.4, 4.8, 4.3, 4.8, 4.5, 4.6, '2021-10-18 21:22:52', NULL);
INSERT INTO `comments` VALUES (579, 89, 178, 'r***1', '挺好，有点日子了，不过服务不错', NULL, 30, 0, 5, 4.5, 4.6, 4.2, 5, 4.7, '2021-09-11 11:57:35', NULL);
INSERT INTO `comments` VALUES (580, 90, 60, '匿名用户', '床品无可挑剔', NULL, 44, 0, 4.5, 4.8, 4.7, 4.5, 4.4, 4.6, '2024-04-06 11:16:51', NULL);
INSERT INTO `comments` VALUES (581, 90, 179, '3***4', '交通：方便', NULL, 44, 0, 4.5, 4.7, 4.1, 4.5, 4.9, 4.5, '2024-02-11 12:33:40', NULL);
INSERT INTO `comments` VALUES (582, 90, 180, '1***8', '非常好的体验，酒店格局特别方便。地理位置也很好。酒店的日本料理餐厅非常好吃。spa也非常不错。楼下对面就是核酸点非常方便。', NULL, 44, 0, 4.6, 4.3, 4, 4.7, 4.1, 4.3, '2023-05-02 16:24:05', NULL);
INSERT INTO `comments` VALUES (583, 90, 181, '9***2', '深圳必住之一', NULL, 44, 0, 4.8, 4.6, 4.1, 5, 4.5, 4.6, '2023-03-01 23:41:20', NULL);
INSERT INTO `comments` VALUES (584, 91, 169, 'M***4', '酒店很舒适 四季品质 不错', NULL, 45, 0, 4.7, 4.1, 4.7, 4.3, 4.6, 4.5, '2023-11-22 16:18:28', NULL);
INSERT INTO `comments` VALUES (585, 91, 182, 'r***9', '环境舒适度一如既往的好，早餐种类略为逊色。', NULL, 45, 0, 4.4, 4.1, 4.2, 4.8, 4.2, 4.3, '2022-12-04 19:45:57', NULL);
INSERT INTO `comments` VALUES (586, 91, 157, 'o***0', '老顾客啦 升房型很满意 前台很热心', NULL, 45, 0, 4.7, 5, 4.8, 4.1, 4.5, 4.6, '2023-04-29 17:16:36', NULL);
INSERT INTO `comments` VALUES (587, 91, 175, 'p***9', '环境很不错，房间很大，设施齐全', NULL, 45, 0, 4.3, 4.7, 4.7, 4, 4.4, 4.4, '2023-02-13 12:19:17', NULL);
INSERT INTO `comments` VALUES (588, 91, 64, 'E***0', '四季的服务当然一直保持高水准，退房时不小心被消毒液喷到眼睛，前台小姐姐和行政经理都很紧张的帮我处理，体验上还是很不错的，虽然眼睛有点辣痛', NULL, 45, 0, 4.8, 4.9, 4.1, 4, 4.4, 4.4, '2023-01-10 08:11:06', NULL);
INSERT INTO `comments` VALUES (589, 91, 150, 'o***8', '泳池很好 房间太老', NULL, 45, 0, 4.3, 4.8, 4.7, 4.1, 4.5, 4.5, '2023-06-18 12:45:38', NULL);
INSERT INTO `comments` VALUES (590, 92, 60, '匿名用户', '这家四季不行啊，环境很一般，建议初次来深圳的朋友就不要选这家了。我怕你们住了对深圳印象变差。在深圳可选择的五星酒店还有很多。这家四季跟四星差不多，性价比偏低，市中心视野也不好，周围都是高楼。早餐种类更是少，华而不实，东西没有了也不会及时添加。广州的四季我没住过，不知道是不是现在所有四季就这水平。比较失望！', NULL, 46, 0, 4, 4.6, 4.1, 4.9, 4.7, 4.5, '2023-08-02 13:04:41', NULL);
INSERT INTO `comments` VALUES (591, 92, 183, '2***5', '给升级了一下，服务很好', NULL, 46, 0, 4.3, 4.6, 4.9, 4.7, 4.7, 4.6, '2023-05-09 08:43:33', NULL);
INSERT INTO `comments` VALUES (592, 92, 184, 'e***8', '酒店服务细节真的拉满，因为鞋子磨破了脚后跟，酒店直接准备了一整包创可贴，还拿了一双拖鞋给我们穿。', NULL, 46, 0, 4.5, 4.6, 5, 4.7, 4.3, 4.6, '2023-04-02 11:32:56', NULL);
INSERT INTO `comments` VALUES (593, 93, 185, 'd***9', '交通还是挺方便的，周边设施配套齐全，家人看了也很满意。房间大小正好，也很干净整洁，打算下次再次预订。', NULL, 47, 0, 4.8, 4.2, 4.3, 4.6, 5, 4.6, '2024-03-20 15:53:33', NULL);
INSERT INTO `comments` VALUES (594, 94, 87, 'f***5', '不错的一次入住体验', NULL, 48, 1, 4.8, 4.5, 4.7, 4.7, 4.1, 4.6, '2024-03-28 23:07:40', NULL);
INSERT INTO `comments` VALUES (595, 94, 170, 's***4', '四季的环境和硬件肯定没得说，豪华！', NULL, 48, 1, 4.3, 5, 4.6, 4.8, 4.4, 4.6, '2024-03-28 23:09:59', NULL);
INSERT INTO `comments` VALUES (596, 94, 4, 'kg', '一开始“升级”到8楼的房间，味道极重，就像多年没人住的那种灰尘味。而且8楼隔着泳池、会所等功能区域，人来往肯定吵杂。又跑前台才给换的房，这所谓的“升级”不是忽悠人嘛。所以如果前台说给“升级”到8楼就直接拒绝吧。', NULL, 48, 1, 4.8, 4.5, 4.7, 4.9, 4.7, 4.7, '2024-03-28 23:08:22', NULL);
INSERT INTO `comments` VALUES (597, 94, 97, 'S***2', '四季酒店服务环境都是顶尖，非常感谢前台Tony Wang的耐心讲解和服务安排。200元餐饮无门槛消费券，令入住性价比变得非常非常高！', NULL, 48, 1, 4.1, 4.6, 4.5, 4.4, 4.5, 4.4, '2024-03-28 23:08:45', NULL);
INSERT INTO `comments` VALUES (598, 94, 166, 'z***7', '服务人员态度好', NULL, 48, 0, 4.5, 4.5, 4.3, 4.5, 4.2, 4.4, '2023-07-23 07:03:30', NULL);
INSERT INTO `comments` VALUES (599, 94, 186, 'M***2', '四个季节永远不会让我们失望。我们有一个蹒跚学步的孩子，他们为我们准备了所有便利设施，包括奶瓶加热器和额外的尿布。电子早餐很棒~', NULL, 48, 1, 4.2, 4.2, 4.3, 4.1, 4.6, 4.3, '2022-10-09 16:25:19', NULL);
INSERT INTO `comments` VALUES (600, 95, 93, 'u***4', '服务很好，只是晚上九点多有听到莫名的门铃响，查监控没有人，酒店及时的给我们申请了换房，说可能门铃线路有问题。', NULL, 49, 1, 4.9, 4.6, 4.2, 5, 4.6, 4.7, '2023-08-27 21:03:53', NULL);
INSERT INTO `comments` VALUES (601, 95, 118, 'O***4', '各方面都比较满意', NULL, 49, 0, 4.3, 4, 4.4, 4, 4.8, 4.3, '2023-07-04 16:32:14', NULL);
INSERT INTO `comments` VALUES (602, 95, 187, 'U***2', '老牌五星级酒店，虽然硬件设施慢慢旧了，但服务依然一级棒。简单的一个要求，Mara都可以做得细致入微，语言没办法表达对她和整个服务团队的感谢，唯有继续支持下去！', NULL, 49, 0, 4.5, 4, 4.2, 4.1, 4, 4.2, '2023-07-04 20:08:12', NULL);
INSERT INTO `comments` VALUES (603, 95, 129, 'a***4', '酒店热情接待，服务好。打扫干净卫生，周边交通方便。环境优美自然。游泳池也有露天和室内可以选择。推荐大家', NULL, 49, 1, 4.9, 4.5, 4.1, 4.3, 4.4, 4.4, '2023-06-10 15:21:29', NULL);
INSERT INTO `comments` VALUES (604, 95, 93, 'U***4', '在福田中心区，有两个游泳池太棒了！', NULL, 49, 1, 4.8, 4.3, 4, 5, 4.5, 4.5, '2023-06-13 09:29:24', NULL);
INSERT INTO `comments` VALUES (605, 95, 143, 'K***6', '高端大气上档次，非常喜欢', NULL, 49, 1, 4.6, 4.4, 4.4, 5, 4.7, 4.6, '2023-06-12 10:41:54', NULL);
INSERT INTO `comments` VALUES (606, 95, 188, 'P***3', '为前台值班经理Jeffery点赞。首先是对四季品牌的青睐，加上酒店的地址位置也相当便利，所以选择到店前先来酒店参观。Jeffery热情的欢迎和带看酒店了多种房型介绍房内设施，自助餐厅、健身房以及室内外泳池。最后确定了房型预定了房间，希望第二天尽早入住，Jeffery按相应的房型以及到店时间帮我安排了房间，顺利入住。房间卫生干净整洁，感谢Jeffey的服务。', NULL, 49, 1, 4.9, 4.5, 4.4, 4.6, 4.7, 4.6, '2023-07-02 17:41:45', NULL);
INSERT INTO `comments` VALUES (607, 95, 120, 'E***2', '还是不错的选择', NULL, 49, 1, 4.7, 4.6, 4.5, 4.4, 4.6, 4.6, '2023-07-01 13:24:01', NULL);
INSERT INTO `comments` VALUES (608, 95, 86, 'N***3', '很好，优秀，舒服，服务态度非常好', NULL, 49, 1, 4.2, 4.5, 5, 4.2, 4.8, 4.5, '2023-07-06 17:52:56', NULL);
INSERT INTO `comments` VALUES (609, 95, 140, 'c***4', '交通：处于深圳CBD 交通很方便 楼下就是会展中心', NULL, 49, 0, 4.2, 4.5, 4.2, 4.8, 4.3, 4.4, '2023-06-17 17:36:43', NULL);
INSERT INTO `comments` VALUES (610, 95, 149, 'B***1', '乱收钱我就有点搞不懂了，在餐厅消费签单是一个价格，结果退房的时候又多收钱，这是啥个意思，搞不清楚，至今也没联系我讲清楚，蛮搞笑的。', NULL, 49, 0, 4.2, 4.5, 4.7, 4.4, 4.7, 4.5, '2023-06-25 20:01:33', NULL);
INSERT INTO `comments` VALUES (611, 95, 78, 'h***9', '不偏不倚的五星酒店吧', NULL, 49, 0, 4.4, 4.6, 4.4, 4.6, 4.9, 4.6, '2023-07-03 12:42:36', NULL);
INSERT INTO `comments` VALUES (612, 95, 74, 't***9', '酒店卫生', NULL, 49, 0, 4.6, 4.6, 4.2, 4.2, 4.2, 4.4, '2023-06-08 13:39:49', NULL);
INSERT INTO `comments` VALUES (613, 95, 79, 'G***4', '前台小林服务超棒，帮我把行李送到停车场。房间超奢华，床超舒服。喜欢出差，是因为喜欢住四季。', NULL, 49, 0, 4.9, 4.4, 4.7, 4.1, 4.8, 4.6, '2023-07-03 11:18:30', NULL);
INSERT INTO `comments` VALUES (614, 95, 140, 'C***4', '前台服务员热情有责任感', NULL, 49, 0, 4.9, 4.1, 4.5, 4.3, 5, 4.6, '2023-06-06 21:05:21', NULL);
INSERT INTO `comments` VALUES (615, 95, 99, 'q***8', '这个四季酒店太残旧了', NULL, 49, 0, 4.2, 5, 4, 4.4, 4.1, 4.3, '2023-07-03 10:35:19', NULL);
INSERT INTO `comments` VALUES (616, 96, 116, 'c***6', '非常干净！非常安静！非常好！', NULL, 49, 0, 4.2, 4.5, 4.9, 4.9, 4, 4.5, '2024-02-07 13:09:54', NULL);
INSERT INTO `comments` VALUES (617, 96, 164, 'Z***1', '地理位置很方便！房间很干净！床超舒服！', NULL, 49, 0, 4.3, 4.3, 4.4, 4.2, 4.1, 4.3, '2024-02-07 13:12:15', NULL);
INSERT INTO `comments` VALUES (618, 96, 171, 'x***1', '很好，各方面都很不错', NULL, 49, 0, 4.1, 4.3, 4.7, 4.2, 4.6, 4.4, '2023-09-10 14:42:13', NULL);
INSERT INTO `comments` VALUES (619, 96, 189, '2***3', '非常舒适的一次入住体验，从入住一直到退房，所有见到的酒店工作人员都保持超高的服务意识，是四季该有的水准。酒店的位置、景观、餐饮都是一流，虽然已开业10年，但基础设施还不算陈旧，风格是可以被大多数人接受的。唯一遗憾就是没来得及去酒店泳池游一圈，下次一定补上。', NULL, 49, 1, 4.6, 4.6, 4.4, 4.4, 4.3, 4.5, '2023-07-31 09:58:53', NULL);
INSERT INTO `comments` VALUES (620, 96, 155, 'x***9', '酒店装修高端，大气，服务员服务热情周到，周边环境优美，交通出行方便，早餐和餐厅菜品美味可口，房间床很舒服很软，酒店房间卫生干净整洁，值得推荐', NULL, 49, 0, 4.3, 4.8, 4.2, 4.7, 4.5, 4.5, '2023-08-15 12:30:36', NULL);
INSERT INTO `comments` VALUES (621, 96, 155, 'x***9', '不赖不赖不赖', NULL, 49, 0, 4.6, 4.1, 4.6, 4.1, 4.4, 4.4, '2023-08-26 14:24:19', NULL);
INSERT INTO `comments` VALUES (622, 96, 57, '2***4', '老牌五星酒店 服务态度特别好 整天环境很安静 坐落于福田cbd中心 交通也很便利 出行方便 周边美食也比较多 不错的酒店前台Max 林小姐的服务很热情 也很贴心 人超级好', NULL, 49, 0, 4, 4.5, 5, 4.1, 4.6, 4.4, '2023-06-01 08:16:51', NULL);
INSERT INTO `comments` VALUES (623, 96, 123, 'P***7', '贼**搞笑，新的房间入住进去，垃圾桶里有个用过的开塞露躺着，每一次住这家四季 永远都有幺蛾子，服务态度很差很差几乎没有服务，现在连卫生都保证不了了，有点垃圾。', NULL, 49, 0, 4.1, 4.5, 4.4, 4.4, 4.8, 4.4, '2023-06-11 22:12:12', NULL);
INSERT INTO `comments` VALUES (624, 96, 118, 'o***4', '在这家酒店住得很舒服，下次还要来住他们家服务很好。', NULL, 49, 0, 4.2, 4.1, 4.9, 4.6, 4.5, 4.5, '2023-06-25 20:04:38', NULL);
INSERT INTO `comments` VALUES (625, 96, 102, 't***7', '游泳池比较浅适合孩子玩，葡萄牙大厨定制法餐赞。', NULL, 49, 0, 4.2, 4.1, 5, 4.3, 4.8, 4.5, '2023-06-14 23:24:12', NULL);
INSERT INTO `comments` VALUES (626, 96, 187, 'U***2', '很好这个酒店', NULL, 49, 0, 4.9, 5, 4.7, 4.3, 4.5, 4.7, '2023-05-09 23:05:34', NULL);
INSERT INTO `comments` VALUES (627, 96, 70, 'o***6', '入住时候非常的方便，酒店稍显久，毕竟是13年开业的！续房的时候有点不愉快，本来是在携程上原房续住就好，结果出来一个男性前台！满脸不开心，接下来就是推他们自己的套餐看的旁边的小姑娘一愣一愣的！估计是想完成业务吧！给他点个赞。', NULL, 49, 0, 4.4, 4.2, 4.5, 4.9, 4, 4.4, '2023-05-07 18:07:57', NULL);
INSERT INTO `comments` VALUES (628, 96, 137, 'l***3', '很好房间还升级了。服务还是很体贴。', NULL, 49, 1, 4.7, 4.1, 4.8, 4.4, 4.9, 4.6, '2023-04-26 17:49:36', NULL);
INSERT INTO `comments` VALUES (629, 96, 150, 'o***8', '服务：非常细节  提前和女朋友过生日，酒店免费升级了房型和布置得好好看！', NULL, 49, 0, 4, 4.2, 4.7, 4.3, 4.1, 4.3, '2023-04-21 10:01:40', NULL);
INSERT INTO `comments` VALUES (630, 96, 150, 'o***8', '服务和工作人员像往常一样很棒。这是我们第二次选择 4 Seasons 住宿。', NULL, 49, 0, 4.2, 4.8, 4.6, 4.5, 4.6, 4.5, '2023-04-22 13:38:10', NULL);
INSERT INTO `comments` VALUES (631, 96, 99, 'Q***8', '可惜室外游泳池没有营业。房间保持清洁，并提供儿童用品。会所和早餐都很拥挤，所以食物不够用。', NULL, 49, 1, 4.4, 4.8, 4.1, 4.2, 4.5, 4.4, '2023-04-24 22:32:03', NULL);
INSERT INTO `comments` VALUES (632, 97, 76, 'V***5', '干净，安静。美味的早餐，只需要额外支付，所以加起来每晚超过1K', NULL, 49, 0, 5, 4.5, 4, 4.3, 4.1, 4.4, '2024-02-07 13:10:11', NULL);
INSERT INTO `comments` VALUES (633, 97, 85, 'i***6', '服务热情周到', NULL, 49, 0, 4.4, 4.9, 4, 4, 4.1, 4.3, '2024-02-07 13:11:06', NULL);
INSERT INTO `comments` VALUES (634, 97, 91, 'i***2', '干净舒服舒适', NULL, 49, 0, 4.4, 4.1, 4.7, 4.9, 4.5, 4.5, '2023-10-20 18:06:39', NULL);
INSERT INTO `comments` VALUES (635, 97, 153, 'R***5', '闹中取静是最大的优点，适合商务出差，旅行', NULL, 49, 1, 4.9, 4.3, 4.2, 4.4, 4.3, 4.4, '2023-09-10 12:15:09', NULL);
INSERT INTO `comments` VALUES (636, 98, 77, 'n***9', '各个方面都无可挑剔', NULL, 49, 0, 4.8, 4.1, 4.3, 4.7, 4.4, 4.5, '2024-04-15 10:47:21', NULL);
INSERT INTO `comments` VALUES (637, 98, 120, 'E***2', '第N次入住！地理位置好！体验感好！泳池和健身房设施很好！早餐也丰富！特别感谢Hailey的房间安排。', NULL, 49, 0, 4.8, 4.8, 4.9, 4.3, 4.3, 4.6, '2024-02-17 12:17:57', NULL);
INSERT INTO `comments` VALUES (638, 98, 190, 'B***3', '和女朋友一起住了。特别好！', NULL, 49, 0, 4.5, 4, 4, 5, 4.9, 4.5, '2023-11-03 18:04:19', NULL);
INSERT INTO `comments` VALUES (639, 98, 142, 'N***1', '服务超级好', NULL, 49, 0, 4.2, 4.4, 4.2, 4.4, 4.8, 4.4, '2023-08-08 11:58:57', NULL);
INSERT INTO `comments` VALUES (640, 98, 188, 'p***3', '再次入住依然体验满分！特别是Max小姐贴心的帮助和专业的支持，难得在防疫期间也能让我们商务出行非常顺利', NULL, 49, 0, 4.7, 4.5, 4.4, 4.6, 4.1, 4.5, '2023-08-01 08:30:05', NULL);
INSERT INTO `comments` VALUES (641, 98, 191, 't***5', '行政酒廊的服务很好，尤其要表扬小林姑娘和小葛姑娘，服务周到 细心，谢谢她们！', NULL, 49, 0, 4, 4.3, 4.8, 4.8, 4.3, 4.4, '2023-07-22 17:02:34', NULL);
INSERT INTO `comments` VALUES (642, 98, 177, 'a***8', '经常住的一家酒店之一，挺好', NULL, 49, 0, 4.5, 4.4, 4.9, 4.7, 4.2, 4.5, '2023-07-16 00:22:21', NULL);
INSERT INTO `comments` VALUES (643, 98, 106, 'M***0', '房间里有蚊子，早餐不错', NULL, 49, 1, 4.1, 4.2, 4.8, 4.7, 4.9, 4.5, '2023-06-10 11:11:18', NULL);
INSERT INTO `comments` VALUES (644, 98, 156, 'i***8', '真的很不错，服务和入住体验都不错', NULL, 49, 1, 4.7, 4.7, 4.7, 4.8, 4.5, 4.7, '2023-06-12 10:37:51', NULL);
INSERT INTO `comments` VALUES (645, 98, 97, 's***2', '非常难忘的一次体验，男朋友生日提前预定好的，非常感谢礼宾部的Max和Peter，太贴心了帮我们准备了蛋糕还有布制，让我们有了一次美好的入住体验，回家的感觉，以后住酒店就认准四级了真不愧是五星级酒店，窗外风景也很好，楼下酒廊的东西也不错。', NULL, 49, 0, 4, 4, 4.2, 4.5, 4.1, 4.2, '2023-11-12 14:05:56', NULL);
INSERT INTO `comments` VALUES (646, 98, 77, 'n***9', '服务态度恶劣，停车场啃爹！', NULL, 49, 0, 4.2, 4, 4.5, 4.5, 4.4, 4.3, '2023-07-23 12:13:23', NULL);
INSERT INTO `comments` VALUES (647, 98, 104, 'W***0', '酒店位置绝佳，附近餐饮商场办公核酸应有尽有，高于七星酒店的贴心服务，感谢MAX及各位的热情及细心，让我有家的感觉，以后深圳只住四季！', NULL, 49, 0, 4.4, 4.4, 4.4, 4.6, 4.9, 4.5, '2023-06-26 12:06:19', NULL);
INSERT INTO `comments` VALUES (648, 98, 70, 'o***6', '谢谢前台Max Haliey的服务 你们太棒啦', NULL, 49, 0, 4.2, 4.3, 4, 4.8, 4.1, 4.3, '2023-08-14 23:17:30', NULL);
INSERT INTO `comments` VALUES (649, 98, 134, 'k***4', '酒店环境服务都非常好', NULL, 49, 0, 5, 4.3, 4.8, 4.6, 4, 4.5, '2023-06-28 20:25:16', NULL);
INSERT INTO `comments` VALUES (650, 98, 178, 'r***1', '挺好的挺好的', NULL, 49, 0, 4.1, 4.8, 4.4, 4.4, 4.6, 4.5, '2023-04-20 09:30:55', NULL);
INSERT INTO `comments` VALUES (651, 98, 85, 'i***6', '酒店入住率高，请问是不是携程的订单房间的四季酒店袋子还要打电话送，感觉性价比不错。建议贵酒店不要节约几个纸袋子', NULL, 49, 1, 4.2, 4.4, 5, 4.5, 4.8, 4.6, '2023-04-28 21:50:27', NULL);
INSERT INTO `comments` VALUES (652, 99, 60, '匿名用户', '酒店在深圳最核心的区域，会展中心，旁边的商场餐厅奶茶店特别多，所以很好逛。', NULL, 50, 1, 4, 4.7, 4.7, 4.9, 4.4, 4.5, '2024-02-20 10:32:28', NULL);
INSERT INTO `comments` VALUES (653, 99, 192, '6***5', 'jack非常好，谢谢', NULL, 50, 0, 4.9, 4.2, 4.9, 4.6, 4.9, 4.7, '2024-02-15 11:21:10', NULL);
INSERT INTO `comments` VALUES (654, 99, 60, '匿名用户', '出差住宿条件不错，环境和卫生那些都很好，服务也不错，整体来说值得推荐，因为疫情原因比较少出门，防疫措施也不错', NULL, 50, 0, 4.5, 4.5, 4.2, 4.4, 4.1, 4.3, '2024-02-04 07:34:58', NULL);
INSERT INTO `comments` VALUES (655, 100, 193, '7***6', '疫情原因前台搬到了一楼的礼宾部，只有两个办理位置，入住流程很慢。', NULL, 51, 0, 4.8, 4.5, 4.7, 5, 4.2, 4.6, '2024-03-01 17:07:57', NULL);
INSERT INTO `comments` VALUES (656, 100, 194, '6***6', '非常棒的酒店，感谢帮我们免费升级了，房间很大，很干净，服务很到位', NULL, 51, 0, 4.8, 4.2, 4.9, 4.2, 4.5, 4.5, '2024-02-17 22:45:07', NULL);
INSERT INTO `comments` VALUES (657, 101, 195, 'C***7', '非常好的一次入住体验。首先酒店可以做到准确、理性判断疫情风险区域，不是一味带星就不得入住；二来酒店房间宽敞，整体装修风格符合四季的特点；三是中餐厅非常好吃，推荐去一下（就是有点小贵）。最后，很重要的是酒店服务人员态度好，待客热情周到，比如林佳莹同学，Alan sun同学都给我留下了很深的印象。下次来深圳还会住这里，离商场也近！', NULL, 52, 1, 4.5, 4.5, 4.6, 4.7, 4.8, 4.6, '2024-04-19 23:05:04', NULL);
INSERT INTO `comments` VALUES (658, 101, 60, '匿名用户', '我们在这里过得很愉快。酒店舒适而美丽，前台的工作人员非常友善和乐于助人。我们很享受这次住宿，我们很想有时间再回去。', NULL, 52, 0, 4.2, 5, 4.8, 4.7, 4.3, 4.6, '2024-03-31 11:51:33', NULL);
INSERT INTO `comments` VALUES (659, 101, 60, '匿名用户', '环境优雅舒适', NULL, 52, 0, 4.6, 4.2, 5, 4.3, 4.4, 4.5, '2024-03-02 16:27:09', NULL);
INSERT INTO `comments` VALUES (660, 101, 60, '匿名用户', '服务很好，房间够大，设施也很齐全。', NULL, 52, 0, 4.7, 4.7, 4.3, 4.7, 4.5, 4.6, '2024-01-17 07:32:30', NULL);
INSERT INTO `comments` VALUES (661, 101, 196, 'E***3', '礼宾态度待改进。', NULL, 52, 0, 4.3, 4.1, 4.7, 4.2, 4.8, 4.4, '2024-01-01 11:21:30', NULL);
INSERT INTO `comments` VALUES (662, 101, 197, '1***3', '多次入住，是奢华型酒店，所处位置非常好，交通便利，购物方便，对面就是皇庭，和会展中心，平安大厦，总之，奢华的就是不同，由于深夜入住，离店早，未能很好的感受！', NULL, 52, 0, 4.2, 4, 4.9, 4.3, 4.4, 4.4, '2023-11-28 14:51:25', NULL);
INSERT INTO `comments` VALUES (663, 101, 177, 'A***8', '出差深圳住的很方便，早餐品种多样，服务热情，地理位置出行便利，位于核心区域，很好的入住体验，感觉宾至如归', NULL, 52, 0, 4.8, 4.6, 4.6, 4.7, 4.8, 4.7, '2023-09-29 09:49:09', NULL);
INSERT INTO `comments` VALUES (664, 101, 60, '匿名用户', '舒适 地处CBD环境便利', NULL, 52, 1, 4.5, 4.8, 4.4, 4.8, 4.8, 4.7, '2023-09-07 20:56:56', NULL);
INSERT INTO `comments` VALUES (665, 101, 198, '3***8', '以前的四季是真的可以，现在的前台服务是真的一般', NULL, 52, 0, 4.5, 4.3, 4.4, 4.7, 4.1, 4.4, '2023-07-30 12:03:15', NULL);
INSERT INTO `comments` VALUES (666, 101, 199, 'A***3', 'nice好好好', NULL, 52, 0, 4.7, 4.4, 4.5, 4.7, 4.7, 4.6, '2023-06-04 09:46:05', NULL);
INSERT INTO `comments` VALUES (667, 101, 183, '2***5', '四季酒店每次入住都有惊喜，服务热情到位，早餐好吃，尤其是烘焙是最近吃到最好的。每位服务生都热情满满，主动服务。五星推荐', NULL, 52, 0, 4.3, 4.3, 4.7, 4, 4.6, 4.4, '2023-03-24 11:34:24', NULL);
INSERT INTO `comments` VALUES (668, 101, 200, 'BUpA1376', '好好好好好好', NULL, 52, 0, 4.6, 4.6, 4.2, 4.2, 4.7, 4.5, '2022-11-06 13:42:05', NULL);
