INSERT INTO `comments` VALUES (671, 101, 202, '2***1', '四季酒店是一家值得信赖、值得再次入住的酒店。我们入住的深圳四季尤其棒！特别喜欢酒店的服务，谢谢给我们入住带来良好服务体验的Max、Eric和Ivonne！', NULL, 52, 0, 4, 4.1, 4.3, 4.4, 4.6, 4.3, '2022-08-13 12:01:33', NULL);
