INSERT INTO `comments` VALUES (673, 101, 201, '2***7', '难得一个好酒店。', NULL, 52, 0, 4.9, 4.8, 4.7, 4.7, 4.1, 4.6, '2023-03-08 01:10:01', NULL);
INSERT INTO `comments` VALUES (674, 101, 204, '1***2', '酒店干净 服务好', NULL, 52, 0, 4.1, 4.7, 4.5, 4.3, 4.2, 4.4, '2022-08-04 16:53:14', NULL);
