INSERT INTO `comments` VALUES (676, 101, 189, '2***3', '有点失望，感觉总体还是有历史感的', NULL, 52, 0, 4.5, 4.8, 4.5, 4.1, 4.2, 4.4, '2022-08-13 12:06:44', NULL);
INSERT INTO `comments` VALUES (677, 102, 156, 'i***8', '房间面积很大，景观也好，nice', NULL, 53, 1, 4.3, 4.1, 4.5, 5, 4.1, 4.4, '2023-11-19 12:41:00', NULL);
INSERT INTO `comments` VALUES (678, 102, 175, 'P***9', '2.12号退房，无任何额外消费，押金一直没退，13号打过电话说14号会处理，结果23号再打电话反馈，才说忘记操作。请问一下，如果消费者一直没提酒店是不是就一直不退了？这么严重的失误反映出酒店员工培训不到位。并且酒店采取统一控制中央空调的功能，入住那几天深圳的天气一直在20度左右并不需要供暖，导致晚上热的无法入睡，建议大家提前咨询酒店每间房间能自主调温了再去入住吧', NULL, 53, 1, 4.7, 4.4, 5, 4.9, 4.8, 4.8, '2023-11-24 15:32:35', NULL);
INSERT INTO `comments` VALUES (679, 102, 169, 'M***4', '许湘博主管对我的入住提供了全方位的服务，我很喜欢四季酒店。到深圳还会再次入住。在比较其他酒店的情况下，深圳四季仍然是我的第一选择。', NULL, 53, 1, 4.9, 4.5, 4.5, 4.9, 4.7, 4.7, '2023-11-19 13:24:02', NULL);
INSERT INTO `comments` VALUES (680, 102, 103, 'w***6', '非常干净！', NULL, 53, 1, 4.3, 4.2, 4.8, 5, 4.1, 4.5, '2023-11-20 22:06:07', NULL);
INSERT INTO `comments` VALUES (681, 102, 147, 'F***3', '感觉非常不错', NULL, 53, 1, 4.4, 4.8, 4.1, 4.9, 4.8, 4.6, '2023-11-19 16:50:53', NULL);
INSERT INTO `comments` VALUES (682, 102, 156, 'I***8', '疫情期间感觉人不多，挺安静的', NULL, 53, 1, 4.9, 4.4, 4.4, 5, 4.7, 4.7, '2023-11-12 15:56:29', NULL);
INSERT INTO `comments` VALUES (683, 102, 191, 't***5', '不错阿、下次还会住', NULL, 53, 1, 4, 4.3, 4.8, 4.9, 4.5, 4.5, '2023-11-15 21:05:23', NULL);
INSERT INTO `comments` VALUES (684, 102, 173, 'h***3', '每次去深圳都会定这个酒店，下面就是皇庭广场，吃饭玩乐都很方便，老牌的高档酒店绝对不会出错，前台小哥哥很好给我升级了房间', NULL, 53, 1, 4.9, 4.6, 4.4, 4.5, 4.6, 4.6, '2023-12-31 20:26:41', NULL);
INSERT INTO `comments` VALUES (685, 103, 188, 'p***3', '很满意的一次入住，2013年刚开业时曾体验过，时隔近十年，无论从房间的设施及管理，一如既往的好，不愧为五星酒店，而且价格亲民，前台还帮我做了升级，早餐也是非常丰盛美味，昨晚还在房间内看了冬奥会的直播，高清，非常棒', NULL, 53, 1, 4.5, 4.4, 4.1, 4.4, 4.3, 4.3, '2023-12-31 20:25:11', NULL);
INSERT INTO `comments` VALUES (686, 103, 149, 'b***1', '还不错吧.房型宽敞', NULL, 53, 0, 4.3, 4.6, 4.8, 4.4, 4.6, 4.5, '2023-11-11 15:23:52', NULL);
INSERT INTO `comments` VALUES (687, 104, 126, 'r***3', '挺好的，很不错。', NULL, 54, 0, 4.2, 4.9, 4.1, 4.9, 4.9, 4.6, '2024-02-20 22:44:33', NULL);
INSERT INTO `comments` VALUES (688, 104, 137, 'l***3', '不错 很好！', NULL, 54, 1, 4.8, 4.5, 4.2, 4.9, 4.9, 4.7, '2023-11-07 16:20:45', NULL);
INSERT INTO `comments` VALUES (689, 105, 126, 'R***3', '服务好，枕头和床很舒适，价格合适。', NULL, 55, 1, 4.7, 4.9, 4.4, 4.6, 4.6, 4.6, '2024-03-18 15:59:13', NULL);
