INSERT INTO `comments` VALUES (695, 106, 137, 'l***3', '酒店服务非常好！由于是纪念日，酒店帮忙升级了房间，还赠送了蛋糕和酒，非常感谢酒店的服务人员，毕竟是深圳顶级酒店。', NULL, 56, 1, 4, 4.9, 4.3, 4.5, 4.5, 4.4, '2023-10-01 16:29:34', NULL);
