INSERT INTO `comments` VALUES (697, 106, 82, 'i***0', '酒店健身房不错 距离东站步行10几分钟 很方便', NULL, 56, 0, 4.5, 4.6, 4.7, 4.9, 4.3, 4.6, '2023-09-03 18:13:30', NULL);
INSERT INTO `comments` VALUES (698, 106, 148, 'U***0', '大品牌就是好', NULL, 56, 1, 4.7, 4.9, 4.6, 4.5, 4.5, 4.6, '2023-06-25 11:37:52', NULL);
INSERT INTO `comments` VALUES (699, 106, 131, 'P***1', '此行入住四季，非常满意', NULL, 56, 1, 4.5, 4.5, 4.9, 4.5, 4.6, 4.6, '2023-05-14 17:20:48', NULL);
INSERT INTO `comments` VALUES (700, 106, 170, 'S***4', '1901', NULL, 56, 1, 4.3, 4.9, 4.2, 4.9, 4, 4.5, '2023-05-08 21:20:16', NULL);
INSERT INTO `comments` VALUES (701, 106, 188, 'p***3', '这家酒店有些老了，设备设施老旧，屋子里面灰尘太大，之前对深圳四季酒店还是很情有独钟的，这次很失望，可能以后装修后还会再去', NULL, 56, 0, 4.2, 5, 4.5, 4.1, 4.8, 4.5, '2024-01-13 19:17:00', NULL);
INSERT INTO `comments` VALUES (702, 106, 145, 'O***2', '很棒的水疗中心和健身中心，位置很好。自助早餐令人印象深刻。所有员工都说一口流利的英语，他们非常乐于助人。', NULL, 56, 1, 4.1, 4.3, 4.4, 5, 4.2, 4.4, '2023-05-19 14:53:55', NULL);
INSERT INTO `comments` VALUES (703, 106, 110, 'i***4', '舒适干净，温馨大气', NULL, 56, 0, 4.4, 4.1, 4.5, 4, 4.8, 4.4, '2023-10-08 14:40:57', NULL);
INSERT INTO `comments` VALUES (704, 106, 82, 'I***0', '感谢前台美女给我升级了四季套房……带了小孩子完美的提供了小孩子吃的喝的用的各项能想到的用品！地理位置非常好！对面就是皇庭广场（里面真是美食天堂-辣可可还有鲍鱼鸡爆赞）步行一分钟都不用！房间用的洗浴用品nutura biss和电动马桶都非常好！下次还会入住！希望下次入住礼遇多多', NULL, 56, 0, 5, 4.9, 4.9, 4.2, 4.6, 4.7, '2023-08-29 11:05:46', NULL);
INSERT INTO `comments` VALUES (705, 106, 65, 'z***5', '非凡的住宿。我和我的搭档在这家酒店的豪华房里度过了新年。服务很棒，但是在翻译和误解方面存在一些沟通错误。我们房间的景色很好。室内游泳池很浅，室外游泳池已经排干了。蒸汽房和桑拿房很棒。房间里的娱乐系统不工作，所以我们不得不打电话给维修人员修理它，他们也无法弄清楚。幸运的是我在包里带了 HDMI 线', NULL, 56, 0, 4.9, 4, 4.9, 4.9, 4.9, 4.7, '2023-08-28 10:13:27', NULL);
INSERT INTO `comments` VALUES (706, 106, 167, 'q***0', '入住这家酒店几十次了，这次却非常失望。最后一天行政酒廊吃早饭，服务员问我喝什么，我说拿铁，她就说了三个字“做不了。”语气十分理直气壮，一般来说作为四季的标准来说，起码说这句话之前会说一声抱歉交代一下做不了的原因。我问了为什么，她才说咖啡机坏了。然后整个吃早饭的过程，没有来服务过，也没有来问我点餐，收餐也没有来提醒我，总之我一个小时的用餐过程没有见过服务员，而当时餐厅只有我一个客人，没有任何服务可言。', NULL, 56, 0, 4.4, 4.4, 4.4, 4.7, 4.8, 4.5, '2023-09-28 12:28:39', NULL);
INSERT INTO `comments` VALUES (707, 106, 178, 'R***1', '非常棒，给我留下了美好的元旦时光，以后出行还会选择', NULL, 56, 1, 4, 4.7, 4.9, 4.6, 4.7, 4.6, '2023-06-29 21:16:16', NULL);
INSERT INTO `comments` VALUES (708, 107, 109, 'C***8', '很舒适的体验', NULL, 56, 0, 4.5, 4.8, 4.1, 4.7, 4.5, 4.5, '2024-03-05 20:58:57', NULL);
INSERT INTO `comments` VALUES (709, 107, 143, 'k***6', '酒店位置非常好，周边吃喝玩乐一应俱全。餐厅的甜品非常出彩，甜度适中。行政酒廊的两位小哥哥服务也特别好。客房虽然设施设备陈旧，但是布草什么的还是非常新的。办理入住有点小问题，非常感谢前台经理李英帅经理，主动友好，积极协调，真的是把服务的真谛：做到始终比客人想到的多，完美体验了，宾至如归才是招揽顾客的秘诀。店好有常客，相信有李经理的优质服务规范管理，一定会有更多的回头客。', NULL, 56, 1, 4.1, 4.1, 4.9, 4.3, 4.3, 4.3, '2023-10-06 23:49:21', NULL);
INSERT INTO `comments` VALUES (710, 107, 188, 'P***3', '设施旧了 但位置好方便 服务也不错', NULL, 56, 1, 4.1, 4.8, 4.4, 4.3, 4.9, 4.5, '2023-08-21 11:43:00', NULL);
INSERT INTO `comments` VALUES (711, 107, 61, 'A***0', '服务：非常细心', NULL, 56, 1, 4.9, 4.1, 4.4, 4.7, 4.5, 4.5, '2023-08-22 20:39:30', NULL);
INSERT INTO `comments` VALUES (712, 107, 188, 'P***3', '比想象的更舒服，价格也不贵，早餐很好吃', NULL, 56, 1, 4.2, 4.2, 4.5, 4.2, 4.5, 4.3, '2023-08-15 11:29:57', NULL);
INSERT INTO `comments` VALUES (713, 107, 79, 'G***4', '给前台周轶帆服务态度和水平点个赞', NULL, 56, 1, 4.1, 4.6, 4.5, 4.6, 4.8, 4.5, '2023-08-23 08:52:57', NULL);
INSERT INTO `comments` VALUES (714, 107, 85, 'I***6', '谢谢Vivian帮我办入住非常好，因为是纪念日还帮我们免费升级了房间，酒店很贴心，有准备蛋糕和有字的靠枕，细节满满服务水平很高，住的很舒适，下次来深圳还住这里！', NULL, 56, 1, 4.2, 4.3, 4.9, 4.9, 4.4, 4.5, '2023-08-23 08:53:30', NULL);
INSERT INTO `comments` VALUES (715, 107, 91, 'i***2', '交通：位于深圳会展中心对旁边，皇庭广场正对面，在深圳市中心，交通出行十分便利，属于在黄金地段。', NULL, 56, 0, 4.6, 4.6, 4.2, 4.8, 4.6, 4.6, '2023-08-26 23:04:36', NULL);
INSERT INTO `comments` VALUES (716, 107, 113, 'W***4', '原本订的是豪华房型 但是因为空调原因 工作人员帮我换了间套房 还赠送了牛奶 挺感动的 酒店环境优雅 工作人员热情 非常满意', NULL, 56, 0, 4.4, 4.7, 4.7, 4.5, 4.2, 4.5, '2023-10-24 16:27:12', NULL);
INSERT INTO `comments` VALUES (717, 107, 138, 'T***3', '良好的位置和很多设施，但服务不是很好。', NULL, 56, 0, 4.1, 4.8, 4.9, 4.1, 4.8, 4.5, '2023-08-14 17:22:50', NULL);
INSERT INTO `comments` VALUES (718, 107, 206, 'y***6', '第二入住深圳四季酒店，房间非常舒适，特别表扬洗手间和床品设施，大落地窗，采光好，西藏冰川矿泉水无限量供应，体验了酒店的大气！服务员的态度很好，特别是礼宾部Andy小哥哥，阳光帅气，热情有礼貌，专门送了迎宾水果，谢谢！(*˘︶˘*).。.:Merry Christmas~快乐不止圣诞这一天！', NULL, 56, 0, 5, 4.5, 4.3, 4.4, 4, 4.4, '2023-07-29 14:23:34', NULL);
INSERT INTO `comments` VALUES (719, 107, 161, 'M***8', '首先，环境挺好的，服务态度什么都蛮好的，非常不错的一家酒店，以后有机会的话，还会过来入住的，体验感！', NULL, 56, 0, 4.8, 4.5, 4.3, 4.5, 4.9, 4.6, '2023-07-03 12:37:33', NULL);
INSERT INTO `comments` VALUES (720, 107, 207, 'g***6', '电梯太慢，很多人挤在一起', NULL, 56, 0, 4.7, 4.8, 4.8, 4.9, 4.7, 4.8, '2023-07-04 14:20:43', NULL);
INSERT INTO `comments` VALUES (721, 107, 89, 'F***9', '不错的位置', NULL, 56, 1, 4.8, 4.6, 4, 4.3, 4.2, 4.4, '2023-06-02 23:40:33', NULL);
INSERT INTO `comments` VALUES (722, 107, 60, '匿名用户', '和四季的名气还有距离', NULL, 56, 0, 4.2, 4.8, 4.5, 4.7, 4.7, 4.6, '2023-06-19 15:00:04', NULL);
INSERT INTO `comments` VALUES (723, 107, 120, 'e***2', '地理位置很好！其它的一般般吧。有些app上把这家列在六星的评级有点儿过了、性价比一般吧。只是四季的虚名罢了。碰到有办婚礼的。记得上次来四季是一家公司上市接待来宾办宴会。', NULL, 56, 1, 4.4, 4.9, 4.9, 4.7, 4.1, 4.6, '2023-07-10 08:00:58', NULL);
INSERT INTO `comments` VALUES (724, 107, 96, 's***0', '前台人员zhou女', NULL, 56, 0, 4.3, 4.2, 4.5, 4.7, 4.4, 4.4, '2023-07-20 20:10:47', NULL);
