INSERT INTO `comments` VALUES (726, 107, 165, 'V***7', '吞了我押金没退', NULL, 56, 1, 4.9, 4.6, 4.4, 4.2, 4.6, 4.5, '2023-05-14 12:59:11', NULL);
INSERT INTO `comments` VALUES (727, 107, 149, 'B***1', '四季酒店是深圳最好的酒店之一，性价比超高', NULL, 56, 1, 4.5, 4.8, 4, 4.7, 4.5, 4.5, '2023-05-15 12:10:19', NULL);
INSERT INTO `comments` VALUES (728, 108, 77, 'n***9', '房间非常宽敞大气，酒店整体服务非常好，尤其是前台的Carlos很热情，态度特别好，还帮忙安排了合适的房间。整体体验非常好，以后还会入住四季酒店哒！ps住过这么多酒店，四季的浴缸是最大的了，真是优秀。', NULL, 56, 1, 4, 4.3, 4.8, 4.2, 4.2, 4.3, '2023-12-03 14:04:35', NULL);
INSERT INTO `comments` VALUES (729, 108, 94, 'g***0', '带妈妈和两个姪子入住酒店，酒店帮我们做了免费升级，非常贴心！房间非常大与舒适，泳池设施很好！酒店的所有人员的服务都是国际标准，非常专业！在国内住酒店很担心踩雷，唯有住四季是绝对的安心！', NULL, 56, 1, 4.3, 4.3, 4, 4.4, 4.8, 4.4, '2023-12-21 23:20:05', NULL);
INSERT INTO `comments` VALUES (730, 108, 89, 'F***9', '还可以，不是最好的四季但是商务住够用了', NULL, 56, 0, 4.1, 4.2, 4.3, 4.2, 4.3, 4.2, '2023-10-02 10:30:52', NULL);
INSERT INTO `comments` VALUES (731, 108, 137, 'l***3', '已经多次入住了，但是离四季的品质还有差距，只能算是标准五星吧！不过服务不错，要特别感谢COnnor，虽然美中不足，但是服务满足了，', NULL, 56, 1, 4.2, 4.3, 4.5, 4.7, 4.2, 4.4, '2023-10-01 16:29:34', NULL);
INSERT INTO `comments` VALUES (732, 108, 162, 'y***4', '早餐不错，丰富', NULL, 56, 1, 4.7, 4.2, 4.8, 4.8, 4.1, 4.5, '2023-09-22 19:59:07', NULL);
INSERT INTO `comments` VALUES (733, 108, 82, 'i***0', '礼宾部的Connor非常nice，服务周到', NULL, 56, 0, 4.6, 4.7, 4.9, 4.5, 4.1, 4.6, '2023-09-03 18:13:30', NULL);
INSERT INTO `comments` VALUES (734, 108, 148, 'U***0', '很无语了 房间卫生很不好 浴缸有明显的灰尘 还有水杯里也有 浴室的吹风筒是坏的 我用嘴吹出来的风可能都比这吹风筒的风大 咖啡机旁的插座也是坏的 烧水壶旧又脏 这是我住的最差的一间四季了', NULL, 56, 1, 4.5, 4.9, 4.7, 4.8, 4.7, 4.7, '2023-06-25 11:37:52', NULL);
INSERT INTO `comments` VALUES (735, 108, 131, 'P***1', '和历史点评相似', NULL, 56, 1, 4.4, 4.8, 4.8, 4, 4.3, 4.5, '2023-05-14 17:20:48', NULL);
INSERT INTO `comments` VALUES (736, 108, 170, 'S***4', '环境优雅，设备齐全，人员礼貌周到，非常满意!', NULL, 56, 1, 4.3, 4.5, 5, 4.1, 4.4, 4.5, '2023-05-08 21:20:16', NULL);
INSERT INTO `comments` VALUES (737, 108, 188, 'p***3', '这次入住其实最让我惊喜的是携程的服务，虽然是在酒店遇到的问题，但是携程客服一直道歉并帮忙解决，真的是客户至上啊。深圳四季作为一个老酒店，服务真的很拉胯，前台收费很随意，如果不是提前在携程预定时已经问过酒店一些小朋友收费的依据，那就在前台糊里糊涂被多收四百多。而且一个人一个说法，最后值班经理解决的办法也是冷冷淡淡。说白了，只有人傻钱多是暴发户才适合这家酒店。', NULL, 56, 0, 4.1, 4.6, 4.1, 4.8, 4.6, 4.4, '2024-01-13 19:17:00', NULL);
INSERT INTO `comments` VALUES (738, 108, 145, 'O***2', '生日庆祝活动选择四季。抵达酒店（下午13:57）位置优越！大堂前台男士服务员服务周到（6F）,升级同角房间,光线充足！餐厅早餐丰富！户支（4365）17思N 55/双廊15:36！', NULL, 56, 1, 4.1, 4.1, 5, 4.5, 4.9, 4.5, '2023-05-19 14:53:55', NULL);
INSERT INTO `comments` VALUES (739, 108, 110, 'i***4', '一旦拥有，别无他求。黑钻推荐', NULL, 56, 0, 4.5, 4.3, 4.8, 4.3, 4.9, 4.6, '2023-10-08 14:40:57', NULL);
INSERT INTO `comments` VALUES (740, 108, 82, 'I***0', '这是住过的最差的四季酒店。在前台办入住的时候，就拖延了很长时间，效率很低。电梯很小，轿厢很低。电梯间就在走廊的中间，在电梯间，能看到所有的房间，毫无隐私可言。打开房门，所有抽屉都是拉开到极限的，沙发上的垫子也是翻开的状态！', NULL, 56, 0, 4.1, 4.4, 4, 4.5, 4.7, 4.3, '2023-08-29 11:05:46', NULL);
INSERT INTO `comments` VALUES (741, 108, 65, 'z***5', '服务非常满意，三楼餐饮不错', NULL, 56, 0, 4.6, 4, 4.2, 4.5, 4.5, 4.4, '2023-08-28 10:13:27', NULL);
INSERT INTO `comments` VALUES (742, 108, 167, 'q***0', '酒店地理位置很好 服务也很好 性价比很高', NULL, 56, 0, 5, 4.7, 4.1, 4.4, 4.5, 4.5, '2023-09-28 12:28:39', NULL);
INSERT INTO `comments` VALUES (743, 108, 178, 'R***1', '疫情原因有半年没出差了。这次来，四季酒店房间supplies的品质和设计很好，恨不得都拿走，哈哈哈。', NULL, 56, 1, 4.3, 4.5, 4.9, 4.1, 4.7, 4.5, '2023-06-29 21:16:16', NULL);
INSERT INTO `comments` VALUES (744, 109, 153, 'R***5', '我在这里过生日，尽管我有轻微的麸质不耐症，但工作人员很友善地给了我一个蛋糕。我能够与一些比我更常光顾该地区的朋友分享销售经理的联系方式。总的来说，房间很好，我喜欢休息室的布置。广场就在附近，所以有很多事情要做，是社交活动的频繁区域。很干净。我喝茶的时候正在举行婚礼，所以我认为这是一张很好的照片，可以分享，因为一家人看起来真的很幸福。', NULL, 56, 0, 4.4, 4.6, 4.2, 4.4, 5, 4.5, '2023-10-02 18:26:09', NULL);
INSERT INTO `comments` VALUES (745, 109, 191, 't***5', '非常感谢Alan的来电和周到的准备，也感谢Max和Chris邀请我们到27楼品尝美酒和小吃，都是那么的甜蜜和温暖。再次感谢你！！我真诚地享受在 Four Seasons SZ 的住宿', NULL, 56, 0, 4.8, 4.2, 4.1, 4.2, 4.4, 4.3, '2023-06-11 22:50:53', NULL);
INSERT INTO `comments` VALUES (746, 110, 99, 'Q***8', '怎么说呢，也是在福田常去的酒店了。总体确实可以，但是一些小细节处理不适让这次有点意外，希望能得到完善吧。', NULL, 57, 1, 4.1, 4.1, 4, 4.1, 4.9, 4.2, '2024-02-05 18:28:34', NULL);
INSERT INTO `comments` VALUES (747, 110, 169, 'M***4', '毕竟有点时间了，装修和设施都旧了，但还是为四季的服务点赞', NULL, 57, 0, 4.1, 4.6, 4.9, 4.7, 4.2, 4.5, '2024-04-12 16:34:47', NULL);
INSERT INTO `comments` VALUES (748, 110, 84, 'f***1', '装修较旧，服务很好', NULL, 57, 1, 4.4, 4.8, 4, 4.3, 4.8, 4.5, '2024-04-03 00:13:21', NULL);
INSERT INTO `comments` VALUES (749, 110, 95, 'v***3', '朋友入住整体满意', NULL, 57, 0, 4.5, 4.2, 4.5, 4.3, 4.1, 4.3, '2023-11-01 19:35:21', NULL);
INSERT INTO `comments` VALUES (750, 110, 79, 'g***4', '客房部客房中心的同事，早上班的曾春萍，下午班的黄钰仪，对人和善，态度诚恳，服务热情，五星好评', NULL, 57, 1, 4.7, 4.6, 4.1, 4.1, 4.6, 4.4, '2023-08-24 10:12:58', NULL);
INSERT INTO `comments` VALUES (751, 110, 102, 't***7', '4 季中的第一次，住宿的好地方。', NULL, 57, 0, 4.8, 4.4, 4.8, 4.9, 4.5, 4.7, '2023-08-13 13:10:38', NULL);
INSERT INTO `comments` VALUES (752, 110, 112, 'L***7', '位置很方便，附近吃饭逛街步行就能到，停车位还算好找，服务人员态度不错，早餐很好吃', NULL, 57, 1, 4.3, 4.8, 4.1, 4.6, 4.6, 4.5, '2022-04-16 22:30:50', NULL);
INSERT INTO `comments` VALUES (753, 110, 157, 'o***0', '酒店不错，非常舒适', NULL, 57, 1, 4.6, 4.4, 4.6, 4.4, 4.4, 4.5, '2023-04-28 11:28:43', NULL);
INSERT INTO `comments` VALUES (754, 110, 166, 'Z***7', '房间很干净，舒服', NULL, 57, 1, 4.8, 4.2, 4.2, 4.5, 4.3, 4.4, '2022-05-02 22:42:26', NULL);
INSERT INTO `comments` VALUES (755, 110, 184, 'e***8', '酒店一般，看来也是名声在外而已！早餐说不上丰盛，简单举个例子，如果煎鸡蛋不是根据每个客人的需求现煎的，热的端出来而是早早的煎好一堆放在哪里，客人拿到的都是凉的了！就这一点小小的细节，就配不上五星级酒店招牌！更不要说是传说中的的四季酒店啦！', NULL, 57, 1, 4.9, 4.3, 4.2, 4, 4, 4.3, '2022-01-28 20:45:26', NULL);
INSERT INTO `comments` VALUES (756, 110, 134, 'k***4', '位置好，交朋友', NULL, 57, 1, 4.2, 4.9, 4.4, 4.4, 4.8, 4.5, '2023-01-23 21:30:03', NULL);
INSERT INTO `comments` VALUES (757, 110, 163, 'x***5', '温馨如家', NULL, 57, 1, 4.9, 4.2, 4, 4.7, 4.9, 4.5, '2022-08-26 17:14:17', NULL);
INSERT INTO `comments` VALUES (758, 110, 123, 'P***7', '服务不到位……车位不足……协调能力差……', NULL, 57, 0, 4.9, 4.8, 4.9, 4.6, 4.7, 4.8, '2022-02-15 21:15:47', NULL);
INSERT INTO `comments` VALUES (759, 110, 208, 'J***5', '非常好的五星酒店', NULL, 57, 1, 4.8, 4.7, 4.2, 4.1, 4.8, 4.5, '2023-05-01 18:00:16', NULL);
INSERT INTO `comments` VALUES (760, 110, 188, 'P***3', '非常满意的服务！给前台小哥Tommy点赞～', NULL, 57, 1, 4.7, 4.5, 4.4, 4.3, 4.9, 4.6, '2022-08-19 20:26:44', NULL);
INSERT INTO `comments` VALUES (761, 110, 173, 'h***3', '交通方便，其他的还可以，就是感觉是时候翻新一下了', NULL, 57, 0, 4.7, 4.2, 4.4, 4.9, 4.8, 4.6, '2022-08-11 23:06:50', NULL);
INSERT INTO `comments` VALUES (762, 110, 152, 'V***1', '停车场极其的差，出口标识难找。', NULL, 57, 0, 4.6, 4.8, 4.8, 4.9, 4.5, 4.7, '2022-01-30 22:16:12', NULL);
INSERT INTO `comments` VALUES (763, 110, 67, 'a***6', '因为熟悉，经常来这里自助餐厅，以前也带亲朋好友住过，喜欢周边的环境。', NULL, 57, 0, 4.1, 4.9, 4.5, 4.9, 4.3, 4.5, '2022-02-23 08:31:12', NULL);
INSERT INTO `comments` VALUES (764, 110, 84, 'F***1', '我觉得酒店各种条件位置服务都很好，应该说是福田最好的酒店了吧', NULL, 57, 0, 4.8, 4.2, 4.9, 4.9, 4.8, 4.7, '2023-01-15 22:20:51', NULL);
INSERT INTO `comments` VALUES (765, 110, 163, 'X***5', '服务好 经常来 很多经理都认识了 陈小龙服务很赞', NULL, 57, 0, 4, 4.3, 4.3, 4.1, 4, 4.1, '2022-10-31 10:37:08', NULL);
INSERT INTO `comments` VALUES (766, 111, 55, '5***1', '酒店不错，位置很好', NULL, 58, 0, 4.5, 4.1, 4.6, 4.8, 4.6, 4.5, '2024-02-16 09:57:06', NULL);
INSERT INTO `comments` VALUES (767, 111, 209, '3***1', '这家酒店的双人床只有1.4米。真是让我大开眼界啊。如果有机会的话，我想看看深圳其他酒店的双人床不怎么样。', NULL, 58, 0, 5, 4.9, 4.6, 4.9, 4.6, 4.8, '2024-02-16 15:34:15', NULL);
INSERT INTO `comments` VALUES (768, 112, 210, '7***3', '四季的品质值得推荐', NULL, 59, 1, 4.8, 4.5, 4.7, 4.4, 4.2, 4.5, '2023-11-07 12:42:58', NULL);
INSERT INTO `comments` VALUES (769, 112, 211, 'l***1', '这酒店不是想象中豪华，大堂比较小。入住时给的房间在婚宴活动平台上，噪音很大。打去前台立马换了一个高层安静一点的房间。但明知有活动，那几个已经自动变成噪音房间，怎样还能给客人住呢？健身设施、游泳池、干蒸及湿蒸都很满意。床垫软硬适中，电视很低清，跟五星级配不上。', NULL, 59, 1, 4.7, 4.3, 4, 4.8, 4, 4.4, '2024-02-09 07:45:00', NULL);
INSERT INTO `comments` VALUES (770, 112, 84, 'F***1', '太阳花洒坏的反应过也没人处理，早餐一般，服务人员态度生硬，实在配不上四季酒店应有服务，感觉大陆的四季酒店双标的有点明显。', NULL, 59, 1, 4.5, 4.5, 4.3, 4.1, 4.6, 4.4, '2024-01-25 07:52:32', NULL);
INSERT INTO `comments` VALUES (771, 112, 121, 'D***5', '酒店送了生日礼物给我, 酒店早餐的面包西饼种类很多. 房间很大性价比非常之高. Room service 食物也非常OK', NULL, 59, 1, 4.5, 5, 4.4, 4.8, 4.7, 4.7, '2024-04-25 12:30:02', NULL);
INSERT INTO `comments` VALUES (772, 112, 85, 'i***6', '这次出行是庆祝结婚纪念日，所以订酒店是有留言说希望帮忙简单布置。办理入住时酒店帮我们房间免费升级，而且房间很用心的布置了环境，还送了蛋糕和气泡酒，非常感谢四季酒店让我们度过浪漫的夜晚！酒店服务很好，环境优美，卫生干净，性价比超高，会再次选择入住！', NULL, 59, 1, 4.4, 4.8, 4.1, 4.9, 4.4, 4.5, '2023-12-11 09:47:57', NULL);
INSERT INTO `comments` VALUES (773, 112, 212, '1***4', '酒店游泳池虽小但很舒服，夜景很美，窗外视野很好，交通便利，周边吃处很多，挑不出什么大的毛病。有两个小瑕疵。一是室内游泳池休息时必有蚊虫叮咬，这个不爽。二是早餐看上去很丰盛，但可吃性不是很强，与价格不匹配，应该还能再提升一些。价格1000以下时还是很不错的选择。', NULL, 59, 1, 5, 4, 4.4, 4.8, 4.1, 4.5, '2024-04-16 21:51:18', NULL);
INSERT INTO `comments` VALUES (774, 112, 167, 'q***0', '性价比挺高', NULL, 59, 1, 4.1, 4.9, 4.4, 4.4, 4.2, 4.4, '2024-02-15 17:12:40', NULL);
INSERT INTO `comments` VALUES (775, 112, 213, 'G***2', '装修太老气了，升级的房型19楼的还不如升级。', NULL, 59, 1, 4.3, 4.5, 4.3, 4.5, 4.4, 4.4, '2024-02-03 16:54:07', NULL);
INSERT INTO `comments` VALUES (776, 112, 106, 'M***0', '可以可以可以', NULL, 59, 1, 4.4, 4.9, 4.9, 4, 4.3, 4.5, '2024-03-08 23:28:06', NULL);
INSERT INTO `comments` VALUES (777, 112, 191, 't***5', '两年没来了前台还有记录，从入住到退房都很好', NULL, 59, 1, 5, 4.1, 4.8, 4.8, 5, 4.7, '2024-01-09 16:18:36', NULL);
INSERT INTO `comments` VALUES (778, 112, 123, 'P***7', '房间安静卫生，欠缺夜景。', NULL, 59, 0, 4.2, 4, 4.1, 4.4, 4.8, 4.3, '2024-02-23 14:02:18', NULL);
INSERT INTO `comments` VALUES (779, 112, 167, 'Q***0', '住宿的感觉和体验非常棒，整个酒店设计更有一种静谧之美。让你能够安静下来，然后忘掉工作中的繁忙和辛苦。', NULL, 59, 0, 4.5, 4.6, 4.4, 4.3, 4.5, 4.5, '2024-02-18 15:00:58', NULL);
INSERT INTO `comments` VALUES (780, 112, 118, 'o***4', '一如即往的服务好，来深圳都会住四季，地理位置好，服务好', NULL, 59, 0, 4.8, 4.2, 4.7, 4.4, 4.9, 4.6, '2024-02-03 16:58:42', NULL);
INSERT INTO `comments` VALUES (781, 112, 178, 'r***1', '房间很大，很舒服', NULL, 59, 0, 4.6, 4.1, 4.4, 4.4, 4.6, 4.4, '2024-02-16 00:02:04', NULL);
INSERT INTO `comments` VALUES (782, 112, 92, 'l***9', '四季酒店，每次出差都喜欢住这里，旁边配套很给力，吃住都特别方便，前台的Vivian小姐姐特别好，二话不说，秒懂我的小心机，还会再来', NULL, 59, 0, 4.6, 5, 4.3, 4.5, 4.4, 4.6, '2024-02-23 14:40:47', NULL);
INSERT INTO `comments` VALUES (783, 112, 136, 't***1', '很方便 还不错', NULL, 59, 0, 4.8, 4.7, 4.1, 4.7, 4.8, 4.6, '2024-02-12 18:42:05', NULL);
INSERT INTO `comments` VALUES (784, 112, 152, 'v***1', '该酒店位于福田的绝佳位置，毗邻会议中心。服务充足，我住得很愉快。', NULL, 59, 0, 4.1, 4.2, 4.6, 4.3, 4.1, 4.3, '2024-02-05 08:14:19', NULL);
INSERT INTO `comments` VALUES (785, 112, 135, 'w***2', '老牌还是老牌', NULL, 59, 0, 4.6, 4.1, 4.2, 4.6, 4.1, 4.3, '2024-01-25 21:37:53', NULL);
INSERT INTO `comments` VALUES (786, 112, 208, 'j***5', '非常好，还给我们升级了房型', NULL, 59, 0, 4.7, 5, 4.3, 4.1, 4.6, 4.5, '2024-02-14 18:02:21', NULL);
INSERT INTO `comments` VALUES (787, 112, 173, 'H***3', '维持的很好的酒店！很棒', NULL, 59, 0, 4.8, 4.4, 4.4, 4.9, 4.2, 4.5, '2024-01-28 16:43:36', NULL);
INSERT INTO `comments` VALUES (788, 113, 82, 'I***0', '从服务到环境都那么无可挑剔，在深圳最喜欢住的酒店', NULL, 59, 1, 4.8, 4.2, 4.9, 4.6, 4.6, 4.6, '2024-03-08 21:05:55', NULL);
INSERT INTO `comments` VALUES (789, 113, 92, 'L***9', '油烟味，服务不行', NULL, 59, 1, 4.8, 4.6, 4.6, 4.3, 4.1, 4.5, '2024-03-21 09:37:56', NULL);
INSERT INTO `comments` VALUES (790, 113, 206, 'y***6', '卫生：', NULL, 59, 1, 4.5, 4.6, 4.6, 4.8, 4, 4.5, '2024-02-14 16:05:41', NULL);
INSERT INTO `comments` VALUES (791, 113, 112, 'L***7', '位置极佳的酒店', NULL, 59, 0, 4.5, 4.8, 4.3, 4.1, 4.6, 4.5, '2024-04-21 17:33:13', NULL);
INSERT INTO `comments` VALUES (792, 113, 206, 'Y***6', '酒店环境非常好，服务态度也很好！！！！！！！！！！！！', NULL, 59, 0, 4.6, 4.3, 4, 4.4, 4.1, 4.3, '2024-04-27 15:31:34', NULL);
INSERT INTO `comments` VALUES (793, 113, 112, 'l***7', '整挺好..', NULL, 59, 0, 4.5, 4.2, 4.1, 4.6, 4.5, 4.4, '2024-03-11 17:00:17', NULL);
INSERT INTO `comments` VALUES (794, 113, 169, 'm***4', '一楼的保安；****吗？，开个路虎去一楼去停车，被命令停下面，说这个车位是他们林董的，口气生硬，绝对命令加威胁，这是五星酒店吗？淋懂自己一个人住的酒店吗？林董是谁？你的保安为啥不把住你的车位，比如树立个碑，林董专用！建议改名叫深圳林董专属酒店，', NULL, 59, 0, 4, 4.6, 4.2, 4.9, 5, 4.5, '2024-03-17 21:53:08', NULL);
INSERT INTO `comments` VALUES (795, 113, 131, 'P***1', '我入住时有特别备注是因为结婚纪念日，然后酒店宾客体验经理Emily有主动打电话咨询我的需求，并主动安排了一系列客房安排，用实际行动证明了什么是四季的服务和奢华酒店的定义', NULL, 59, 0, 4.8, 4.9, 4.5, 4.5, 4.8, 4.7, '2024-02-13 20:07:34', NULL);
INSERT INTO `comments` VALUES (796, 114, 214, 'C***0', '地理位置和服务一如既往的满意。极力推荐！酒店就在Coco park商业区中心这里。周边围绕着酒吧，商场，餐厅和各种创意设计的办公楼。酒店行政楼的Max对我和老人的服务真的贴心到位，又很可爱。下次还会再来', NULL, 59, 1, 4.8, 4.8, 5, 4.6, 4, 4.6, '2024-04-19 19:38:07', NULL);
INSERT INTO `comments` VALUES (797, 114, 146, 'q***4', '肥肠的豪华 洗手间有30平米', NULL, 59, 1, 4.7, 4.7, 4.4, 4.4, 4.8, 4.6, '2024-04-08 23:29:13', NULL);
INSERT INTO `comments` VALUES (798, 114, 163, 'X***5', '交通特别方便', NULL, 59, 1, 4.9, 4.9, 4.4, 4.3, 4.3, 4.6, '2024-04-24 06:10:22', NULL);
INSERT INTO `comments` VALUES (799, 114, 60, '匿名用户', '周到细致、物有所值', NULL, 59, 1, 4.5, 4, 5, 4.4, 4.1, 4.4, '2024-04-02 12:56:05', NULL);
INSERT INTO `comments` VALUES (800, 114, 121, 'D***5', '不错，但不如广州四季景色好', NULL, 59, 1, 4.3, 4.1, 4.2, 4.8, 4.7, 4.4, '2024-03-03 14:33:27', NULL);
INSERT INTO `comments` VALUES (801, 114, 212, '1***4', 'Spa不值这个价', NULL, 59, 1, 4.2, 4.8, 4.2, 4.4, 4.6, 4.4, '2024-04-16 21:50:57', NULL);
INSERT INTO `comments` VALUES (802, 114, 91, 'I***2', '早餐一般种类少，室内装修旧，服务很好', NULL, 59, 1, 4.6, 4.9, 4.4, 4.7, 4.7, 4.7, '2024-01-12 14:52:17', NULL);
INSERT INTO `comments` VALUES (803, 114, 102, 'T***7', '服务态度好，房间舒适，开阔，视野好！就是早餐不咋地……吃的品类不多。', NULL, 59, 0, 4.2, 4.6, 4.6, 4.6, 4.3, 4.5, '2024-04-11 09:02:05', NULL);
INSERT INTO `comments` VALUES (804, 114, 152, 'V***1', '入住时，门锁展示黄灯刷不开，让人来修。下楼绕了一圈回去，门口没人，门还是打不开。再次打电话催促才有人来！客人去用餐，让工作人员修完把房卡放前台，吃完回来去取。然而去前台取卡时却被告知并不知道这回事，临时又做了新房卡。可见工作人员责任心不够，服务比较随意。', NULL, 59, 0, 4.8, 5, 4.3, 4.9, 4.7, 4.7, '2024-04-08 15:12:21', NULL);
INSERT INTO `comments` VALUES (805, 114, 105, 'h***7', '有些粗糙，不太高档', NULL, 59, 0, 4.5, 4.8, 5, 4.6, 4.8, 4.7, '2024-04-22 21:03:54', NULL);
INSERT INTO `comments` VALUES (806, 114, 149, 'b***1', '地理位置好，周边吃饭很方便，走路就，房间每天都配有消毒纸巾、免洗洗手液和口罩，床品也很舒服，配的水都是5100西藏冰川矿泉水，房间很大，布局很舒服', NULL, 59, 0, 4.1, 4.7, 5, 4.1, 4.4, 4.5, '2024-04-15 18:14:41', NULL);
INSERT INTO `comments` VALUES (807, 114, 95, 'V***3', '好好好好好好好好好好好好好好好好好好好好', NULL, 59, 0, 4.1, 4.8, 4.7, 4.4, 4.6, 4.5, '2024-04-26 15:36:25', NULL);
INSERT INTO `comments` VALUES (808, 114, 113, 'w***4', '每次出差都住这儿，还不错，早餐品类稍微少了一点，不过服务真的很好', NULL, 59, 1, 4, 4.6, 4, 4.9, 4.9, 4.5, '2024-01-15 14:21:19', NULL);
INSERT INTO `comments` VALUES (809, 114, 190, 'b***3', '服务，位置都不错', NULL, 59, 0, 5, 4.1, 4.7, 4.4, 4.6, 4.6, '2024-03-18 19:03:39', NULL);
INSERT INTO `comments` VALUES (810, 114, 182, 'r***9', '四季一直是我最喜欢的，因为服务属于一流。', NULL, 59, 0, 4.3, 4.7, 4.8, 4.7, 4.5, 4.6, '2024-03-03 20:27:46', NULL);
INSERT INTO `comments` VALUES (811, 114, 142, 'N***1', '酒店服务极差', NULL, 59, 0, 4.4, 4.8, 4.3, 4, 4.4, 4.4, '2024-03-18 19:01:38', NULL);
INSERT INTO `comments` VALUES (812, 114, 89, 'F***9', 'OKOKOKOKOKOK', NULL, 59, 0, 4.9, 4.8, 5, 4.9, 4.8, 4.9, '2024-03-14 14:15:08', NULL);
INSERT INTO `comments` VALUES (813, 114, 136, 't***1', '中心区，交通便利', NULL, 59, 0, 4.4, 4.7, 4.6, 4.8, 4.6, 4.6, '2024-04-03 23:59:10', NULL);
INSERT INTO `comments` VALUES (814, 114, 165, 'v***7', '非常好，下次再来', NULL, 59, 0, 4.4, 4.5, 4.2, 4.7, 4.5, 4.5, '2024-04-24 12:31:36', NULL);
INSERT INTO `comments` VALUES (815, 114, 164, 'Z***1', '老婆入住的第二天生日，所以提前跟酒店说能否入住当天房间布置一下，酒店还特意提前打电话联系，落实相关事情，还准备了蛋糕，贺卡和花，气球，老婆也非常喜欢，第一次入住四季酒店，感觉很好，以后有机会也会考虑继续选择四季酒店～', NULL, 59, 1, 4.1, 4.3, 4.6, 4.5, 4.2, 4.3, '2023-11-30 01:16:16', NULL);
INSERT INTO `comments` VALUES (816, 114, 149, 'b***1', '酒店房间大，设施好，服务完善！特别表扬宾客体验部经理Emily、主管Max和客房部的主管Ella。这几位工作人员服务专业，有求必应，非常周到！下次还会带宝宝去过周末~', NULL, 59, 0, 4, 4.4, 4.3, 4.5, 4.8, 4.4, '2024-04-15 18:14:41', NULL);
INSERT INTO `comments` VALUES (817, 114, 95, 'V***3', '在深圳与太太庆祝结婚二十周年，预定了四季酒店豪华双床房，理由是四季酒店是高端豪华酒店的顶流，而且地点极佳，旁边Coco park，皇庭广场，餐饮娱乐一应俱全，交通便利，一号线四号线交汇于此，公交车也非常多。最为关键的是，四季酒店的服务一流，所有员工热情有礼貌，服务细致入微。本打算抱着试一试的想法，联系酒店是否能早点儿入住，碰巧是客房部的Emily Hau经理值班，给与我们升级房间，赠送蛋糕和起泡酒的礼遇，而且房间布置非常浪漫，完全出乎我们的预料，非常感动。我想，四季酒店的顶流位置固然有硬件投入的高标准，酒店设施的豪华程度，以及在每个城市中心的傲人位置，然而更加让住客对它认可的是，全体员工的努力和投入，热心和温情，让四季酒店在客人心中四季常新，住过还想住。', NULL, 59, 0, 4.9, 4.2, 4.4, 4.5, 4.6, 4.5, '2024-04-26 15:36:25', NULL);
INSERT INTO `comments` VALUES (818, 114, 113, 'w***4', '酒店位置好，地铁口，附近就是购物广场，吃饭特别方便，推荐', NULL, 59, 1, 4.5, 5, 4.5, 4.5, 4.7, 4.6, '2024-01-15 14:21:19', NULL);
INSERT INTO `comments` VALUES (819, 114, 190, 'b***3', '自助餐和早餐种类太少，质量一般，价格偏贵', NULL, 59, 0, 4.3, 4.8, 4.6, 4.2, 4.1, 4.4, '2024-03-18 19:03:39', NULL);
INSERT INTO `comments` VALUES (820, 114, 182, 'r***9', '还不错，位置挺方便的', NULL, 59, 0, 4.7, 4.2, 4.6, 4.2, 4.4, 4.4, '2024-03-03 20:27:46', NULL);
INSERT INTO `comments` VALUES (821, 114, 142, 'N***1', '入住环境非常舒适，感觉非常好；服务到位，应有尽有，有家的感觉；关健是开水壶忘记清洗，棉被有点湿度，有空可洒洒太阳，增加被子舒适感。', NULL, 59, 0, 5, 4.2, 4.2, 5, 4.4, 4.6, '2024-03-18 19:01:38', NULL);
INSERT INTO `comments` VALUES (822, 114, 89, 'F***9', '国庆期间入住、正好是生日入住、酒店直接帮我们升级到了四季套房、精心布置了玫瑰花、气球和生日蛋糕！爆赞', NULL, 59, 0, 4.4, 4.3, 4.6, 4.8, 4.1, 4.4, '2024-03-14 14:15:08', NULL);
INSERT INTO `comments` VALUES (823, 114, 136, 't***1', '很棒的酒店，员工态度都特别好，和蔼亲切，主动，友好的给客人解答问题。房间特别棒，非常宽敞，床也很舒服，特别好，房间整体阳光很好，也很干净，空调效果好。总之，非常不错的一次入住体验，有时间还会再来的！', NULL, 59, 0, 4.2, 4.6, 4.7, 4.8, 4.7, 4.6, '2024-04-03 23:59:10', NULL);
INSERT INTO `comments` VALUES (824, 114, 165, 'v***7', '第一次入住深圳四季酒店，有很好的入住体验，房间干净舒适，宽敞明亮，在处理客人提前入住房间或是解决客人一些特别要求都以客人为上，尤其是行政酒廊的Max小姐，她耐心解释，悉心照顾，尽职尽责，表现出非常好的职业素质，给我们留下很好的印象。', NULL, 59, 0, 4.1, 4.1, 4.8, 5, 4.1, 4.4, '2024-04-24 12:31:36', NULL);
INSERT INTO `comments` VALUES (825, 114, 164, 'Z***1', '办理入住的速度有点偏慢，早餐部分服务员的服务意识有待加强，房间设施偏旧，其余都符合对四季酒店的品牌预期。', NULL, 59, 1, 4.5, 4.3, 4.3, 4.7, 5, 4.6, '2023-11-30 01:16:16', NULL);
INSERT INTO `comments` VALUES (826, 115, 60, '匿名用户', '没有接待人流量大的经验，一间星级酒店入住要等到下午4点半，早餐也要排队吃', NULL, 60, 1, 4.5, 4.2, 4.4, 5, 4.8, 4.6, '2024-04-25 09:36:56', NULL);
INSERT INTO `comments` VALUES (827, 116, 60, '匿名用户', '喜欢大浴缸泡澡', NULL, 60, 1, 4.7, 4.5, 4.3, 4.8, 4.1, 4.5, '2024-04-10 14:24:18', NULL);
INSERT INTO `comments` VALUES (828, 116, 183, '2***5', '两个娃的宝妈一直没有时间点评，酒店住房真的超级满意，谢谢你们让我和先生渡过了美好的6周年！', NULL, 60, 0, 4.4, 4, 4.7, 4.7, 4.8, 4.5, '2024-04-15 21:55:15', NULL);
INSERT INTO `comments` VALUES (829, 116, 215, '2***2', '环境：一流！', NULL, 60, 0, 4.3, 4.8, 4.7, 4.2, 4.8, 4.6, '2024-04-13 22:56:15', NULL);
INSERT INTO `comments` VALUES (830, 116, 216, '6***2', '很棒的店铺；值得点赞', NULL, 60, 0, 4.5, 4, 4.5, 5, 4.6, 4.5, '2024-03-04 11:16:03', NULL);
INSERT INTO `comments` VALUES (831, 116, 60, '匿名用户', '四季真的太赞啦！！！国庆期间免费给我升级了行政套房，服务真的太棒了，真的很喜欢房间里面的bose音响，楼下大堂礼宾部也跟热情，帮忙叫车还会一直提醒司机，棒棒的，会一直选择四季酒店', NULL, 60, 0, 4.9, 4.3, 4.5, 5, 5, 4.7, '2024-02-11 12:00:41', NULL);
INSERT INTO `comments` VALUES (832, 116, 60, '匿名用户', '位置很方便，服务很好', NULL, 60, 0, 4.2, 4.8, 4.1, 4.8, 4.1, 4.4, '2024-02-25 13:13:57', NULL);
INSERT INTO `comments` VALUES (833, 116, 217, '3***2', '四季一如既往的稳 服务 卫生 福田这家偏商务 位于会展中心 商旅出差比较多 但带娃出行的 孩子的所有需求都能满足 非常满足', NULL, 60, 0, 5, 4.2, 4.4, 4.8, 4.5, 4.6, '2024-02-23 11:41:06', NULL);
INSERT INTO `comments` VALUES (834, 116, 60, '匿名用户', '深圳最爱的酒店，性价比超高的酒店', NULL, 60, 0, 4.1, 4.7, 4.8, 4.7, 4, 4.5, '2024-02-04 14:02:08', NULL);
INSERT INTO `comments` VALUES (835, 116, 216, '6***2', '一直很喜欢住四季，无论度假型还是城市型都很贴心。深圳四季虽然装修很老了，但是保持的很好，经典的典范。早餐很棒。', NULL, 60, 0, 4.3, 5, 4.8, 4.3, 4.2, 4.5, '2024-02-04 10:23:02', NULL);
INSERT INTO `comments` VALUES (836, 116, 218, '1***1', '礼宾部的Johnny Zeng非常热心 走的时候还给我们送了水。', NULL, 60, 0, 4.1, 4.5, 4.4, 4.8, 4.8, 4.5, '2024-02-07 13:02:31', NULL);
INSERT INTO `comments` VALUES (837, 116, 219, '6***1', '位置很好，毕竟是四季，公共设施，大堂装修都感觉都很好，但是早餐太烂了，选择很少，也不好吃，泳池还行。', NULL, 60, 0, 4.8, 5, 4.4, 4.3, 4.1, 4.5, '2024-01-28 21:08:35', NULL);
INSERT INTO `comments` VALUES (838, 117, 176, '1***9', '四季还是很舒服的，虽然开业很多年了但设施维护的很好，没有老旧感，洗手间也大，洗护也好用，早餐精致好吃！前台Marmara Ge 葛梦瑶 哈哈哈英文名太特别记住了，很热情的升级了房间，回访也挺甜，赞一个一般有四季的城市都优先考虑四季！', NULL, 61, 1, 4.1, 5, 4.3, 4.7, 5, 4.6, '2024-03-25 23:09:33', NULL);
INSERT INTO `comments` VALUES (839, 117, 60, '匿名用户', '酒店真的挺不错的，价格也良心', NULL, 61, 1, 4.6, 4.3, 4.1, 4.8, 4.2, 4.4, '2024-02-14 17:51:54', NULL);
INSERT INTO `comments` VALUES (840, 117, 60, '匿名用户', '完美的服务，热情周到，房间无可挑剔。早餐尤其是高亮，真的很棒，有钱一定要去住这里的四季酒店。租后给门口的door man Johhny Zeng点赞，给我们拿行李叫车招待特别热情，还给了我们三人每人一瓶水，还是我们走的时候。优秀的小哥，大写的赞！', NULL, 61, 1, 4.8, 4.6, 4.6, 4.4, 4.9, 4.7, '2024-03-24 13:49:10', NULL);
INSERT INTO `comments` VALUES (841, 117, 220, 'C***9', '帮领导出差定的，领导很满意，性价比很高，交通也很方便，唯一不好的就是，房价变动太大了，一定要一天一天订', NULL, 61, 0, 4.5, 4.9, 4.5, 4, 4.4, 4.5, '2024-04-21 15:36:49', NULL);
INSERT INTO `comments` VALUES (842, 117, 60, '匿名用户', '床太高太小，你知道设计师怎么设计的，这能舒服吗', NULL, 61, 1, 4.5, 4.4, 5, 4.2, 4.3, 4.5, '2024-02-21 17:54:19', NULL);
INSERT INTO `comments` VALUES (843, 117, 179, '3***4', '四季五星服务品质在礼宾部小马身上得到完美体现。', NULL, 61, 0, 4.2, 4.5, 4.8, 4.4, 4.4, 4.5, '2024-04-03 13:15:41', NULL);
INSERT INTO `comments` VALUES (844, 117, 221, '3***7', '每次来深圳必住的酒店。地段好，离商场酒吧都很近。酒店的配套和设备都很齐全，住的开心睡的放心。四季酒店永远不会让你失望。', NULL, 61, 0, 4.3, 4.5, 4.9, 4.1, 4.7, 4.5, '2024-02-20 10:39:09', NULL);
INSERT INTO `comments` VALUES (845, 117, 222, 'B***2', '前台办理的服务人员态度太差了', NULL, 61, 0, 4.1, 4.3, 4.9, 4.4, 4.6, 4.5, '2024-02-10 22:26:31', NULL);
INSERT INTO `comments` VALUES (846, 117, 223, '1***0', '酒店房间内各项设施设备设计完美，非常贴心、方便，使用起来非常舒服', NULL, 61, 0, 4.9, 4.3, 4.1, 4.2, 4.6, 4.4, '2024-02-16 15:41:12', NULL);
INSERT INTO `comments` VALUES (847, 117, 59, 'D***8', '和很多很多很多节课呢你多久到几点就上班不去上班的呢你蹑手蹑脚时间', NULL, 61, 0, 5, 4, 4.6, 5, 4.5, 4.6, '2023-10-31 08:59:10', NULL);
INSERT INTO `comments` VALUES (848, 117, 60, '匿名用户', '周边环境不错，在福田，就是个豪华商务酒店，室内泳池不错，但是忘记带泳衣了。。。。为了第一次体验四季过来住的。没海德划算。。。。', NULL, 61, 0, 4.5, 4.4, 4.5, 4.2, 4.4, 4.4, '2023-10-02 09:10:15', NULL);
INSERT INTO `comments` VALUES (849, 117, 184, 'E***8', '一如既往的好。 周围吃东西比较方便。已经入住多次。', NULL, 61, 0, 4.8, 4.1, 4.1, 4, 4.4, 4.3, '2023-08-18 12:48:39', NULL);
INSERT INTO `comments` VALUES (850, 117, 224, '3***9', '每一次去深圳都入住，四季酒店服务非常到位，环境卫生都非常不错，所以也很安心早餐出品也很好，地理位置十分方便。', NULL, 61, 0, 4.8, 4.2, 4.1, 4.9, 4.2, 4.4, '2023-08-15 14:55:27', NULL);
INSERT INTO `comments` VALUES (851, 117, 179, '3***4', '位置极佳，夜景漂亮，交通便利位置好，服务佳', NULL, 61, 1, 4.9, 4.3, 4.9, 4.3, 4.1, 4.5, '2023-07-22 12:36:41', NULL);
INSERT INTO `comments` VALUES (852, 117, 60, '匿名用户', '房间非常舒服', NULL, 61, 0, 4.5, 4.8, 4.4, 4.5, 4.8, 4.6, '2023-07-11 15:45:00', NULL);
INSERT INTO `comments` VALUES (853, 117, 218, '1***1', '酒店地理位置不错，不过有些老旧了', NULL, 61, 0, 4.1, 4.7, 4.1, 4.4, 4.1, 4.3, '2023-10-08 20:03:46', NULL);
INSERT INTO `comments` VALUES (854, 117, 120, 'E***2', '环境：很好', NULL, 61, 0, 4.7, 4.1, 4.7, 4.5, 5, 4.6, '2023-07-04 04:07:21', NULL);
INSERT INTO `comments` VALUES (855, 118, 172, 'z***9', '非常满意 电视机坏了 还立刻有服务员重新送一台过来', NULL, 62, 1, 4.2, 4, 4.9, 4.1, 4.1, 4.3, '2024-01-25 14:55:15', NULL);
INSERT INTO `comments` VALUES (856, 118, 206, 'y***6', '客房舒适，每次首选四季。', NULL, 62, 1, 4.9, 4.8, 4.8, 4.2, 4.4, 4.6, '2024-02-20 22:27:11', NULL);
INSERT INTO `comments` VALUES (857, 118, 182, 'R***9', '位置挺好的，去哪都方便。周边还有一排的酒店，下次要体验别的。四季服务还是很贴心的，全程宾至如归。早餐丰盛。', NULL, 62, 1, 4.1, 4.4, 5, 4.3, 4.7, 4.5, '2023-10-29 22:12:26', NULL);
INSERT INTO `comments` VALUES (858, 118, 155, 'x***9', '活动价格很划算', NULL, 62, 1, 4.9, 4.3, 4.7, 4.6, 4.7, 4.6, '2023-10-09 18:15:10', NULL);
INSERT INTO `comments` VALUES (859, 119, 211, 'l***1', '酒店位置非常方便。周围商场超多，酒店也很舒服，服务很好', NULL, 63, 0, 4.2, 4.2, 5, 4.4, 4.7, 4.5, '2024-02-03 20:33:18', NULL);
INSERT INTO `comments` VALUES (860, 119, 56, '1***5', '四季酒店总体来说还是不错的，这次由于上海受灿都台风影响，航班取消，故连续住了三个晚上，可能生意好，房价一天一个样，这个多少有点儿遗憾！', NULL, 63, 0, 4, 4.6, 4.3, 4.1, 4, 4.2, '2023-10-01 19:58:42', NULL);
INSERT INTO `comments` VALUES (861, 119, 166, 'z***7', '不太满意的入住体验。', NULL, 63, 1, 4.7, 4.8, 4.4, 4.3, 5, 4.6, '2023-10-06 10:58:34', NULL);
INSERT INTO `comments` VALUES (862, 119, 115, 'J***7', '为了停车足足让我们绕了几圈才找到停车场入口，到了地库居然发现有几个人在地库“忙碌”着怎样指示停车，但是地面却一个人也没有。办理入住的服务员没有什么表情，幸好酒店卫生和硬件设施都不错。', NULL, 63, 1, 4.5, 4.9, 4, 4.4, 4.7, 4.5, '2023-10-04 20:16:28', NULL);
INSERT INTO `comments` VALUES (863, 119, 121, 'd***5', '如遇特殊情况', NULL, 63, 1, 4.1, 4.4, 4.5, 4.9, 4.7, 4.5, '2023-08-12 16:30:32', NULL);
INSERT INTO `comments` VALUES (864, 119, 153, 'R***5', '四季的标准自然不会太差，位置也好，方便，对时尚潮流没有太大要求的话是可以的！', NULL, 63, 1, 4.3, 4.8, 4.1, 4.3, 4.2, 4.3, '2023-08-09 11:44:32', NULL);
INSERT INTO `comments` VALUES (865, 119, 162, 'Y***4', '【惬意spa】', NULL, 63, 1, 4.2, 4.3, 4.8, 4.5, 4.7, 4.5, '2023-08-16 13:27:21', NULL);
INSERT INTO `comments` VALUES (866, 119, 100, 'B***7', '服务态度好，酒店设施好，可能疫情大堂和周边有点肮脏', NULL, 63, 1, 4.5, 4.1, 4.2, 4.6, 4, 4.3, '2023-07-24 14:21:41', NULL);
INSERT INTO `comments` VALUES (867, 119, 65, 'Z***5', '比较满意，希望继续保持', NULL, 63, 0, 4.2, 4.1, 4.2, 4.9, 4.7, 4.4, '2023-01-25 14:27:20', NULL);
INSERT INTO `comments` VALUES (868, 120, 142, 'n***1', '和朋友一起预定了两间房，酒店位置好，房间很大很干净～服务很好尤其前台办理入住安排房间的小哥哥小姐姐态度好动作也快。爱了爱了！', NULL, 63, 0, 4.2, 4.3, 4.2, 4.8, 4.7, 4.4, '2023-01-26 10:56:27', NULL);
INSERT INTO `comments` VALUES (869, 121, 152, 'v***1', '和朋友约了周六晚一起看街舞，房间电视可以手机投屏，挺好的。', NULL, 63, 1, 4.1, 4.1, 4.4, 4.8, 4.9, 4.5, '2023-10-06 16:55:30', NULL);
INSERT INTO `comments` VALUES (870, 121, 163, 'X***5', '十年前就加入了四季酒店的贵宾会，那个时候觉得这是个很有深度，温度，品质的奢华酒店。十年后再次光临，服务品质丝毫没有降低，还给升了两级，住了70平的四季大床房，有个用屏风隔断的客厅，卫生间干湿分离，自动感应马桶很灵敏，晚上睡觉空调声音很安静，景观也很棒，如果说莱佛士奢华，中洲万豪品质，那么四季就是奢雅有度', NULL, 63, 0, 4.4, 4.3, 5, 4.8, 4.3, 4.6, '2023-10-06 16:56:01', NULL);
INSERT INTO `comments` VALUES (871, 121, 89, 'F***9', '各方面都很好，不错，卫生干净，服务员态度好，酒店位置好，利于出差，早餐品类多，非常丰富，味道也好。', NULL, 63, 1, 4.7, 4.9, 4.5, 4.5, 4.9, 4.7, '2023-08-14 09:56:04', NULL);
INSERT INTO `comments` VALUES (872, 121, 115, 'j***7', '早餐真不行，要个鸡蛋先去了一次，被人拿走了，又要了一次，半天没送过来，还得自己去催', NULL, 63, 1, 4, 4.2, 4.8, 4.5, 4.3, 4.4, '2023-07-27 10:41:02', NULL);
INSERT INTO `comments` VALUES (873, 121, 84, 'f***1', '性价比很好', NULL, 63, 0, 5, 4.3, 4.8, 4.5, 4.3, 4.6, '2023-06-25 14:22:57', NULL);
INSERT INTO `comments` VALUES (874, 121, 175, 'P***9', '性价比在深圳算可以', NULL, 63, 1, 4.5, 4.9, 4.9, 4.5, 4.7, 4.7, '2023-01-22 13:35:57', NULL);
INSERT INTO `comments` VALUES (875, 122, 225, 'P***5', '交通：he好', NULL, 63, 1, 4.4, 4.2, 4.9, 4.3, 4.4, 4.4, '2024-04-22 22:33:45', NULL);
INSERT INTO `comments` VALUES (876, 122, 180, '1***8', '酒店经理安排相当贴心，升级了房间安排了红酒与奶酪拼盘。', NULL, 63, 0, 4.6, 4.7, 4.3, 4.6, 4.5, 4.5, '2024-01-21 15:47:50', NULL);
INSERT INTO `comments` VALUES (877, 122, 99, 'Q***8', '四季酒店，一个服务永远在线的酒店，本来打算住一天的，入住后觉得特别舒服，直接又续了三天，下次来深圳还打算入住四季！', NULL, 63, 1, 4.7, 4.9, 4.8, 5, 5, 4.9, '2023-10-04 20:13:09', NULL);
INSERT INTO `comments` VALUES (878, 122, 94, 'g***0', '已经是第N次入住了，就代表对四季酒店非常满意了，周边逛街购物吃饭什么的都非常方便，疫情防控做的特别好，很好的保障了客人的安全问题', NULL, 63, 1, 4.6, 4.3, 4.3, 4.7, 4.1, 4.4, '2023-10-06 16:52:46', NULL);
INSERT INTO `comments` VALUES (879, 122, 136, 'T***1', '很好很好的', NULL, 63, 1, 4.9, 4.3, 4.4, 4.6, 4.6, 4.6, '2023-07-20 15:49:11', NULL);
INSERT INTO `comments` VALUES (880, 122, 90, 'K***8', '卫生很干净。免费帮升级了。喜欢大大的落地窗，晚上的夜景超好。把深圳的繁华大都市好似一览眼中', NULL, 63, 1, 4.4, 4.6, 4.1, 4.1, 4.7, 4.4, '2023-06-24 08:19:52', NULL);
INSERT INTO `comments` VALUES (881, 122, 138, 'T***3', '一直住在四季～环境好服务好～尤其mara~帮了我好多…', NULL, 63, 0, 4.5, 4.9, 4.3, 4.2, 5, 4.6, '2023-06-28 12:06:55', NULL);
INSERT INTO `comments` VALUES (882, 122, 105, 'H***7', '四季酒店只听朋友说过垃圾，但我想应该比200块钱的平价酒店好一点，没想到昨天一住，被恶心到了，而且投诉无门，超过24小时都没人来解决，这就是四季的服务，受教了', NULL, 63, 1, 4.8, 4.7, 4.3, 4.7, 4.3, 4.6, '2023-02-14 19:11:00', NULL);
INSERT INTO `comments` VALUES (883, 122, 226, '6***4', '各方面体验均十分满意', NULL, 63, 1, 4, 4.2, 4.6, 4.4, 4.1, 4.3, '2023-01-29 07:51:36', NULL);
INSERT INTO `comments` VALUES (884, 123, 68, 'N***5', '确实奢华 符合五星级酒店水准 但也稍微有些老旧 大堂灯光有些昏暗', NULL, 64, 0, 4.4, 4.8, 4.2, 4.4, 4.6, 4.5, '2024-04-04 16:12:58', NULL);
INSERT INTO `comments` VALUES (885, 123, 135, 'w***2', '都好。都好老4S标准。', NULL, 64, 0, 4.7, 4.8, 4.9, 4.8, 4.1, 4.7, '2023-08-29 19:30:29', NULL);
INSERT INTO `comments` VALUES (886, 123, 207, 'g***6', '这是深圳最好的酒店之一。完美的位置，一流的设施和优秀的员工。雷切尔在我登记入住时就在那里，性格非常讨人喜欢。行政俱乐部经理是一位了不起的女孩，她非常了解如何对待客人。', NULL, 64, 1, 4.8, 4.3, 4.4, 4.5, 4.7, 4.5, '2023-08-02 20:09:32', NULL);
INSERT INTO `comments` VALUES (887, 123, 76, 'V***5', '第一次见那么傻的酒店，停车场的电梯到11点就关门，上楼还要打电话叫保安开门，好不容易等来了保安，结果态度十分恶劣，还问我为什么不早一点，我。。。。。。房间也很老旧。极度不推荐，砸了四季这个牌子', NULL, 64, 1, 4.2, 4.5, 4.6, 4.6, 4.8, 4.5, '2023-03-20 07:58:17', NULL);
INSERT INTO `comments` VALUES (888, 123, 124, 'V***9', '我只能说这是一家硬件设施、服务态度、出品品质、员工素质各方面都差到极点的五星级酒店！除了位置优越以外，没什么可以值得一提的！从门口到大堂经理还有中餐厅范经理，还有你们投诉部门，酒店品牌给你们带来的优越感是这样让你们无视客户的嘛！这是目前体验过全球最差的四季！没有之一！', NULL, 64, 0, 4, 4.3, 4.1, 4.9, 4.1, 4.3, '2023-05-03 21:07:01', NULL);
INSERT INTO `comments` VALUES (889, 124, 77, 'n***9', '一般，', NULL, 65, 0, 4.4, 4.5, 4.3, 4.6, 4.1, 4.4, '2023-11-28 13:42:44', NULL);
INSERT INTO `comments` VALUES (890, 124, 100, 'b***7', '酒店的好用心', NULL, 65, 0, 4.4, 4, 4.2, 4.6, 4.6, 4.4, '2022-02-07 09:57:36', NULL);
INSERT INTO `comments` VALUES (891, 124, 83, 'y***8', '房间太小了，性价比不高', NULL, 65, 1, 4.6, 4.4, 4.6, 4.3, 4.7, 4.5, '2022-01-20 20:36:08', NULL);
INSERT INTO `comments` VALUES (892, 124, 125, 'u***6', '和其他城市的四季相比，好像点普通了。', NULL, 65, 1, 4.8, 4.9, 4.4, 4.3, 4.3, 4.5, '2022-07-10 21:04:25', NULL);
INSERT INTO `comments` VALUES (893, 124, 184, 'E***8', '酒店人员服务热情，前台可乐给人印象深刻，住的房间景观优美', NULL, 65, 1, 4.8, 4.5, 4.4, 4.8, 4.6, 4.6, '2021-12-18 21:22:59', NULL);
INSERT INTO `comments` VALUES (894, 124, 78, 'h***9', '非常棒的酒店，服务非常好！', NULL, 65, 0, 4.8, 4.8, 4.9, 4.1, 4.2, 4.6, '2022-01-22 20:17:32', NULL);
INSERT INTO `comments` VALUES (895, 124, 212, '1***4', '名不虚传的美国高级酒店', NULL, 65, 0, 4.4, 4.4, 4.5, 4.5, 4.8, 4.5, '2022-08-19 22:47:13', NULL);
INSERT INTO `comments` VALUES (896, 124, 147, 'f***3', '酒店很不错，但是中间停电了。。那么大的酒店停电也是没谁了！', NULL, 65, 1, 4.7, 4.1, 4.7, 4.9, 4.4, 4.6, '2022-07-03 16:47:52', NULL);
INSERT INTO `comments` VALUES (897, 124, 134, 'K***4', '四季的服务名不虚传 电话告知了需求 就安排了红球气球灯牌这些 诚意满满 设施有些老旧 早上停电两次 好像是因为短路 还会再来 谢谢', NULL, 65, 0, 4.1, 4.9, 5, 4.4, 4.8, 4.6, '2022-02-16 08:12:25', NULL);
INSERT INTO `comments` VALUES (898, 124, 113, 'W***4', '很满意，酒店各方面都挺好的', NULL, 65, 0, 4, 4.9, 4.7, 4.4, 4.4, 4.5, '2022-02-05 08:40:24', NULL);
INSERT INTO `comments` VALUES (899, 124, 69, 'W***8', '符合四季的特点，服务费超热情，升级了行政房，房间设施齐全，超大空间，安静，超喜欢。以后来深圳就住这里了', NULL, 65, 0, 4.9, 4.2, 4.7, 4.3, 4.8, 4.6, '2022-01-12 20:26:41', NULL);
INSERT INTO `comments` VALUES (900, 124, 64, 'e***0', '挺好的，尤其是', NULL, 65, 0, 4.8, 4.3, 4.5, 4.2, 4.7, 4.5, '2022-08-17 09:04:03', NULL);
INSERT INTO `comments` VALUES (901, 124, 94, 'G***0', '还行 浴袍感觉没以前好了', NULL, 65, 0, 4.6, 4.3, 4.6, 4.1, 4.5, 4.4, '2022-01-24 20:20:47', NULL);
INSERT INTO `comments` VALUES (902, 124, 108, 'Y***0', '我是 ABDALLAH IHSSAN，经常入住四季酒店，最舒适的氛围，与中国所有酒店相比，拥有最好的英语沟通服务，欢迎并始终友好微笑的工作人员。', NULL, 65, 1, 4.8, 4.3, 4.3, 4.5, 4.7, 4.5, '2021-11-27 16:57:14', NULL);
INSERT INTO `comments` VALUES (903, 124, 124, 'v***9', '酒店服务挺好的 就是停车场有点小', NULL, 65, 0, 4.9, 5, 4.3, 4.1, 4.5, 4.6, '2022-02-24 18:48:27', NULL);
INSERT INTO `comments` VALUES (904, 124, 168, 'S***8', '综合来说都不错 就是有点旧', NULL, 65, 0, 4.5, 4.5, 4.1, 4.1, 4.3, 4.3, '2022-04-22 14:11:39', NULL);
INSERT INTO `comments` VALUES (905, 124, 82, 'i***0', '环境：设施有点旧，但整体还可以。', NULL, 65, 0, 4.3, 4.5, 4.8, 4.3, 4.3, 4.4, '2022-04-22 14:12:33', NULL);
INSERT INTO `comments` VALUES (906, 125, 138, 'T***3', '在网上对比了几个五星级酒店之后，选择了位于会展中心的四季酒店，虽然网上评价设施有点点旧，但其实不觉得，8月13号入住，欣喜的是前台看到我们一家三口立刻给我们升级到80平的豪华套房，告诉我们住得宽敞些会更舒适，意外的惊喜，前台的服务非常好，健身房的饮料配置卫生以及游泳池的设施都非常满意，自助早餐品种虽不是太多，但质量还是满意的。我们一家人说好了下次依然会入住深圳四季酒店，感谢前台Tony以及帮我升级的暖心接待员！', NULL, 65, 0, 4.3, 4, 4.6, 4.4, 4.7, 4.4, '2023-08-20 09:57:35', NULL);
INSERT INTO `comments` VALUES (907, 125, 72, 'R***7', '房间特别安静，总机接电话快，态度好', NULL, 65, 0, 4.3, 4.4, 4, 5, 4.3, 4.4, '2023-08-29 12:14:25', NULL);
INSERT INTO `comments` VALUES (908, 125, 182, 'r***9', '特别贴心，实至名归的酒店服务对得起价格，喜欢', NULL, 65, 1, 4.3, 4.7, 4.6, 4.2, 4.1, 4.4, '2023-05-10 15:25:28', NULL);
INSERT INTO `comments` VALUES (909, 125, 176, '1***9', '喜欢扣钱。过于爱钱', NULL, 65, 1, 4.8, 4.5, 4.8, 4.4, 4.4, 4.6, '2022-09-12 15:21:06', NULL);
INSERT INTO `comments` VALUES (910, 125, 91, 'i***2', '酒店很棒 出差到深圳都住这里 就是携程太垃圾 大数据*熟 再也不用携程了 直接删除', NULL, 65, 0, 4, 4.6, 4.3, 4.7, 4.7, 4.5, '2022-07-01 08:34:30', NULL);
INSERT INTO `comments` VALUES (911, 125, 93, 'U***4', '反反复复来深圳都会住的酒店。前台tony经理的服务特别好特别耐心，安排了房间的升级，感觉十分的满意。', NULL, 65, 0, 4.3, 4.1, 4.1, 4.2, 4.7, 4.3, '2022-07-01 08:34:53', NULL);
INSERT INTO `comments` VALUES (912, 125, 149, 'B***1', '总体来说，环境还不错，周围很方便，但是酒店设施比较老化，前台服务比较差。酒店停车场直接上楼非常方便。打扫卫生的阿姨也很亲切。', NULL, 65, 0, 4.5, 4.3, 4.7, 4.4, 4.9, 4.6, '2022-05-11 16:17:01', NULL);
INSERT INTO `comments` VALUES (913, 125, 178, 'R***1', '服务太好了。早饭时的面包种类很多。很好吃。', NULL, 65, 0, 4, 4.5, 4.4, 4.7, 4.7, 4.5, '2022-05-19 18:05:07', NULL);
INSERT INTO `comments` VALUES (914, 125, 208, 'J***5', '吃吃喝喝很方便', NULL, 65, 0, 4.8, 4.9, 4.9, 4.6, 4.9, 4.8, '2022-04-27 21:14:31', NULL);
INSERT INTO `comments` VALUES (915, 125, 207, 'G***6', '环境服务都不错', NULL, 65, 0, 4.2, 4.7, 5, 4.2, 4.5, 4.5, '2023-01-31 10:02:41', NULL);
INSERT INTO `comments` VALUES (916, 125, 65, 'z***5', '这个酒店是我看，福田区最贵的酒店了，四季酒店我毫不犹豫定了，退房时候别的酒店第一时间押金就给我退回来，而且，我看他们酒店管理层后台法人居然是美国人，这个现在这情况更尴尬，我去别的酒店押金都给我推，唯独四季酒店现在迟迟不给我退，房费押金，我一个月二十天都在住我星酒店，这个情况，比较意外，我打了三次电话，给我催促说马上他却迟迟不退押金，一共两千块，我不知道为什么，这个酒店不建议大家入住比较危险，有可能让人身财产受到危险，卫生也不干净，实名举报这个酒店比较危险，可能是利用客户的资金流，加快自己的公司资金，周转，而且，公司可能有拖延退还押金奖励，因为这种情况，我在所有五星级酒店没见过，第一个，我是一个五星钻卡会员，我一个月二十天都在出差住五星级酒店，第二个，这种酒店说他们，是银行问题跟他们没关系，所以这个酒店很危险所有五星酒店能做到的事他们做不到就很危险，希望下次有人需要住这个酒店警惕性高一点这个酒店比较危险，不建议，人来入住', NULL, 65, 1, 4.3, 5, 4, 4.9, 4.8, 4.6, '2022-04-28 23:13:45', NULL);
INSERT INTO `comments` VALUES (917, 125, 155, 'x***9', '酒店的位置就在会展中心对面，周边商场林立，吃饭出行很方便，早餐很丰富，中西结合能够满足不同客户的需求。出差过来一种入住这家酒店。', NULL, 65, 0, 4.6, 4.7, 4.5, 4.6, 4.3, 4.5, '2022-10-09 14:32:20', NULL);
INSERT INTO `comments` VALUES (918, 125, 162, 'Y***4', '很棒的酒店很棒的服务。我通常住在深圳的另一家酒店，但我想这将是我以后的常客。', NULL, 65, 0, 4.4, 4.9, 4.9, 4.3, 4.4, 4.6, '2022-07-13 09:51:57', NULL);
INSERT INTO `comments` VALUES (919, 125, 114, 'q***6', '没什么可以挑剔的地方，各方面都保持高端酒店应有的水准，很好。感谢一下前台的VivianZhou，我说想安排尽量高点的楼层，后面房卡办好了她跟我解释说我订的房型都是较低的楼层，所以她给我免费升级了房型，太棒了！', NULL, 65, 1, 4.2, 4.9, 4.9, 4.5, 4.4, 4.6, '2022-09-28 08:43:37', NULL);
INSERT INTO `comments` VALUES (920, 126, 146, 'Q***4', '很干净很漂亮', NULL, 65, 1, 4.2, 4.2, 4.6, 4.2, 4.9, 4.4, '2023-11-28 20:20:24', NULL);
INSERT INTO `comments` VALUES (921, 126, 100, 'B***7', '一家很棒的酒店，提供一流的服务。也许是深圳最好的。', NULL, 65, 0, 4.8, 4.9, 4.1, 4.5, 5, 4.7, '2023-12-20 18:58:50', NULL);
INSERT INTO `comments` VALUES (922, 126, 187, 'u***2', '位于市中心区，方便，性价比非常高，管理不错，谢谢前台的贴心服务～尤其是Carlos和Vivan～点赞', NULL, 65, 0, 4.7, 4.7, 4.5, 5, 4.7, 4.7, '2023-10-08 22:05:09', NULL);
INSERT INTO `comments` VALUES (923, 126, 143, 'k***6', '出差选择，位置便利', NULL, 65, 1, 5, 4.6, 4.5, 4.1, 4.6, 4.6, '2022-08-08 16:29:08', NULL);
INSERT INTO `comments` VALUES (924, 126, 125, 'u***6', '非常差的酒店。是全球四季酒店里最差的。酒店领班半夜一点敲门登记身份证', NULL, 65, 0, 4.6, 4.3, 4.6, 4.5, 4.9, 4.6, '2022-11-15 17:48:47', NULL);
INSERT INTO `comments` VALUES (925, 127, 60, '匿名用户', '前台接待的姐姐服务很好，免费升级房间。', NULL, 65, 0, 4.9, 4.2, 4.3, 4.3, 4.4, 4.4, '2024-04-14 07:39:02', NULL);
INSERT INTO `comments` VALUES (926, 127, 112, 'l***7', '隔音效果不好，楼上一直有咚咚咚的声响，走廊经常有小孩跑动，偶尔能听到街上车鸣笛的声音。', NULL, 65, 0, 4.3, 4.9, 4.7, 4.4, 4, 4.5, '2024-04-13 15:04:04', NULL);
INSERT INTO `comments` VALUES (927, 127, 225, 'P***5', '深圳四季酒店在会展中心对面，周边有丽思卡尔顿和柏悦酒店，位置很赞。房间很大，设置很棒。但早餐很一般。', NULL, 65, 0, 4.7, 5, 4.1, 4.6, 4.3, 4.5, '2024-04-13 19:29:26', NULL);
INSERT INTO `comments` VALUES (928, 127, 134, 'K***4', '无敌棒 给我免费升级了房型 爱了', NULL, 65, 0, 4.1, 4.5, 4.9, 4.7, 4.5, 4.5, '2024-04-20 16:32:56', NULL);
INSERT INTO `comments` VALUES (929, 127, 184, 'e***8', '真没想到四季现在这么差，浴室百叶窗不是全遮挡外面都能看到，浴室里所有插座都不能用，五星级酒店居然没有熨烫机，花洒也是堵的乱七八糟的，就催退房挺快的', NULL, 65, 0, 4.9, 4.5, 4.1, 4.7, 4.9, 4.6, '2024-04-16 15:05:17', NULL);
INSERT INTO `comments` VALUES (930, 127, 208, 'j***5', '总体来说还是不错滴', NULL, 65, 0, 4.4, 4.1, 4.2, 4.3, 4.4, 4.3, '2024-03-14 14:40:17', NULL);
INSERT INTO `comments` VALUES (931, 127, 83, 'y***8', '在广州四季的体验非常好，所以这次来深圳 决定选择四季，果然保持了一贯的品质。房间很大，浴室也很大，干湿分离，浴缸靠着窗户，马桶是智能电动的。两个洗手池不用打架。衣帽间可以把行李放进去。装修风格很现代人性化。下次来还会选择。', NULL, 65, 0, 4.5, 4.6, 4.4, 4.3, 4.4, 4.4, '2024-02-21 15:32:09', NULL);
INSERT INTO `comments` VALUES (932, 127, 65, 'Z***5', '酒店出了拥有一个四季的冠名外真的没什么优势了。办理完入住前台连一个引导电梯方向的服务人员都没有，办理入住的服务员一个劲的介绍酒店区域划分连最基本的房卡激活都没做。进不了门后来找前台激活他居然问我要信心再次核对身份！！！这是四季的水平吗？牙刷居然还是使用和快捷酒店的那种廉价牙刷。在大堂租的充电宝过了24点后不能还，被告知次日六点还我也是匪夷所思啊。房间里的桌椅板凳都有老化的现象。百叶帘在无人操作的情况下会**的自动升降换以前早就投诉到星评委员会摘星了。', NULL, 65, 0, 4.5, 5, 4.3, 4.2, 4.5, 4.5, '2024-02-06 10:57:59', NULL);
INSERT INTO `comments` VALUES (933, 127, 103, 'w***6', '不错，。zzzzzzzzzzzzzzzzzzzzzzzzzzzzzzzzzzzzzzzzzzzzzzz', NULL, 65, 0, 4.4, 4.7, 4.5, 4.2, 4, 4.4, '2024-01-23 16:14:37', NULL);
INSERT INTO `comments` VALUES (934, 127, 121, 'd***5', '早上吃饭过来推销办卡，明目张胆的目中无人，', NULL, 65, 0, 4.5, 4.2, 5, 4.3, 4.7, 4.5, '2023-12-05 14:19:36', NULL);
INSERT INTO `comments` VALUES (935, 127, 186, 'm***2', '停车方便，电梯有点慢，房间稍旧。', NULL, 65, 0, 4.2, 4.8, 4.7, 4.3, 4.6, 4.5, '2024-02-10 22:10:28', NULL);
INSERT INTO `comments` VALUES (936, 127, 166, 'Z***7', '四季酒店无论是硬件还是服务，绝对是很完美了。早餐非常棒，服务也注重细节，酒店工作人员很礼貌。个人最喜欢的是酒店的健身设备，健身器材都是顶级品牌。房间升级房型后非常舒适。', NULL, 65, 0, 4.1, 4.9, 4.2, 4.7, 4.6, 4.5, '2023-10-22 13:15:44', NULL);
INSERT INTO `comments` VALUES (937, 127, 61, 'A***0', '入住体验非常棒！感谢叶丹Yvonne的房间升级和帮忙安排酒店的早餐，行程完美。', NULL, 65, 0, 4.9, 4.1, 4.9, 4.3, 4.5, 4.5, '2023-09-30 03:19:53', NULL);
INSERT INTO `comments` VALUES (938, 127, 125, 'U***6', '位置环境服务都很OK', NULL, 65, 1, 4.6, 4.2, 4, 4.6, 4.2, 4.3, '2023-07-04 14:49:55', NULL);
INSERT INTO `comments` VALUES (939, 127, 124, 'V***9', '四季从来不会让你失望', NULL, 65, 1, 4.6, 4.7, 4.1, 4.6, 4.9, 4.6, '2023-07-04 14:47:54', NULL);
INSERT INTO `comments` VALUES (940, 127, 184, 'e***8', '非常好   服务好   酒店干净', NULL, 65, 1, 4.9, 4.9, 4.6, 4.4, 4.6, 4.7, '2023-02-25 22:46:19', NULL);
INSERT INTO `comments` VALUES (941, 127, 99, 'Q***8', '感谢叶丹小姐姐，服务态度好，满足顾客需求，好评好评好评好评好评好评！！', NULL, 65, 1, 4.8, 4.6, 4, 4.2, 4.8, 4.5, '2023-05-24 14:25:06', NULL);
INSERT INTO `comments` VALUES (942, 127, 160, 'A***2', '早餐不错，出去吃饭也方便', NULL, 65, 1, 4.8, 4.8, 4, 4.9, 4.7, 4.6, '2022-06-30 21:45:06', NULL);
INSERT INTO `comments` VALUES (943, 127, 207, 'G***6', '作为所谓的五星级酒店，服务真的是差到可以的，前台办理入住的服务员一直摆出一副爱住不住的态度，和丽思的服务比起来，简直就是十万八千里～房间潮潮的，这都没啥，毕竟这个季节深圳的很多酒店都这样，每个月都去两三次深圳，四季酒店永远是入住体验最差的，住了三次，被气了两次！！！下次绝对不会再住四季！任何一个城市的四季都不会再住！', NULL, 65, 1, 4.9, 5, 4.5, 4.8, 4, 4.6, '2022-01-20 19:59:10', NULL);
INSERT INTO `comments` VALUES (944, 127, 79, 'G***4', '很难比第 4 季做得更好。这家酒店真的很照顾我，房间里有一个“哇”的因素。我喜欢员工以及他们对工作的热情。位置非常适合商务，设施也很棒。你不会失望的。我对这个属性做了一个视频评论，你可以在这里观看。 https://youtu.be/aajdlE0myag', NULL, 65, 0, 4.1, 4.6, 4.3, 4.9, 4.8, 4.5, '2023-05-22 16:22:57', NULL);
INSERT INTO `comments` VALUES (945, 128, 138, 'T***3', '每次来深圳出差都会入住的四季酒店，早餐丰富，服务热情周到，确实是五星级酒店的标准。。。。。。。。。。', NULL, 65, 0, 4.2, 5, 4.8, 4.7, 4.9, 4.7, '2023-08-20 09:57:35', NULL);
INSERT INTO `comments` VALUES (946, 128, 72, 'R***7', '去过很多次了 服务好', NULL, 65, 0, 4.4, 4.7, 4.9, 4.3, 4.1, 4.5, '2023-08-29 12:14:25', NULL);
INSERT INTO `comments` VALUES (947, 128, 182, 'r***9', '非常不错，下次还会入住。', NULL, 65, 1, 4, 4.3, 4.3, 4.9, 4.8, 4.5, '2023-05-10 15:25:28', NULL);
INSERT INTO `comments` VALUES (948, 128, 176, '1***9', '参观车展过来住的，服务很好，设施虽然有些陈旧，但是相比隔壁的丽思维护的更好，尤其丽思的遥控器真得太破了，四季一个房间三个遥控器，都很新，就是丽思的电视可以投屏，四季只能连线投屏，不投屏电视实在没啥能看的东西。', NULL, 65, 1, 4.1, 4.9, 4.1, 4.4, 4.4, 4.4, '2022-09-12 15:21:06', NULL);
INSERT INTO `comments` VALUES (949, 128, 91, 'i***2', '很满意，每次来深圳都要住这里，性比价很高地理位置好', NULL, 65, 0, 4.9, 4.4, 4.1, 4.6, 4.7, 4.5, '2022-07-01 08:34:30', NULL);
INSERT INTO `comments` VALUES (950, 128, 93, 'U***4', '平常我都是不做酒店的点评，因为每次都会有不愉快的事情。但是这次第一次入住深圳四季酒店，体验感非常好。虽然设施设备没有那么新了，但是并不影响四季的服务标准。在我们仅仅提前一天的情况下，还是很用心的做了房间布置，并且晚上开夜床的时候送了欢迎水果，气泡酒和小蛋糕。非常感动，下次还会选择四季酒店的。', NULL, 65, 0, 4.6, 4.5, 4.3, 4.6, 4.4, 4.5, '2022-07-01 08:34:53', NULL);
INSERT INTO `comments` VALUES (951, 128, 149, 'B***1', '各方面都挺好的', NULL, 65, 0, 4.9, 4, 4.4, 4.1, 4.5, 4.4, '2022-05-11 16:17:01', NULL);
INSERT INTO `comments` VALUES (952, 128, 178, 'R***1', '老牌酒店，装修规规矩矩，有点旧了。胜在交通便利，周边吃东西逛逛都很方便。房间小了点，可以考虑重新装修了', NULL, 65, 0, 4.7, 4.5, 4.9, 5, 4.8, 4.8, '2022-05-19 18:05:07', NULL);
INSERT INTO `comments` VALUES (953, 128, 208, 'J***5', '酒店环境相当安静', NULL, 65, 0, 4.1, 4, 4.3, 4.3, 4.6, 4.3, '2022-04-27 21:14:31', NULL);
INSERT INTO `comments` VALUES (954, 128, 207, 'G***6', '很好很喜欢的一家酒店。每次来都定这家酒店，服务很好很贴心准备的东西也很到位个人很喜欢。希望下次床上的被子还可以更贴合季节。', NULL, 65, 0, 4.8, 4.1, 4.5, 4.5, 4.7, 4.5, '2023-01-31 10:02:41', NULL);
INSERT INTO `comments` VALUES (955, 128, 65, 'z***5', '四季酒店是深圳住过的最好酒店，交通方便，设施豪华舒适，早餐丰富可口。前台Tony和Rachae两位帅哥靓妹服务周到，主动热情，给人宾至如归的感觉。以后来深圳锁定四季酒店入住。', NULL, 65, 1, 4.9, 4.9, 4.5, 4.2, 4.9, 4.7, '2022-04-28 23:13:45', NULL);
INSERT INTO `comments` VALUES (956, 128, 155, 'x***9', '交通非常便利，酒店档次高，但费用合理，环境优美、房间布置合理舒适，卫生间干净整洁，服务态度很好，非常适合商务和家庭入住。', NULL, 65, 0, 4.6, 4.4, 4.5, 4, 4.9, 4.5, '2022-10-09 14:32:20', NULL);
INSERT INTO `comments` VALUES (957, 128, 162, 'Y***4', '入住体验很棒，礼宾孙经理帮助解决问题，服务很周到', NULL, 65, 0, 4, 4.1, 5, 4.5, 4.3, 4.4, '2022-07-13 09:51:57', NULL);
INSERT INTO `comments` VALUES (958, 128, 114, 'q***6', '会再来的。', NULL, 65, 1, 4.6, 4.7, 4.2, 4.8, 4.9, 4.6, '2022-09-28 08:43:37', NULL);
INSERT INTO `comments` VALUES (959, 129, 83, 'Y***8', '房间很大，性价比高，只是早餐做的不是很好，用餐的地方也很挤，下次试试行政楼层怎么样。', NULL, 29, 0, 4.3, 4.8, 4.3, 4.9, 4.7, 4.6, '2024-02-28 10:43:01', NULL);
INSERT INTO `comments` VALUES (960, 130, 149, 'b***1', '本次入住体验没有上次好。1、第一次给的房间说是无烟房，但房间里有香烟（应该是上一个客人遗漏，但清洁员未发现，在床头旁边）。酒店态度很好，立马说给换一个更大一点的房间，让我等，会有人推着礼宾车带着新房卡来接我，但这一等就是接近1个小时，期间我还打了好几个电话催促；2）换了一个房间，面积是大了不少，但电话是坏的，找人来修，也没修好，最后还是我发现客厅里的电话开免提可以用（其他都不可用），想想大晚上的就算了，凑活着用吧；3）泳池、健身房挺好，孩子们玩的挺开心，就是冲浪池的温度太高，基本下不了脚，说是硬性规定，必须得这么高；4）预定的房型含有两份早餐，开始时没有核实清楚；5）其他方面还差强人意吧，服务人员彬彬有礼，酒店毕竟10年有余了，个别地方是有点先老旧。总体来说，尚可。', NULL, 66, 0, 4.9, 4.7, 4.6, 4.1, 4.3, 4.5, '2024-04-14 23:21:06', NULL);
INSERT INTO `comments` VALUES (961, 130, 185, 'd***9', '位置非常好，设施完善先进，服务周到。作为世界顶级豪华品牌之一的四季酒店还是名副其实的，有机会的话还要体验一下其他家四季酒店', NULL, 66, 0, 4.8, 4.6, 4.7, 4.1, 4.3, 4.5, '2024-04-21 15:50:05', NULL);
INSERT INTO `comments` VALUES (962, 130, 92, 'l***9', '我是过敏体质 住了三晚 脸上过敏明显眼睛肿起来，他们的被单是两面夹层那种，就是两张被单折叠套住，不是一个被套。睡觉拉被子很容易碰到被芯而且住三天没换过被单就是说来整理床铺的时候被芯床单一定有接触被芯肯定不是一客一换的 所以很脏', NULL, 66, 1, 4.5, 4.9, 4.7, 4.4, 4.2, 4.5, '2024-02-12 22:43:48', NULL);
INSERT INTO `comments` VALUES (963, 130, 190, 'b***3', '不错的……', NULL, 66, 0, 4.9, 4.6, 4.1, 4.2, 4.1, 4.4, '2024-03-19 05:30:12', NULL);
INSERT INTO `comments` VALUES (964, 130, 110, 'i***4', '每次去深圳都是住四季。服务号 干净～', NULL, 66, 0, 4.4, 4.8, 4.8, 4.8, 4.9, 4.7, '2024-02-11 21:00:55', NULL);
INSERT INTO `comments` VALUES (965, 130, 145, 'O***2', '因为想18岁生日过的有仪式感一点，所以特意定了一晚四季酒店过生日，没想到真的太惊喜啦！！', NULL, 66, 0, 4.2, 4.5, 4.7, 4.7, 4.7, 4.6, '2024-02-11 18:24:16', NULL);
INSERT INTO `comments` VALUES (966, 130, 60, '匿名用户', '第一次订这么高端的酒店，非常好，携程钻石会员便宜了不少，我这个酒店可能便宜了200多吧，环境不错符合五星级酒店', NULL, 66, 0, 4.2, 4.5, 4.7, 4.2, 4.7, 4.5, '2023-10-05 06:03:14', NULL);
INSERT INTO `comments` VALUES (967, 130, 191, 't***5', '很棒好棒好棒', NULL, 66, 0, 4, 4.2, 4.2, 4.3, 4.6, 4.3, '2018-10-27 20:59:41', NULL);
INSERT INTO `comments` VALUES (968, 130, 87, 'f***5', '舒适出行方便', NULL, 66, 0, 4.4, 4.8, 5, 4.8, 4.5, 4.7, '2018-02-17 09:08:10', NULL);
INSERT INTO `comments` VALUES (969, 130, 132, 'k***0', '四季 一如既往的喜欢的品牌 这里的行政待遇甚至比丽思卡尔顿还要好 得益于房间内设施问题 直接被升级到了豪华套房', NULL, 66, 0, 5, 4.6, 4.4, 4.9, 4.6, 4.7, '2018-04-30 14:59:19', NULL);
INSERT INTO `comments` VALUES (970, 131, 60, '匿名用户', '交通：便利', NULL, 52, 0, 4.4, 4.2, 4, 4.3, 4.7, 4.3, '2024-03-16 11:14:53', NULL);
INSERT INTO `comments` VALUES (971, 131, 130, '3***0', '四季从来不会让人失望！', NULL, 52, 0, 4.3, 4.6, 4.9, 4.5, 4.9, 4.6, '2024-02-03 10:00:40', NULL);
INSERT INTO `comments` VALUES (972, 131, 60, '匿名用户', '客服态度很友好我定的是豪华大床房他帮我升级到了尊享大床房酒店的房间是我住过里面最好的了，相比丽思卡尔顿赢在了酒店设施', NULL, 52, 0, 4, 4.4, 4.8, 4.8, 4.7, 4.5, '2024-02-05 10:58:21', NULL);
INSERT INTO `comments` VALUES (973, 131, 60, '匿名用户', '还不错哦这酒店', NULL, 52, 0, 4.9, 4.9, 4.9, 4, 4.4, 4.6, '2023-12-25 11:21:18', NULL);
INSERT INTO `comments` VALUES (974, 131, 60, '匿名用户', '前台服务态度一般！', NULL, 52, 0, 4.1, 4.1, 4.8, 4.7, 4.2, 4.4, '2023-07-06 11:59:31', NULL);
INSERT INTO `comments` VALUES (975, 131, 168, 's***8', '感谢四季酒店服务。早餐特别各种各样早餐尤其早餐蛋糕各种类型特别好吃，Jason Li先生很热情服务，床特别舒服，个人特别喜欢四季洒店', NULL, 52, 0, 4.2, 4.5, 4.7, 4.4, 4.8, 4.5, '2023-06-29 11:47:04', NULL);
INSERT INTO `comments` VALUES (976, 131, 204, '1***2', '服务人员很有责任心特别要谢谢我对接的工作人员叶丹女士，非常敬业。', NULL, 52, 0, 4.1, 4.4, 4.4, 4.3, 4.7, 4.4, '2023-05-01 12:17:47', NULL);
INSERT INTO `comments` VALUES (977, 131, 189, '2***3', '床很舒服', NULL, 52, 0, 4.7, 4, 4.4, 4.9, 4.4, 4.5, '2023-02-05 10:07:57', NULL);
INSERT INTO `comments` VALUES (978, 131, 227, '2***9', '深圳四季酒店确实不错 环境包括酒店的房间风格还有重点表扬一下酒店的床非常的舒服 累一天了可以休息休息简直太舒服了  另外说一下酒店前台的Marmara非常细心我住过这么多酒店他是一个非常非常负责并且靠谱的宾客 有这种人在酒店还能有投诉吗都是好评了', NULL, 52, 0, 4.7, 4.8, 4.5, 4.8, 4.8, 4.7, '2022-06-15 15:30:00', NULL);
INSERT INTO `comments` VALUES (979, 132, 195, 'C***7', '特别是酒店前台杨经理，服务细心周到，详细讲解了酒店防疫措施，觉得非常好。', NULL, 52, 1, 4.4, 4.4, 4.1, 4.5, 4.8, 4.4, '2024-04-19 23:05:04', NULL);
INSERT INTO `comments` VALUES (980, 132, 60, '匿名用户', '前厅部的Tony Carlos Susan服务非常周到，住这的两天非常舒服！点赞！', NULL, 52, 0, 4.9, 4.6, 4, 4.5, 4.2, 4.4, '2024-03-31 11:51:33', NULL);
INSERT INTO `comments` VALUES (981, 132, 60, '匿名用户', 'Tony wang 服务挺好', NULL, 52, 0, 4.2, 4.6, 4.8, 4.4, 4.9, 4.6, '2024-03-02 16:27:09', NULL);
INSERT INTO `comments` VALUES (982, 132, 60, '匿名用户', '服务不错 免费升级了房间', NULL, 52, 0, 4.9, 4.7, 4.5, 4.3, 4.9, 4.7, '2024-01-17 07:32:30', NULL);
INSERT INTO `comments` VALUES (983, 132, 196, 'E***3', '16年結婚在四季，今年生日也決定回來四季庆祝。四季服务还是一样的好，免费升级了房间还送了小蛋糕。遇到的服务员每一个都是笑盈盈。早餐也好吃。可以延迟退房真的是让睡懒觉的人身心愉悦呀～门口行李生小刘也很热情哦。总之 开心', NULL, 52, 0, 4.3, 4.8, 4.8, 4.1, 4.6, 4.5, '2024-01-01 11:21:30', NULL);
INSERT INTO `comments` VALUES (984, 132, 197, '1***3', '地毯有霉味，别的都很好，马桶，景观，游泳池，空中花园，电视，等都很棒', NULL, 52, 0, 4.7, 4, 4.3, 4.4, 4.9, 4.5, '2023-11-28 14:51:25', NULL);
INSERT INTO `comments` VALUES (985, 132, 177, 'A***8', '礼宾态度差，整个酒店的工作人员让人感觉没有什么热情，基本都是敷衍了事。总而言之，中规中矩，但是在以四季的标准来说、“中规中矩”就是已经很无话可说了。深圳四季与广州四季比起来，简直就是没有可比性，属于一个伪四季酒店，基本算是四季酒店中的“皇协军”，四季自身推行的服务都根本不知道、缺乏培训和理念意识（如四季酒店都提供代客泊车，并且四季官方APP也显示可以，但是礼宾说根本不知道这回事，说的义正严辞）深圳四季的礼宾主管基本都是以领导对下属的语气对客人说话，用他自认为的方式怼的客人说不出话来，必须Follow 他的指示和他的想法办事。', NULL, 52, 0, 4.6, 4.6, 4.9, 4.6, 4.2, 4.6, '2023-09-29 09:49:09', NULL);
INSERT INTO `comments` VALUES (986, 132, 60, '匿名用户', '感谢前台主动周到的服务～Cecilia，Vivan，Carlos还有一些不知道名字但熟悉的面孔～谢谢你们', NULL, 52, 1, 5, 4.9, 4.3, 4.1, 4.6, 4.6, '2023-09-07 20:56:56', NULL);
INSERT INTO `comments` VALUES (987, 132, 198, '3***8', '酒店歧视途径过广州的旅客 并且大堂经理包庇怠工 服务差到了极致 是住过五星级酒店最差的一个', NULL, 52, 0, 4.8, 4.7, 4.1, 4.9, 4.3, 4.6, '2023-07-30 12:03:15', NULL);
INSERT INTO `comments` VALUES (988, 132, 199, 'A***3', '早餐很棒，用品补充充足。一如既往的最爱之一。', NULL, 52, 0, 4.5, 4.6, 4.4, 4.2, 4.4, 4.4, '2023-06-04 09:46:05', NULL);
INSERT INTO `comments` VALUES (989, 132, 183, '2***5', '良好的服务，优越的地理位置', NULL, 52, 0, 5, 4.4, 4.3, 4.2, 4.6, 4.5, '2023-03-24 11:34:24', NULL);
INSERT INTO `comments` VALUES (990, 132, 200, 'BUpA1376', '没有去吃早餐.房间可以', NULL, 52, 0, 4.1, 4.6, 4.2, 4.8, 4.3, 4.4, '2022-11-06 13:42:05', NULL);
INSERT INTO `comments` VALUES (991, 132, 119, 'X***7', '老五星 品质还是在的 深圳嘛停车总会不是那么方便，四季还算好的 房间格局很好，离逛街的地方都很近 还算方便', NULL, 52, 0, 4.4, 4, 5, 4.3, 4.7, 4.5, '2023-05-03 18:20:34', NULL);
INSERT INTO `comments` VALUES (992, 132, 201, '2***7', '还不错挺好的', NULL, 52, 0, 4.3, 4.7, 4.7, 4.8, 4.1, 4.5, '2023-03-19 11:39:06', NULL);
INSERT INTO `comments` VALUES (993, 132, 202, '2***1', '我住过最差的一家四季酒店，和其他四季酒店比根本不是一个等级的', NULL, 52, 0, 4.3, 4.3, 4.7, 4.6, 4.8, 4.5, '2022-08-13 12:01:33', NULL);
INSERT INTO `comments` VALUES (994, 132, 203, '2***0', '四季酒店宾至如归的服务，为我闺蜜的生日精心做了房间布置，感谢贵店客房部前厅部礼宾部各个部门的同仁，也非常感谢携程客户部的亲切问候，以及特别从上海快递到深圳的生日礼物', NULL, 52, 1, 4.4, 4.4, 4.8, 4.4, 4.6, 4.5, '2022-08-05 14:36:45', NULL);
INSERT INTO `comments` VALUES (995, 132, 201, '2***7', '高空即视感。', NULL, 52, 0, 4.1, 5, 4.6, 4.7, 4.2, 4.5, '2023-03-08 01:10:01', NULL);
INSERT INTO `comments` VALUES (996, 132, 204, '1***2', '房间设施人性化，舒适', NULL, 52, 0, 4.6, 4.6, 4.3, 4.1, 4, 4.3, '2022-08-04 16:53:14', NULL);
INSERT INTO `comments` VALUES (997, 132, 205, '2***8', '酒店开始给的房间有味道，换了一个就好了', NULL, 52, 1, 4.7, 4.2, 4.5, 4.2, 4, 4.3, '2022-08-04 11:58:47', NULL);
INSERT INTO `comments` VALUES (998, 132, 189, '2***3', '服务就是细致到位呀！四季，不用怀疑', NULL, 52, 0, 4, 4.7, 4.9, 4.9, 4.9, 4.7, '2022-08-13 12:06:44', NULL);
INSERT INTO `comments` VALUES (999, 133, 60, '匿名用户', '帮领导预订，各方面还是很不错的', NULL, 52, 0, 4.5, 4, 4, 4, 4.3, 4.2, '2024-02-15 09:38:30', NULL);
INSERT INTO `comments` VALUES (1000, 133, 221, '3***7', '第一次住这 交通非常便利 入住的体验感很不错 下次还会来这里 酒店环境和前台服务都很好哦 推荐推荐～', NULL, 52, 0, 4, 4.8, 4.3, 4.4, 4.8, 4.5, '2024-01-27 09:13:00', NULL);
INSERT INTO `comments` VALUES (1001, 133, 128, 'Y***2', '床非常舒适', NULL, 52, 0, 4.1, 4.9, 4.4, 4.4, 4.3, 4.4, '2023-10-28 16:26:40', NULL);
INSERT INTO `comments` VALUES (1002, 133, 60, '匿名用户', '可以可以 服务很好', NULL, 52, 0, 4.9, 4.3, 5, 4.5, 4, 4.5, '2023-10-15 13:16:05', NULL);
INSERT INTO `comments` VALUES (1003, 133, 228, '3***3', '头一天升级房型，是因为没有房间了。第二天也是升级，他们这是有什么房给什么房。连续住了三四天了明天就走了，说让我下单下贵的房间，开始我让你升级了吗？你没那个房型就给升级，你升级也得看我愿不愿了。', NULL, 52, 0, 4.7, 4.4, 5, 5, 4.5, 4.7, '2023-10-05 11:22:12', NULL);
INSERT INTO `comments` VALUES (1004, 133, 179, '3***4', '总体比较满意', NULL, 52, 0, 4.6, 4.2, 4.3, 4.2, 4.3, 4.3, '2023-10-06 11:59:10', NULL);
INSERT INTO `comments` VALUES (1005, 133, 189, '2***3', '酒店的客服与四季酒店的等级极不相符，卫生拖延到次日下午4：00还未打扫，打电话要电熨斗催了三次到30分钟后才送上来居然还是个坏的，真是无语了。', NULL, 52, 0, 4.6, 4.4, 4.5, 4.7, 4.8, 4.6, '2023-08-31 10:38:51', NULL);
INSERT INTO `comments` VALUES (1006, 133, 60, '匿名用户', '四季酒店地理位置特别好，去哪里都很方便，酒店设施很齐全，服务也很到位，虽然酒店时间有些长但是入住体验很好。', NULL, 52, 0, 4.4, 4.7, 4.5, 4.8, 4.2, 4.5, '2023-08-07 10:27:55', NULL);
INSERT INTO `comments` VALUES (1007, 133, 189, '2***3', '没有住过四季酒店，抱着挺高的期望定的。说实话，真是与传闻中的名气不匹配。中规中矩，设施普普通通，完全让人感受不到四季的品牌价值所在，也很难感受到四季与其他五星级酒店有什么不同。以后应该不会因为四季这个品牌而特意定四季酒店了。', NULL, 52, 0, 4.4, 4.7, 4.1, 4.3, 4.1, 4.3, '2023-08-16 23:53:51', NULL);
INSERT INTO `comments` VALUES (1008, 133, 215, '2***2', '亲子出游，对面就是会展中心，地理位置优越，附近逛街吃饭都方便，酒店早餐品种多而且精致，用餐环境也很不错，不会吵闹。', NULL, 52, 0, 4.4, 4, 4.9, 4.5, 4.1, 4.4, '2022-06-13 12:54:33', NULL);
INSERT INTO `comments` VALUES (1009, 133, 90, 'k***8', '位置很好，房间设施很旧，电话打给前台杂音极大，反馈修好了，其实并没有。安全码提示仅出示勿截图发送，前台依然要拍照，询问原因，问了三遍，前台假装没听见。', NULL, 52, 0, 4.8, 4.8, 5, 5, 4.9, 4.9, '2023-02-08 18:25:04', NULL);
INSERT INTO `comments` VALUES (1010, 133, 229, '5***3', '很好环境不错！', NULL, 52, 0, 4.4, 4.5, 4.4, 4.2, 4.7, 4.4, '2022-07-25 13:32:32', NULL);
INSERT INTO `comments` VALUES (1011, 133, 216, '6***2', '酒店位置不错，就是房间里的沙发臭臭的，地毯上也有灰尘。大堂的桌椅摆设奇怪，起身没注意，撞到水池，跌倒，手扭伤了，虽然不严重，但是还是造成不便。', NULL, 52, 0, 4.9, 4, 4.2, 4.2, 4.6, 4.4, '2022-07-23 11:23:02', NULL);
INSERT INTO `comments` VALUES (1012, 133, 145, 'O***2', '大致不差，比广州差了', NULL, 52, 0, 4.2, 4.7, 4.7, 4.8, 4.1, 4.5, '2023-02-25 17:14:01', NULL);
INSERT INTO `comments` VALUES (1013, 133, 189, '2***3', '环境很好，住着很舒适', NULL, 52, 0, 4.9, 4, 4.8, 4.9, 4.6, 4.6, '2023-02-17 09:46:24', NULL);
INSERT INTO `comments` VALUES (1014, 133, 230, '1***6', '房间非常大，套房一百多平，', NULL, 52, 0, 4.5, 4.5, 4.1, 4, 4.2, 4.3, '2022-05-27 20:49:22', NULL);
INSERT INTO `comments` VALUES (1015, 133, 201, '2***7', '适合度假旅游', NULL, 52, 0, 4.9, 4.6, 4.9, 4.2, 4.1, 4.5, '2022-07-19 14:43:57', NULL);
INSERT INTO `comments` VALUES (1016, 133, 204, '1***2', '这个四季太老啦。', NULL, 52, 0, 4.2, 5, 4.3, 4.8, 4.9, 4.6, '2023-03-11 11:28:14', NULL);
INSERT INTO `comments` VALUES (1017, 133, 183, '2***5', '第一天入住，洗手间，卧室地毯，水壶脏的一塌糊涂。飞机晚点半夜三点到的，我要求换一下水壶，半个小时之后才送过来！！！第二天我去前台投诉了，回来比之前干净了，床单一直都是破的这是我住过最差的四季了。', NULL, 52, 0, 4.4, 4.5, 4.8, 4.4, 4.5, 4.5, '2022-09-24 09:22:37', NULL);
INSERT INTO `comments` VALUES (1018, 133, 215, '2***2', '环境不错，地理位置优越，酒店工作人员服务态度良好。', NULL, 52, 0, 4.1, 4.7, 4.6, 4.5, 4.9, 4.6, '2022-08-08 16:40:01', NULL);
INSERT INTO `comments` VALUES (1019, 134, 105, 'h***7', '服务态度不好，也不能延迟退房，房间灯光设计奇怪，无法將灯光关闭，蓝色指示灯刺眼，影响睡眠，隔音不好', NULL, 67, 0, 4.6, 4.8, 4.7, 4.1, 4.8, 4.6, '2023-12-22 14:36:22', NULL);
INSERT INTO `comments` VALUES (1020, 134, 156, 'I***8', '服务生态度很好', NULL, 67, 0, 4.3, 4.5, 4, 4.2, 4.5, 4.3, '2023-09-06 16:24:36', NULL);
INSERT INTO `comments` VALUES (1021, 134, 61, 'a***0', '一个五星级酒店还打了“四个钻石”的国际酒店，大堂连一个接待游客“服务员”都没，订房的客户，个个不自觉排队，是要酒店“服务员”引导的，这些所谓“高级酒店前台”好似坐地铁抢位的感觉，真令到人进到一间“低级的连锁酒店”一样，不顾一切形象，这样的酒店谁还会二次“入住”呢？还有明明我的订单有携程订单是“闪付”快速入住免压金的同要求前台要高楼层，前台服务不耐烦给我一间15楼，这样的服务态度我感觉不到是一家“五星级酒店”的作风，还有明明我选择“携程”是两份早餐，酒店人员吃完一半，还问我是只有一份早餐，难道系统没有同携程连网告知？再要同客人再通知一声，你们的早餐只有一份，如果是两份，就不用再“加钱”？这也太落伍了吧！真的令人失望！', NULL, 67, 0, 4, 4.2, 4.4, 4.1, 4.8, 4.3, '2021-06-15 19:17:36', NULL);
INSERT INTO `comments` VALUES (1022, 135, 207, 'G***6', '还可以 但我更推荐anyear', NULL, 67, 1, 4.6, 4.3, 4.7, 4.7, 5, 4.7, '2024-02-14 14:40:55', NULL);
INSERT INTO `comments` VALUES (1023, 135, 83, 'y***8', '房间设施很新，设计风格很喜欢，对于商务出差的我，回到酒店能很舒服的休息继续努力工作。特别推荐大家去体验。', NULL, 67, 0, 4.3, 4.6, 4.8, 4.6, 4.7, 4.6, '2024-03-19 14:05:58', NULL);
INSERT INTO `comments` VALUES (1024, 135, 139, 'Z***3', '酒店服务意识一般', NULL, 67, 0, 4.8, 4.4, 4.9, 4.7, 4.7, 4.7, '2024-03-19 14:06:17', NULL);
INSERT INTO `comments` VALUES (1025, 135, 177, 'A***8', '早餐丰盛，周边饮食方便。', NULL, 67, 0, 4.2, 4.6, 4.6, 4, 4.5, 4.4, '2024-02-15 21:10:10', NULL);
INSERT INTO `comments` VALUES (1026, 135, 171, 'X***1', '朋友说不错', NULL, 67, 0, 4.4, 4.2, 4.8, 4.8, 4.8, 4.6, '2024-02-06 18:56:03', NULL);
INSERT INTO `comments` VALUES (1027, 135, 89, 'f***9', '早餐非常不错', NULL, 67, 0, 4.8, 4.6, 4.3, 4.3, 4.2, 4.4, '2024-03-19 14:06:28', NULL);
INSERT INTO `comments` VALUES (1028, 135, 124, 'v***9', '舒适干净卫生', NULL, 67, 0, 4.7, 4.7, 4.5, 4.4, 4.4, 4.5, '2023-12-21 08:30:30', NULL);
INSERT INTO `comments` VALUES (1029, 135, 190, 'b***3', '深圳最豪华区域', NULL, 67, 0, 4.4, 4.1, 4.4, 4.8, 4.2, 4.4, '2023-10-27 15:16:05', NULL);
INSERT INTO `comments` VALUES (1030, 135, 203, '2***0', '非常好的一次体验。经理joyce非常热情，礼宾部的员工服务非常到位。', NULL, 67, 0, 4.9, 4.7, 4.8, 4.6, 4.7, 4.7, '2023-11-09 19:53:09', NULL);
INSERT INTO `comments` VALUES (1031, 135, 149, 'b***1', '环境很好 有一股香味', NULL, 67, 1, 4, 4.7, 4.7, 4.8, 5, 4.6, '2022-02-05 19:53:34', NULL);
INSERT INTO `comments` VALUES (1032, 136, 93, 'u***4', '早餐丰富，离福田站很近', NULL, 67, 1, 4.8, 4, 4.1, 4.8, 4.3, 4.4, '2021-12-22 15:21:57', NULL);
INSERT INTO `comments` VALUES (1033, 137, 131, 'p***1', '很一般，不像五星级', NULL, 67, 0, 4.6, 4, 4.8, 4.4, 4.7, 4.5, '2024-03-19 20:53:58', NULL);
INSERT INTO `comments` VALUES (1034, 137, 142, 'n***1', '客房打扫不太及时', NULL, 67, 0, 4.9, 4.9, 4.1, 4.6, 4.6, 4.6, '2024-01-30 20:25:21', NULL);
INSERT INTO `comments` VALUES (1035, 137, 169, 'M***4', '很精致，很有仪式感。', NULL, 67, 0, 4, 4.9, 5, 4.5, 4.9, 4.7, '2024-01-23 10:38:22', NULL);
INSERT INTO `comments` VALUES (1036, 137, 132, 'k***0', '酒店的设施一流，环境很好，尤其是以叶丹为代表的各岗位服务人员的服务既服务到位又能急客户之所急，非常满意！', NULL, 67, 0, 4.4, 4.3, 4.1, 4.2, 4.8, 4.4, '2024-01-25 11:40:13', NULL);
INSERT INTO `comments` VALUES (1037, 137, 152, 'v***1', '收拾房间的有些时候粗心没收到位 电梯里刷房卡有时不好用 其他的都还行', NULL, 67, 0, 4.9, 4.2, 4.3, 4.2, 4.9, 4.5, '2024-01-21 10:40:01', NULL);
INSERT INTO `comments` VALUES (1038, 137, 76, 'v***5', '地理位置挺好，基础房型景观就不错。服务员培训得很不错，但是屋内设施真的不太行，很反人类。有机会可能还会住的，主要是便宜。', NULL, 67, 0, 4.8, 4.2, 4.9, 4.1, 4.7, 4.5, '2023-09-03 08:10:10', NULL);
INSERT INTO `comments` VALUES (1039, 137, 142, 'n***1', '一直都很喜欢四季的服务，尤其前台的Cecilia，Carlos还有Rachel，Susan每次都让我感觉宾至如归。', NULL, 67, 0, 4.7, 4.5, 4.1, 4.7, 5, 4.6, '2023-10-01 22:37:36', NULL);
INSERT INTO `comments` VALUES (1040, 137, 72, 'R***7', '出行不太方便', NULL, 67, 0, 4.4, 4, 4.3, 4.4, 4.1, 4.2, '2023-08-02 21:29:22', NULL);
INSERT INTO `comments` VALUES (1041, 137, 211, 'l***1', '第一次入住深圳四季酒店，房间很诡异，卫生间所有灯自动熄灭，然后又重新点亮，过道头顶上闪烁绿灯，晚上睡觉让人感觉恐惧！一个晚上醒了4-5次，严重影响第二天的工作状态！', NULL, 67, 0, 4.2, 4.9, 4.9, 4.9, 4.7, 4.7, '2023-12-14 17:35:38', NULL);
INSERT INTO `comments` VALUES (1042, 137, 122, 's***6', '酒店位置好，停车方便免费，房间干净整洁，最棒的是健身房，健身器材齐全，设施好;早餐品种不是特别多，食材新鲜，出品比较精细，总体来说酒店服务、卫生，餐饮各方面都不错。', NULL, 67, 0, 4.4, 4.9, 4.5, 4.7, 4.6, 4.6, '2023-03-25 13:31:43', NULL);
INSERT INTO `comments` VALUES (1043, 137, 184, 'e***8', '景色超级美，没有任何不愉快。前台态度很好，一层小哥主动帮忙送行李。泡个澡很舒服看着窗外景色。钻戒掉浴缸底下酒店人员还帮忙找到了。非常感谢', NULL, 67, 1, 4.8, 4.7, 4.1, 4.1, 4.8, 4.5, '2021-12-02 00:12:07', NULL);
INSERT INTO `comments` VALUES (1044, 137, 144, 'j***3', '一般，有点老旧了', NULL, 67, 1, 4, 4.2, 4.6, 4.2, 5, 4.4, '2021-12-02 00:14:35', NULL);
INSERT INTO `comments` VALUES (1045, 137, 85, 'i***6', '还可以啊', NULL, 67, 0, 4.5, 4.1, 4.8, 4.9, 4.3, 4.5, '2023-10-16 21:14:39', NULL);
INSERT INTO `comments` VALUES (1046, 137, 171, 'x***1', '总体：本来对四季这个牌子还是抱有一定期待，但深圳四季的糟糕观感让人彻底打消了一切幻想。放弃了洲际至悦大使权益，跑来试图体验想象中的四季，结果被现实击得粉碎。', NULL, 67, 0, 4.9, 4.3, 4.4, 4.8, 4.1, 4.5, '2021-06-06 13:55:05', NULL);
INSERT INTO `comments` VALUES (1047, 137, 143, 'k***6', '酒店环境优雅，服务热情周到', NULL, 67, 0, 4.2, 4.7, 4.6, 4.4, 4.5, 4.5, '2023-02-04 20:01:50', NULL);
INSERT INTO `comments` VALUES (1048, 137, 166, 'z***7', '高层的景观真是太好了！卫生很干净，设施也是特别好的。', NULL, 67, 0, 4.3, 4.9, 4, 4.8, 4.8, 4.6, '2023-05-23 14:03:02', NULL);
INSERT INTO `comments` VALUES (1049, 137, 178, 'R***1', '服务不错钱。。。特别是前台。。。', NULL, 67, 0, 4.1, 4.7, 4.1, 5, 4.6, 4.5, '2022-09-07 22:26:35', NULL);
INSERT INTO `comments` VALUES (1050, 137, 213, 'G***2', '交通方便，他的床真的是太舒服了', NULL, 67, 0, 4.7, 4, 4.2, 4.6, 4.1, 4.3, '2022-05-29 23:07:41', NULL);
INSERT INTO `comments` VALUES (1051, 137, 81, 'D***1', '这个酒店的房间干净整洁，智能化程度较高，不错不错。', NULL, 67, 0, 4.3, 4.4, 4.9, 4.8, 4.6, 4.6, '2021-11-27 21:49:40', NULL);
INSERT INTO `comments` VALUES (1052, 137, 79, 'g***4', '位置不错，房间还行，但是装潢有点老了。电视不能投屏，就这样吧', NULL, 67, 0, 4.1, 4.9, 4.2, 5, 4.4, 4.5, '2021-09-08 15:36:28', NULL);
INSERT INTO `comments` VALUES (1053, 138, 79, 'g***4', '晚上睡觉很舒服 床很不错 房间不小 智能马桶也可以', NULL, 67, 0, 4.4, 4.2, 4.3, 4.7, 4.5, 4.4, '2024-02-15 21:10:30', NULL);
INSERT INTO `comments` VALUES (1054, 138, 94, 'g***0', '豪华酒店应该的样子', NULL, 67, 0, 4.3, 4.6, 4.1, 4.7, 4.1, 4.4, '2022-10-13 11:16:41', NULL);
INSERT INTO `comments` VALUES (1055, 138, 83, 'y***8', '刘源杰服务不错，酒店不错', NULL, 67, 0, 4.2, 4.3, 4.1, 4.9, 4, 4.3, '2021-05-08 21:54:48', NULL);
INSERT INTO `comments` VALUES (1056, 139, 105, 'h***7', '交通便利，周边配套完善', NULL, 67, 0, 4, 4, 4, 4.9, 4.9, 4.4, '2023-12-22 14:36:22', NULL);
INSERT INTO `comments` VALUES (1057, 139, 156, 'I***8', '服务人员素质参差不齐，部分很差，有两个极其恶劣', NULL, 67, 0, 4.8, 4.9, 4.8, 4.4, 4.7, 4.7, '2023-09-06 16:24:36', NULL);
INSERT INTO `comments` VALUES (1058, 139, 61, 'a***0', '去深圳看望朋友，选择下榻。传统高级酒店，但是偏商务风格，总体不错。', NULL, 67, 0, 5, 4.2, 5, 4.8, 4.9, 4.8, '2021-06-15 19:17:36', NULL);
INSERT INTO `comments` VALUES (1059, 140, 140, 'C***4', '早餐品种不多，酒店位置不错，周围有商圈可逛，离地铁不远，停车方便，服务水平五星酒店水平，中规中矩，房间大，卫浴舒适', NULL, 68, 0, 4.1, 4.3, 4.3, 4.5, 4.5, 4.3, '2024-04-22 17:08:54', NULL);
INSERT INTO `comments` VALUES (1060, 140, 228, '3***3', '早餐可以的', NULL, 68, 0, 4.8, 4.7, 5, 4.8, 4.2, 4.7, '2024-02-28 19:40:55', NULL);
INSERT INTO `comments` VALUES (1061, 140, 109, 'c***8', '早餐不错 服务热情', NULL, 68, 0, 4.1, 4.1, 4.6, 4.2, 4.7, 4.3, '2024-04-22 17:07:56', NULL);
INSERT INTO `comments` VALUES (1062, 140, 163, 'X***5', '前台服务好；馥餐厅环境非常好，菜品丰富；29楼行政酒廊风景好；7楼的泳池不错', NULL, 68, 0, 4.8, 4.4, 4.6, 4.2, 4.9, 4.6, '2024-03-30 19:11:30', NULL);
INSERT INTO `comments` VALUES (1063, 140, 228, '3***3', '很棒的酒店哦', NULL, 68, 0, 4.3, 4.5, 4.9, 4, 4, 4.3, '2024-02-28 18:26:09', NULL);
INSERT INTO `comments` VALUES (1064, 140, 60, '匿名用户', '果然不负四季之名，不错。', NULL, 68, 0, 4.8, 4.3, 4.9, 4.3, 4.4, 4.5, '2024-02-20 21:34:06', NULL);
INSERT INTO `comments` VALUES (1065, 140, 208, 'j***5', '感觉真的很不错', NULL, 68, 0, 5, 4.2, 4.4, 5, 4.1, 4.5, '2024-02-02 19:31:25', NULL);
INSERT INTO `comments` VALUES (1066, 140, 88, 'X***3', '地理位置优越，但是房间稍微有点霉味。', NULL, 68, 1, 4.2, 4.2, 4.4, 4, 4.6, 4.3, '2024-01-17 15:39:45', NULL);
INSERT INTO `comments` VALUES (1067, 140, 132, 'K***0', '前台服务一般，特别是一个女的，爱答不理。客房小哥服务态度好，主动询问需求。', NULL, 68, 0, 4.7, 4.2, 4.4, 4.3, 4.4, 4.4, '2024-04-14 00:24:53', NULL);
INSERT INTO `comments` VALUES (1068, 140, 168, 'S***8', '深圳的天好蓝，酒店也是很惊艳。虽然已经住过很多次，每次来感觉还是很特别温馨，尤其是这里的服务人员，处处显露出服务的水准，酒店周边设施完善。酒店内餐厅水准很高。听说马上有新餐厅开业，一定要去品尝一下。有机会一定会再次入住。一大早的惊喜。', NULL, 68, 0, 4.7, 4.5, 4.8, 4.6, 4.2, 4.6, '2024-04-14 00:26:50', NULL);
INSERT INTO `comments` VALUES (1069, 140, 172, 'Z***9', '酒店服务人员 服务普遍比其他酒店都好。 比较人性化。 备用可选的 荞麦枕头值得表扬。', NULL, 68, 0, 4.5, 4.4, 4.9, 4.2, 4.8, 4.6, '2024-02-27 19:14:35', NULL);
INSERT INTO `comments` VALUES (1070, 140, 106, 'M***0', '酒店位置很好，服务不错，价格合适。可能是假日期间感觉人手不够，有些服务要等的久一点，此外早餐因为疫情影响需要登记带位，需要等。可以理解但体验不好。早餐供应很多热门早点供不应求，这一点不好。此外，吐槽下一个小设计，淋浴水压一般，不是很大，夏天是不是自动马桶盖就不要开加热了。洗漱台上放个电视似乎有点浪费，还不如放下浴缸处。总体体验不错，推荐入住！', NULL, 68, 1, 4.1, 4.2, 4.1, 4.1, 4.9, 4.3, '2024-01-17 15:39:28', NULL);
INSERT INTO `comments` VALUES (1071, 140, 163, 'X***5', '这次出游入住体验不错，安排的房间比较安静，还帮我升了级，下次还会选择这家酒店。', NULL, 68, 0, 4.7, 4.9, 4.2, 4.4, 4, 4.4, '2024-02-05 23:15:18', NULL);
INSERT INTO `comments` VALUES (1072, 140, 185, 'd***9', '每次回深圳都会住四季，这次的入住体验很失望，首先房间卫生间没有打扫干净，洗手间的细节卫生很差 淋浴间墙面都是污垢，花洒头很脏，地漏下不去水，插头都是灰尘.退房的时候反馈了意见 当时前台说给我联系 但是都没有收到任何电话，我理解可能节假日酒店很忙吧 但是等到今天 依然没有任何的反馈. 卫生细节和服务都让我非常失望；', NULL, 68, 1, 4.8, 4.3, 4.2, 4.2, 5, 4.5, '2024-01-17 15:37:02', NULL);
INSERT INTO `comments` VALUES (1073, 140, 151, 'N***7', '酒店很棒，有部分房型可以加床，但是要提前沟通', NULL, 68, 1, 4.1, 4.6, 4.1, 4.9, 4.1, 4.4, '2024-01-19 13:05:11', NULL);
INSERT INTO `comments` VALUES (1074, 140, 159, 'k***2', '早餐不行，选择性少，不值早餐这个价位。房间设施可以，但是电吹风建议选优质的品牌。不太适合带小孩，但是节假日小孩入住多。位置非常好，周边交通方便。泳池最深1.2米，貌似不适合专业游泳的人，只适合玩水。睡袍还在泳池被人拿错，管理上还可以精进。总体还不错，但是软件采购管理方面还是有一些不符合四季这个品牌。', NULL, 68, 0, 4.6, 4.8, 4.2, 4.2, 4.5, 4.5, '2024-02-12 22:15:11', NULL);
INSERT INTO `comments` VALUES (1075, 140, 93, 'u***4', '服务和设施不错', NULL, 68, 0, 4.1, 4.5, 4.9, 4.1, 4.6, 4.4, '2024-02-21 10:31:22', NULL);
INSERT INTO `comments` VALUES (1076, 140, 64, 'e***0', '不错的酒店，地势繁华方便，有周到的服务，舒服的恒温游泳池，惬意spa，是性价比比较高的酒店', NULL, 68, 0, 4.1, 4.6, 4.7, 4.2, 4.5, 4.4, '2024-01-14 08:54:33', NULL);
INSERT INTO `comments` VALUES (1077, 140, 80, 'C***2', 'CBD一家宝藏酒店  市中心风景  大堂房间设计感强低调奢华 会主动打招呼 健身房器材品种很多 是一家值得打卡的酒店 早餐虽然种类不算多味道还是可以的 餐厅欧式风格 感觉服务略差的就是餐食结束时没有提醒客人还有没有要拿取的 这个是五星级酒店第一次遇到没有提醒', NULL, 68, 0, 4.9, 4.6, 4.5, 4.1, 4.9, 4.6, '2024-01-20 22:46:19', NULL);
INSERT INTO `comments` VALUES (1078, 140, 133, 'J***9', '很旧 传统的商务酒店', NULL, 68, 0, 4.7, 4.6, 4.2, 4.4, 4.6, 4.5, '2024-01-31 14:26:08', NULL);
INSERT INTO `comments` VALUES (1079, 141, 60, '匿名用户', '床很脏 一晚上都睡不着 有虫子咬 地毯也很脏 大力点踩下去都是灰尘', NULL, 68, 0, 4.6, 4.5, 4.6, 4.4, 4.3, 4.5, '2024-04-06 10:04:23', NULL);
INSERT INTO `comments` VALUES (1080, 141, 136, 't***1', '服务相当好，孩子生日免费升级了房间还送了小蛋糕和水果，布置了房间，孩子很开心，早餐也很丰富，就是房间冲淋器和洗手池下水一开始不行，派人来修才好，还是很满意的一次入住', NULL, 68, 0, 4.9, 4.7, 4.5, 5, 4.2, 4.7, '2024-02-02 19:13:51', NULL);
INSERT INTO `comments` VALUES (1081, 141, 142, 'n***1', '为朋友出游订的，反映挺不错的。', NULL, 68, 0, 4.6, 4.5, 4.2, 4.5, 4.4, 4.4, '2024-02-17 00:57:08', NULL);
INSERT INTO `comments` VALUES (1082, 141, 98, 'f***7', '还不错的选择', NULL, 68, 0, 4.4, 4.1, 4.4, 4.6, 4.5, 4.4, '2024-02-13 16:07:56', NULL);
INSERT INTO `comments` VALUES (1083, 141, 153, 'R***5', '每次去深圳首选，交通非常方便，也算是中心区域，晚上夜景可以观赏，值得赞的卫生间观景也很棒，只是服务还需要提高，', NULL, 68, 0, 4.8, 4.3, 5, 4.7, 4.6, 4.7, '2024-01-31 14:26:52', NULL);
INSERT INTO `comments` VALUES (1084, 141, 155, 'x***9', '环境服务都没的说，礼宾部小刘服务更是积极主动热情', NULL, 68, 0, 4.9, 4, 5, 4.3, 4.7, 4.6, '2023-09-24 16:23:19', NULL);
INSERT INTO `comments` VALUES (1085, 141, 89, 'f***9', '还可以，就是夜景真的不好看……不过酒店退房后还可以享受免费的水疗，还是可以的，就是这么大的酒店，房间里也没啥吃的。', NULL, 68, 0, 4.9, 4.9, 4.9, 4.3, 4.6, 4.7, '2023-09-15 06:09:59', NULL);
INSERT INTO `comments` VALUES (1086, 141, 86, 'n***3', '出差再次下榻四季酒店，因为匆忙没有过多要求，但是前台工作人员kay chen很热情高效地接待了入住，而且还体贴的升级的房型，整个入住流程高效，大大缓解了出差的疲劳感，在此再次感谢kay的热情服务，期待下次入住', NULL, 68, 0, 4.6, 4.1, 4.6, 4.1, 4.2, 4.3, '2023-12-05 14:20:02', NULL);
INSERT INTO `comments` VALUES (1087, 141, 83, 'y***8', '第一次入住深圳四季酒店，得到酒店行政酒廊宾客关系员陈良恺先生的热情接待，非常高效地办理了入住手续，并贴心升级到行政套房。房间环境宽敞整洁，尤为称赞的是床品，极其舒适、贴合。出差入住各个酒店，在四季总算得一夜好觉。总之，这次入住深圳四季，体验很愉快。', NULL, 68, 0, 4.9, 4.2, 4.9, 4.3, 4.2, 4.5, '2023-10-23 22:19:34', NULL);
INSERT INTO `comments` VALUES (1088, 141, 177, 'a***8', '第一次遇到这么个酒店床单不干净完了态度不好', NULL, 68, 0, 4.5, 4.2, 4.5, 4.6, 5, 4.6, '2023-08-19 21:34:51', NULL);
INSERT INTO `comments` VALUES (1089, 141, 116, 'c***6', '酒店体验非常棒，一言不合就升级了套房让我体验！以后还会入住！', NULL, 68, 0, 4.9, 4.1, 4.1, 4.2, 4.4, 4.3, '2023-07-01 17:24:09', NULL);
INSERT INTO `comments` VALUES (1090, 141, 78, 'h***9', '早歺厅格局好，安静，甜点一流', NULL, 68, 0, 4.9, 4.2, 4.4, 4.2, 4.2, 4.4, '2023-06-04 14:44:02', NULL);
INSERT INTO `comments` VALUES (1091, 141, 98, 'f***7', '环境不错卫生干净。', NULL, 68, 0, 4.1, 4.8, 4.8, 4.8, 4.5, 4.6, '2023-06-30 16:20:09', NULL);
INSERT INTO `comments` VALUES (1092, 141, 91, 'i***2', '多次入住了', NULL, 68, 0, 4, 4.9, 4.9, 4.7, 4.9, 4.7, '2023-10-09 16:39:46', NULL);
INSERT INTO `comments` VALUES (1093, 141, 138, 't***3', '酒店位置一级棒，酒店设施一级棒，就是行政酒廊比较小，其它都不错！！', NULL, 68, 0, 4.6, 4.1, 4.2, 4.3, 4.3, 4.3, '2023-05-02 20:27:39', NULL);
INSERT INTO `comments` VALUES (1094, 141, 153, 'R***5', '前台接待不太好。礼宾部很棒，特别是litz庄和charles王服务热情周到，解决了我们的实际困难，感谢了！', NULL, 68, 0, 4.5, 4.2, 4.2, 4.3, 4.8, 4.4, '2023-05-29 18:45:20', NULL);
INSERT INTO `comments` VALUES (1095, 141, 170, 's***4', '总体令人满意。', NULL, 68, 0, 4.8, 4.9, 4.5, 4.2, 4.1, 4.5, '2023-08-12 17:20:17', NULL);
INSERT INTO `comments` VALUES (1096, 141, 157, 'o***0', '四季的常客注意喽，这家四季并不是大部分四季那种水准，甚至都不如上海老四季那种水平，服务倒是不错的，就是房间太差了，一大股霉味，很恶心，虽然酒店给了空气净化器但是我开了三天到退房都还有霉味，维护太差了，就是个平平五星级，根本不是四季的标准，这家四季住得很失望', NULL, 68, 0, 4.5, 4.9, 5, 4.7, 4.4, 4.7, '2023-06-17 05:16:39', NULL);
INSERT INTO `comments` VALUES (1097, 142, 135, 'w***2', '设施好，位置很好，周围吃饭很方便。特别是前台服务很好，我需要两张创可贴，他一再问我是否受伤，需要帮助等。非常贴心', NULL, 69, 1, 4.5, 4.3, 4.1, 4.7, 4.4, 4.4, '2022-11-29 09:40:37', NULL);
INSERT INTO `comments` VALUES (1098, 142, 97, 's***2', '前台服务很差', NULL, 69, 1, 5, 4.8, 4.6, 4.8, 4.6, 4.8, '2022-10-06 09:18:22', NULL);
INSERT INTO `comments` VALUES (1099, 142, 106, 'm***0', '我天哪！深圳的四季虽说风景不咋地，但房间巨大，服务超好，一言不合就升房。。。比万豪啥的强太多了，下次来还要住！！！', NULL, 69, 1, 4.7, 4.5, 4.7, 4.7, 4, 4.5, '2022-10-05 12:50:35', NULL);
INSERT INTO `comments` VALUES (1100, 142, 113, 'w***4', '四季品质，很好', NULL, 69, 1, 4.5, 5, 4.3, 4.5, 4.1, 4.5, '2021-11-29 16:45:36', NULL);
INSERT INTO `comments` VALUES (1101, 143, 92, 'l***9', '不错不错不错不错不错不错不错不错不错不错不错不错不错不错不错不错不错不错不错不错不错', NULL, 69, 1, 4.1, 4.8, 4.7, 4.8, 4.3, 4.5, '2024-02-16 21:30:19', NULL);
INSERT INTO `comments` VALUES (1102, 143, 131, 'P***1', '落地玻璃外就是类似纽约中央公园的大片核心区域绿化，傍晚或清晨下楼跑步，楼下的shoppingmall满足一应需求。', NULL, 69, 0, 4.1, 4, 4.4, 4.9, 4.1, 4.3, '2024-03-18 21:35:47', NULL);
INSERT INTO `comments` VALUES (1103, 143, 141, 'G***8', '房间里抽了根烟酒店罚五百，说收的清洗布草的清洁费。吃早饭叫了三次服务员铺台布，第四次才有人来，前两个选择直接忽视', NULL, 69, 0, 4.1, 4.8, 4.2, 4.4, 4.7, 4.4, '2024-02-13 21:39:03', NULL);
INSERT INTO `comments` VALUES (1104, 143, 214, 'c***0', '还不错 可以再来', NULL, 69, 0, 4.6, 4.2, 4.8, 4.8, 4.6, 4.6, '2024-02-14 14:37:07', NULL);
INSERT INTO `comments` VALUES (1105, 143, 71, 'h***1', '还可以吧，电动马桶比较喜欢', NULL, 69, 1, 4.2, 4.5, 4.1, 4.5, 4.7, 4.4, '2022-06-26 14:18:28', NULL);
INSERT INTO `comments` VALUES (1106, 143, 111, 'm***6', '出色的服务！', NULL, 69, 1, 4.1, 4.2, 4.1, 4.4, 4.3, 4.2, '2023-03-28 23:14:16', NULL);
INSERT INTO `comments` VALUES (1107, 143, 141, 'g***8', '比较喜欢的酒店', NULL, 69, 1, 4.2, 4.1, 4.3, 4.3, 4.5, 4.3, '2022-10-07 22:16:38', NULL);
INSERT INTO `comments` VALUES (1108, 143, 190, 'B***3', '酒店还可以', NULL, 69, 1, 4.6, 4.2, 4.5, 4.4, 4.1, 4.4, '2023-05-03 22:38:23', NULL);
INSERT INTO `comments` VALUES (1109, 143, 81, 'D***1', '硬件设施好，他们家的智能马桶打100分，目前住过的酒店中最棒的马桶', NULL, 69, 1, 4.9, 4.4, 4.6, 4.9, 4.6, 4.7, '2021-12-03 23:53:50', NULL);
INSERT INTO `comments` VALUES (1110, 143, 146, 'q***4', '位置很好  房间也不错', NULL, 69, 1, 4.6, 4.7, 4.6, 4.7, 4.9, 4.7, '2022-10-05 19:13:54', NULL);
INSERT INTO `comments` VALUES (1111, 143, 171, 'x***1', '位置就在会展中心旁边', NULL, 69, 1, 4.9, 4.4, 4.9, 5, 4.9, 4.8, '2021-12-04 22:04:40', NULL);
INSERT INTO `comments` VALUES (1112, 143, 227, '2***9', '马桶就很棒', NULL, 69, 1, 4.9, 4.1, 4.6, 4.4, 4.7, 4.5, '2022-10-05 21:04:42', NULL);
INSERT INTO `comments` VALUES (1113, 143, 112, 'l***7', '西餐厅两灯带凹陷，差点端着饭碗摔倒，吹风机巨大的异味。', NULL, 69, 0, 4.9, 4.1, 4.9, 4.1, 4.8, 4.6, '2021-11-15 21:57:16', NULL);
INSERT INTO `comments` VALUES (1114, 143, 123, 'p***7', '服务餐饮都很好。深圳的老牌豪华酒店！', NULL, 69, 1, 4.5, 4.4, 4.6, 4.6, 4.1, 4.4, '2022-01-06 17:52:26', NULL);
INSERT INTO `comments` VALUES (1115, 143, 91, 'i***2', '酒店位置好，服务好', NULL, 69, 1, 4, 4.2, 4.5, 5, 4.8, 4.5, '2022-05-21 15:47:20', NULL);
INSERT INTO `comments` VALUES (1116, 143, 143, 'K***6', '很不错，住的舒服', NULL, 69, 0, 4.8, 4.1, 5, 4.7, 4.8, 4.7, '2022-11-13 18:55:13', NULL);
INSERT INTO `comments` VALUES (1117, 143, 165, 'V***7', '早餐一般，品类不是很多。以碳水为主。肉类较少。', NULL, 69, 0, 4.5, 4.1, 4.4, 4.4, 4.9, 4.5, '2022-01-01 22:41:33', NULL);
INSERT INTO `comments` VALUES (1118, 143, 146, 'q***4', '设施稍微有点老，出行非常方便，旁边就是会展中心', NULL, 69, 0, 4.1, 4.3, 4.7, 4.5, 4.3, 4.4, '2022-10-05 21:09:57', NULL);
INSERT INTO `comments` VALUES (1119, 143, 100, 'b***7', '去宠物展选择了这家四季，地理位置确实不错的，过个马路就是了，周围商场吃饭的地方也很多。但就是酒店太旧了，打扫也有点随便，洗澡的地方水迹很多，一进房门的摆设上门全都是尘还用射灯照着，心真大。', NULL, 69, 1, 4.6, 4.8, 4.5, 4.2, 4.2, 4.5, '2022-11-21 13:06:12', NULL);
INSERT INTO `comments` VALUES (1120, 144, 225, 'P***5', '地理位置优越，酒店设施先进。入住体验很好。四季的拖鞋是我最喜欢的，十分舒服，这就是赢在细节。', NULL, 69, 1, 4.8, 4.6, 4.3, 4.3, 4.9, 4.6, '2024-03-18 21:45:22', NULL);
INSERT INTO `comments` VALUES (1121, 144, 142, 'N***1', '真的很不错，尤其是早餐的糕点面包！', NULL, 69, 1, 4.6, 4.9, 4.8, 4.6, 4.4, 4.7, '2024-04-06 20:00:08', NULL);
INSERT INTO `comments` VALUES (1122, 144, 87, 'F***5', '很不错，交通便利', NULL, 69, 0, 4, 4.7, 4.4, 4.2, 4.3, 4.3, '2024-02-16 17:07:56', NULL);
INSERT INTO `comments` VALUES (1123, 144, 95, 'V***3', '四季的品质依然', NULL, 69, 0, 4.5, 4.4, 4, 4.5, 4.2, 4.3, '2023-10-05 20:31:57', NULL);
INSERT INTO `comments` VALUES (1124, 144, 64, 'e***0', '酒店总体不错', NULL, 69, 1, 4.7, 4.5, 4.7, 4.3, 4.8, 4.6, '2023-08-06 15:23:41', NULL);
INSERT INTO `comments` VALUES (1125, 144, 116, 'c***6', '无可挑剔。完美。房间很大。前台给了带客厅的套间，80坪。全部智能化房间太方便了。bose音响很棒！！！！咖啡很棒！一切都很棒！咖啡机中间出了一些小故障，酒店立刻更换，服务严谨周到！无可挑剔。从客房服务到前台到大门的工作人员，全部都非常高的素养，非常到位。感谢酒店的一切，温馨细致。期待以后还有机会再住这里！', NULL, 69, 1, 4.8, 4.4, 4.2, 4.2, 4.9, 4.5, '2023-01-26 17:06:39', NULL);
INSERT INTO `comments` VALUES (1126, 144, 191, 't***5', '设施完善 服务一流 体验绝伦', NULL, 69, 1, 4.6, 4.6, 4.6, 4.3, 4.9, 4.6, '2021-12-07 14:58:54', NULL);
INSERT INTO `comments` VALUES (1127, 144, 108, 'y***0', '高端大气，服务周到！', NULL, 69, 1, 4.6, 4.8, 4.2, 4.5, 4.7, 4.6, '2022-08-08 11:03:43', NULL);
INSERT INTO `comments` VALUES (1128, 144, 146, 'Q***4', '在深圳最中心位置，可以去对面的会展中心也可以在几分钟距离之内的地铁口去深圳其他地方，很不错', NULL, 69, 0, 4.9, 4.6, 4.2, 4, 4.3, 4.4, '2022-09-29 14:07:52', NULL);
INSERT INTO `comments` VALUES (1129, 144, 95, 'V***3', '还不错的酒店，就是没有常旅客计划比较遗憾。酒店装修还是比较新的，还可以，综合感受还不错，如果有送早餐和行政酒廊那就更棒了', NULL, 69, 0, 4.8, 4.5, 4.3, 4.2, 4.9, 4.5, '2022-07-05 13:40:03', NULL);
INSERT INTO `comments` VALUES (1130, 145, 213, 'g***2', '很方便，出行，逛街，吃饭都方便', NULL, 69, 1, 4.2, 4.7, 4.7, 4.1, 4.1, 4.4, '2024-04-06 19:57:35', NULL);
INSERT INTO `comments` VALUES (1131, 146, 135, 'w***2', '不错不错', NULL, 69, 1, 4.2, 4.2, 4.2, 4.8, 4.1, 4.3, '2022-11-29 09:40:37', NULL);
INSERT INTO `comments` VALUES (1132, 146, 97, 's***2', '酒店环境服务很棒，下次来还会住', NULL, 69, 1, 4.7, 5, 4.2, 4.1, 5, 4.6, '2022-10-06 09:18:22', NULL);
INSERT INTO `comments` VALUES (1133, 146, 106, 'm***0', '酒店位置非常好，值得入住', NULL, 69, 1, 4.2, 4.1, 4.5, 4.3, 4.4, 4.3, '2022-10-05 12:50:35', NULL);
INSERT INTO `comments` VALUES (1134, 146, 113, 'w***4', '非常便利，几乎大多数来深圳出差都会选择四季，位置在福田，去哪里办事都会比较方便，谢谢前台Vivian的温馨耐心的服务！', NULL, 69, 1, 4.3, 4.8, 4, 4.2, 4.3, 4.3, '2021-11-29 16:45:36', NULL);
INSERT INTO `comments` VALUES (1135, 147, 186, 'm***2', '早餐中西餐样式比较全，中餐菜品种类少一些。', NULL, 69, 0, 4.4, 4.1, 4.7, 4.7, 4.7, 4.5, '2024-02-14 14:36:28', NULL);
INSERT INTO `comments` VALUES (1136, 147, 67, 'A***6', '酒店房间打扫极其不干净，床单还是脏的，早上10点到的没房间就算了，到下午4点还是不通知有房间，非常差劲', NULL, 69, 0, 4.3, 4.5, 4.3, 4.1, 4.8, 4.4, '2023-12-13 07:26:16', NULL);
INSERT INTO `comments` VALUES (1137, 147, 101, 'e***6', '酒店位置很好，房间很赞的，服务也特别好，下次来深圳还会选择。', NULL, 69, 0, 4.6, 4.5, 4.2, 5, 4.8, 4.6, '2022-01-01 22:41:02', NULL);
INSERT INTO `comments` VALUES (1138, 147, 131, 'P***1', '很吵，隔音非常差', NULL, 69, 1, 4.2, 4.6, 4.7, 4, 4.2, 4.3, '2022-10-05 12:52:16', NULL);
INSERT INTO `comments` VALUES (1139, 148, 223, '1***0', '可以很好我很喜欢', NULL, 70, 0, 4.8, 4.6, 4.1, 4.1, 4.9, 4.5, '2020-05-02 10:06:59', NULL);
INSERT INTO `comments` VALUES (1140, 149, 137, 'L***3', '酒店位置非常好，周围都是商场，吃喝玩乐都很方便！酒店房间的设施喝服务有点有不足，五星级酒店连房间纸巾欢迎水果都没有还好环境还是不错的！', NULL, 70, 1, 4.8, 4.5, 4.9, 4.5, 4.9, 4.7, '2020-04-11 21:14:02', NULL);
INSERT INTO `comments` VALUES (1141, 149, 131, 'P***1', '蛮好，值得推荐', NULL, 70, 1, 4.8, 4, 4.6, 4.3, 4.8, 4.5, '2020-04-17 17:22:10', NULL);
INSERT INTO `comments` VALUES (1142, 150, 223, '1***0', '四季的环境还是一如既往的好 已经来了很多次了 只不过退房服务希望可以改进一下 耗费太长时间 让人一天都很不爽 其余的都很完美', NULL, 70, 0, 4.7, 4.9, 4.9, 4.1, 5, 4.7, '2020-05-02 10:08:58', NULL);
INSERT INTO `comments` VALUES (1143, 151, 231, '5***4', '每次出差都住四季 各方面都很方便 楼下也很方便', NULL, 70, 1, 4.3, 4.8, 4.9, 4.2, 4.1, 4.5, '2024-02-19 17:29:58', NULL);
INSERT INTO `comments` VALUES (1144, 151, 147, 'f***3', '酒店位置非常好，但是服务没跟上，房间有一股霉味，窗帘和地毯感觉好久没有清洗了，另外自助早餐小朋友是按年龄不是按身高算的，4岁以上需要收费，比较少见。整体对比广州的四季差了一个档次', NULL, 70, 0, 4.8, 4.1, 4.2, 4.1, 4.7, 4.4, '2023-03-03 18:22:19', NULL);
INSERT INTO `comments` VALUES (1145, 151, 223, '1***0', '住习惯了……每次来深圳都是四季', NULL, 70, 0, 4.8, 4.5, 4.6, 4.1, 4.3, 4.5, '2020-05-07 07:13:39', NULL);
INSERT INTO `comments` VALUES (1146, 152, 156, 'i***8', '如果从“五星”酒店标准来讲，是满意的。但如果从价格及四季酒店的品质来讲，性价比蛮差的。行政酒廊聊胜于无、自助早餐丰富度也比较一般，这方面和凯悦的“嘉宾轩”行政待遇差了不少。房间中规中矩，没亮点、当然也没有很差。', NULL, 71, 0, 4.5, 4.6, 5, 4.2, 4.5, 4.6, '2024-03-09 17:25:11', NULL);
INSERT INTO `comments` VALUES (1147, 152, 185, 'D***9', '环境卫生非常不好，周边繁华，招待客户很有气派，四季的酒店一直都是高端的代表，下次到深圳出差还得选四季', NULL, 71, 0, 4.5, 4.3, 4.2, 4.9, 4.9, 4.6, '2023-12-11 16:13:33', NULL);
INSERT INTO `comments` VALUES (1148, 152, 99, 'q***8', '四季永远都是那么出色，无可挑剔，最爱早餐、行政酒廊。太太正好是生日，酒店特意准备了礼物，很暖', NULL, 71, 0, 4.1, 4, 4.3, 4, 4.9, 4.3, '2024-03-07 15:33:08', NULL);
INSERT INTO `comments` VALUES (1149, 152, 4, 'kg', '酒店特别好 很满意', NULL, 71, 0, 4.1, 4.5, 4.4, 4.8, 4.2, 4.4, '2023-09-05 15:45:03', NULL);
INSERT INTO `comments` VALUES (1150, 152, 79, 'g***4', '服务好，免费升等套房，有提供小孩的洗漱用品', NULL, 71, 0, 4.7, 4.7, 4.4, 4.6, 4.3, 4.5, '2023-09-09 18:02:40', NULL);
INSERT INTO `comments` VALUES (1151, 152, 186, 'M***2', '服务非常好', NULL, 71, 0, 4.2, 4.3, 4.4, 4.2, 4.7, 4.4, '2023-09-08 16:52:04', NULL);
INSERT INTO `comments` VALUES (1152, 152, 93, 'U***4', '早餐很棒，服务很好，感觉很舒服。', NULL, 71, 0, 4.6, 5, 4.9, 4.3, 4.1, 4.6, '2023-08-04 17:00:23', NULL);
INSERT INTO `comments` VALUES (1153, 152, 74, 'T***9', '临近购物广场地铁站，附近有两个商场！购物饮食都非常方便！早餐也很丰富，下次继续入住！', NULL, 71, 1, 4.6, 4.6, 4.9, 4.5, 4.8, 4.7, '2023-08-04 21:08:55', NULL);
INSERT INTO `comments` VALUES (1154, 152, 140, 'C***4', '早餐性价比高。周围购物、美食、交通出行便捷。住在高区，深圳夜景还是不错。酒店大堂在六楼。有一屋顶花园。', NULL, 71, 0, 4.6, 4.1, 4.6, 4.2, 4.4, 4.4, '2023-08-15 08:08:08', NULL);
INSERT INTO `comments` VALUES (1155, 152, 85, 'I***6', '位置好，设施新', NULL, 71, 0, 4.1, 4.3, 4.4, 5, 4.2, 4.4, '2023-08-20 14:21:03', NULL);
INSERT INTO `comments` VALUES (1156, 152, 73, 'U***8', '哪怕这是一家18年的四季，能挑剔的毛病也不算太多。客房空间极大，玻璃屏风隔出了起居室和卧室，客房设备也很齐全，沙发很舒适，床被更是无可挑剔。但是酒店年龄毕竟在那，一些设备已经老化，比如淋浴间的淋浴开关往外拨会掉落，地毯也到了可以更换的时候。酒店的健身房设备很齐全，泳池环境也不错。地理位置也很优越，周边都是大型综合体。稍有瑕疵，但瑕不掩瑜。', NULL, 71, 0, 4.1, 4.5, 4.2, 4.5, 4.6, 4.4, '2023-09-11 13:48:12', NULL);
INSERT INTO `comments` VALUES (1157, 152, 75, 'J***1', '前台工作人员看我们带孩子，免费升级套房！很赞！', NULL, 71, 0, 5, 4.4, 4.5, 4.5, 4.3, 4.5, '2023-08-20 14:19:33', NULL);
INSERT INTO `comments` VALUES (1158, 152, 170, 's***4', '非常棒的体验。入住当日十一点左右到，reception的Rachel看到我们带宝宝，推荐升级房型，非常热心，送给了宝宝画笔，并安排了洗浴用品。立即办理入住后，房间设施齐全。酒店周边的活动、购物、用餐都非常方便。还会再次入住', NULL, 71, 0, 4.6, 4.9, 4.8, 4.8, 4.6, 4.7, '2023-08-14 02:45:35', NULL);
INSERT INTO `comments` VALUES (1159, 153, 221, '3***7', '很好，每天早餐都很丰富 经常住 本地人的最爱 设施环境都很好 很符合周末出来住 喜欢体验不同地方就好', NULL, 71, 1, 4.9, 4.8, 4.2, 4.5, 4.1, 4.5, '2024-04-24 13:11:02', NULL);
INSERT INTO `comments` VALUES (1160, 153, 91, 'i***2', '服务员态度太好了', NULL, 71, 0, 4.4, 4, 4.4, 4.5, 4, 4.3, '2024-03-09 15:42:50', NULL);
INSERT INTO `comments` VALUES (1161, 153, 150, 'O***8', '商务差旅 出行首选 服务周到 满分', NULL, 71, 0, 4.5, 4, 4.2, 4.2, 4.8, 4.3, '2024-03-07 01:06:16', NULL);
INSERT INTO `comments` VALUES (1162, 153, 232, '3***5', '正正好好，很多小细节很用心。设施虽然旧了一些，但是四季酒店的服务在深圳应该是最好的，下次还会选择四季！', NULL, 71, 0, 4.6, 4.2, 4.6, 4.8, 4.7, 4.6, '2024-02-13 23:31:50', NULL);
INSERT INTO `comments` VALUES (1163, 153, 75, 'J***1', '开业这么久装修设施还是维护的很不错的，保持着四季的水准。', NULL, 71, 0, 4.7, 4.7, 5, 4.4, 4, 4.6, '2024-01-01 20:28:53', NULL);
INSERT INTO `comments` VALUES (1164, 153, 85, 'I***6', '服务很好，只是设备有些地方显旧了', NULL, 71, 0, 4.5, 4, 4, 4.3, 4.7, 4.3, '2023-12-01 15:09:14', NULL);
INSERT INTO `comments` VALUES (1165, 154, 151, 'N***7', '标准四季的商务酒店，双台洗手池，福田核心地区；虽然不是新酒店但竟然还是智能马桶，虽然没什么太惊艳的地方但肯定不会踩雷', NULL, 71, 0, 4.1, 4.6, 4.7, 4.3, 4.9, 4.5, '2023-10-14 06:46:26', NULL);
INSERT INTO `comments` VALUES (1166, 154, 95, 'V***3', '酒店一般，也就是普通国际五星水平，没有达到四季品牌那种超五星级水平和广州四季差好远。。最可怕的是，我们住的房间，冰箱里面居然留着一盒放了很久的腐烂腐臭的鸡肉，打开冰箱一大阵臭味。还好经理换了一个大点的房间给我。另外前台服务员态度业很差。有待改进', NULL, 71, 0, 4.4, 4.3, 4.7, 4.7, 4.6, 4.5, '2023-10-27 21:01:45', NULL);
INSERT INTO `comments` VALUES (1167, 154, 99, 'q***8', '四季是我感觉一如既往的好', NULL, 71, 0, 4.6, 4.4, 4.8, 4.8, 4.3, 4.6, '2023-09-05 16:17:41', NULL);
INSERT INTO `comments` VALUES (1168, 154, 151, 'n***7', '到店已经很晚了 还升级了房间 服务还是相当的满意 一般有四季酒店的城市 不太会选择别的酒店', NULL, 71, 1, 4.4, 4.3, 4.4, 4.2, 4.9, 4.4, '2023-08-04 16:29:11', NULL);
INSERT INTO `comments` VALUES (1169, 154, 119, 'X***7', '有点旧，不过位置好，房间也不错。', NULL, 71, 1, 4.8, 4.3, 4, 4.6, 4.7, 4.5, '2023-08-06 09:35:35', NULL);
INSERT INTO `comments` VALUES (1170, 154, 190, 'b***3', '酒店服务非常好', NULL, 71, 0, 4.7, 5, 4.5, 4.2, 4.3, 4.5, '2023-08-17 14:01:50', NULL);
INSERT INTO `comments` VALUES (1171, 154, 190, 'b***3', '整体服务标准可以', NULL, 71, 0, 4.2, 4.3, 4.6, 4.7, 4.6, 4.5, '2023-08-13 10:19:14', NULL);
INSERT INTO `comments` VALUES (1172, 154, 140, 'C***4', '非常喜欢四季！', NULL, 71, 0, 4.9, 4.7, 4.5, 4.4, 4.3, 4.6, '2023-08-10 08:11:46', NULL);
INSERT INTO `comments` VALUES (1173, 154, 152, 'V***1', '服务非常好 打扫的阿姨人特别好', NULL, 71, 0, 4.1, 4.6, 4, 4.9, 4.3, 4.4, '2023-08-16 15:58:07', NULL);
INSERT INTO `comments` VALUES (1174, 154, 104, 'w***0', '在这家四季住了应该有十晚以上了，比附近其他酒店（香格里拉，ritz，jw marriott）还是要强不少，福田区可能只有去年开业的park hyatt比这家四季要好一些。说回酒店本身，不同房型之间差别不是很大，无非是多个客厅多个沙发这样，但所有卫生间面积都非常宽裕，是我在深圳住过数一数二大的，这一点非常好。executive louge和早餐都是水平之上但也没有让人眼前一亮，服务算是四季一贯的水准吧。因为住多了前台看到是常客会记住你的名字和免费升级房型，尤其是听到“先生，欢迎回来”想想还是蛮温馨的。', NULL, 71, 0, 4.2, 5, 4.4, 4.5, 4.9, 4.6, '2023-08-20 14:18:36', NULL);
INSERT INTO `comments` VALUES (1175, 154, 128, 'Y***2', '四季的话，自然还是有其一定的水准的，即使是疫情期间，还有的还是都有的，这种酒店，讲究的尤其是软实力，还是不错的', NULL, 71, 0, 4.7, 4.5, 4.1, 4.8, 4.9, 4.6, '2023-08-18 18:23:25', NULL);
INSERT INTO `comments` VALUES (1176, 154, 225, 'P***5', '中餐厅的出品特别的棒。', NULL, 71, 0, 4.7, 4.4, 4.8, 4.6, 4.6, 4.6, '2023-08-06 16:06:23', NULL);
INSERT INTO `comments` VALUES (1177, 154, 184, 'e***8', '很好的感觉', NULL, 71, 0, 4.7, 4.8, 4.6, 4.8, 4.9, 4.8, '2023-08-18 18:22:40', NULL);
INSERT INTO `comments` VALUES (1178, 155, 156, 'i***8', '不错的，挺好', NULL, 71, 0, 4.4, 4.3, 4.9, 4.1, 5, 4.5, '2024-03-09 17:25:11', NULL);
INSERT INTO `comments` VALUES (1179, 155, 185, 'D***9', '体验特别好。行李帮忙送到房间并且放好。进入房间时床围栏和婴儿床都已经准备好了。还贴心的准备了尿不湿、婴儿湿巾、宝宝牙刷牙膏、澡盆和宝宝凳。让我觉得特别惊喜。早餐很好吃，点心精致又美味。以后来深圳还会选择这里。', NULL, 71, 0, 5, 4.6, 4.4, 4.3, 4.9, 4.6, '2023-12-11 16:13:33', NULL);
INSERT INTO `comments` VALUES (1180, 155, 99, 'q***8', '我不知道怎么讲，是不是我对四季酒店的打开方式不对？房间很大很大，冰冰冷冷的，洗手间全是大理石，层高很高，空空荡荡的。房间里的灯光是冷色调的。我住在里面，对那个浴缸一点兴趣没有。洗手台很大，设置了两个人的洗脸池。那个墨镜电视很搞笑，就在洗手台上，这个摆设一样的东西……醉了。哎不过洗护用品还挺好的，早餐品类不算特别丰富。有个天台，经常有人在那里举办婚礼。不过餐厅的审美很棒，很欣赏那里的花艺。', NULL, 71, 0, 4.8, 4.3, 4.6, 4.6, 4.5, 4.6, '2024-03-07 15:33:08', NULL);
INSERT INTO `comments` VALUES (1181, 155, 4, 'kg', '早饭一如继往的棒，饭店各项服务都令客人满意！', NULL, 71, 0, 4.2, 4.8, 4.6, 4.5, 4.3, 4.5, '2023-09-05 15:45:03', NULL);
INSERT INTO `comments` VALUES (1182, 155, 79, 'g***4', '设施略显陈旧，地理位置方便，泳池入口很不方便，要倒两次电梯，泳池略小，希望改进', NULL, 71, 0, 4.5, 4.4, 4, 4.6, 4.3, 4.4, '2023-09-09 18:02:40', NULL);
INSERT INTO `comments` VALUES (1183, 155, 186, 'M***2', '非常棒的体验 四季的服务就是好', NULL, 71, 0, 4.3, 4.5, 4.8, 4.6, 4.1, 4.5, '2023-09-08 16:52:04', NULL);
INSERT INTO `comments` VALUES (1184, 155, 93, 'U***4', '服务很好，出行也方便，29楼行政廊的下午茶和鸡尾酒时光人不多，东西也蛮好吃的', NULL, 71, 0, 4.5, 4.5, 5, 4.7, 4.6, 4.7, '2023-08-04 17:00:23', NULL);
