INSERT INTO `comments` VALUES (1189, 155, 75, 'J***1', '进房有霉味，书桌上有外卖的污渍，提醒前台后，居然解释说渗透到皮质层中，无法处理，两个房间都有问题，却没有任何服务补救，四季在我心中是非常不错的品牌，但这里的入住体验让我不免有点失落和伤感。', NULL, 71, 0, 4.1, 5, 4.3, 4.1, 4.5, 4.4, '2023-08-20 14:19:33', NULL);
