INSERT INTO `comments` VALUES (1199, 156, 134, 'k***4', '有免费停车场，可以加床，卫生非常好，服务态度也很好，非常大的洗手间，下次还会再来的，就在coco park 附近，', NULL, 72, 0, 4.1, 4.8, 4.5, 4.3, 4.7, 4.5, '2023-11-07 21:17:00', NULL);
INSERT INTO `comments` VALUES (1200, 156, 100, 'b***7', '感觉服务很好，办入住时跟前台说想要一套工夫茶具，前台说房间有一套小茶具，不过可以另外送套大的，结果服务员不单送来潮汕传统茶具，还送来4瓶矿泉水，感觉很贴心。', NULL, 72, 0, 4.9, 4.9, 4.8, 4.7, 4.4, 4.7, '2023-10-04 20:26:22', NULL);
INSERT INTO `comments` VALUES (1201, 157, 138, 't***3', '一次愉快的入住体验。出发前告知女儿周岁生日，酒店就安排了经理跟进。房间帮忙布置了，另外还安排了饼干diy，主动安排了婴儿床、沐浴盆、奶瓶消毒器等。特别要感谢Joyce经理的悉心安排，第一次住深圳四季，细节做得很好，各种服务跟进很到位。另外，如果行政礼遇体验能提高点就更好。对比广州四季酒店，深圳四季酒店的环境、食物的种类、轻饮的选择等还是有提高的空间。', NULL, 72, 1, 5, 4.5, 4.1, 4.2, 4.9, 4.5, '2024-02-11 23:53:41', NULL);
INSERT INTO `comments` VALUES (1202, 157, 87, 'f***5', '地理位置不错，服务不错，设施稍显老旧', NULL, 72, 1, 4.2, 4.8, 4.1, 4.7, 4.8, 4.5, '2024-02-10 17:50:40', NULL);
INSERT INTO `comments` VALUES (1203, 157, 124, 'v***9', '位置很好，离皇庭中心特别近，很舒服很方便，，下次还会选择，之前都是住香格里拉，以后一定会一如既往支持。', NULL, 72, 0, 5, 4.8, 4.8, 4.2, 4.3, 4.6, '2024-04-22 21:26:21', NULL);
INSERT INTO `comments` VALUES (1204, 157, 209, '3***1', '服务非常规范 很满意。还会预订。', NULL, 72, 0, 4.4, 4.7, 4.1, 4.9, 4.4, 4.5, '2024-02-14 16:01:43', NULL);
INSERT INTO `comments` VALUES (1205, 157, 60, '匿名用户', '酒店设施旧了，花洒出水一点也不柔和，最主要的是房间一堵高墙且开不了窗 ，空气不好，整晚没睡好，小孩对空气也很敏感半夜流鼻血，说实话住在四季居然有这么糟糕的体验是很郁闷的，当时是很有冲动想要打个差评的，不过看在前台工作人员服务不错就手下留情了。', NULL, 72, 1, 4.3, 4.1, 4.9, 4.4, 4.6, 4.5, '2023-12-16 21:14:42', NULL);
INSERT INTO `comments` VALUES (1206, 157, 83, 'Y***8', '适合居住，的酒店', NULL, 72, 0, 4, 5, 5, 4.3, 4.1, 4.5, '2024-01-24 20:35:45', NULL);
