INSERT INTO `comments` VALUES (1209, 158, 97, 'S***2', '早餐丰富，小孩加床免费行政酒廊环境和服务都', NULL, 72, 1, 4.2, 4.1, 4.9, 4.4, 4.5, 4.4, '2023-12-10 23:08:00', NULL);
INSERT INTO `comments` VALUES (1210, 158, 156, 'I***8', '很棒的服务，很棒的团队，否则已经过时了', NULL, 72, 1, 4.3, 4.4, 4.3, 4.7, 4.2, 4.4, '2023-12-20 17:30:15', NULL);
INSERT INTO `comments` VALUES (1211, 158, 136, 't***1', '酒店房间都比较大，酒店前台和服务人员服务态度好，位置在深圳市福田区市中心，交通便利，总体来说挺不错的，下次出差还回来住。', NULL, 72, 1, 4.8, 4.1, 4.6, 4.2, 4.9, 4.5, '2023-12-21 16:46:16', NULL);
