INSERT INTO `comments` VALUES (1214, 158, 161, 'm***8', '服务对得起这个价格，很满意！', NULL, 72, 0, 4.3, 4.1, 4.7, 4.2, 4.8, 4.4, '2024-02-25 09:12:27', NULL);
INSERT INTO `comments` VALUES (1215, 158, 155, 'x***9', '床软了一些，但是能接受，就是枕头实在是太软了，支撑不了脖子，一整晚睡下来，脖子疼痛，其它方面都很棒', NULL, 72, 0, 4.2, 4, 4.7, 4.7, 4.4, 4.4, '2024-02-25 09:13:11', NULL);
INSERT INTO `comments` VALUES (1216, 158, 155, 'x***9', '入住没收到欢迎水果，打电话要了送来的。早餐去晚了，因为孩子想吃鸡肉肠已经没有了，服务员特别为我们烤了几个，为这位服务员的服务意识点赞。但是牛奶的位置比较难找，放在走廊中间中式餐台的左边，我一直以为那三个锅是三种粥，问了三个服务员都说在那一块地方，我转了三圈才看到放在锅后面的牛奶俩字。服务很好，但是停车场不大位置比较难找，把车停在了垃圾桶旁边。另外因为要带孩子参加活动先退房但是把车停在酒店，回来去一楼跟服务员说车牌号和房间号办理免费停车的时候那张脸冷的感觉比以前的政府办事员都差。时隔这么多天还能想起来，看来造成了阴影了。', NULL, 72, 0, 4.6, 4.8, 4.8, 4.3, 4.5, 4.6, '2024-02-12 14:40:10', NULL);
INSERT INTO `comments` VALUES (1217, 158, 134, 'k***4', '挺不错的噢', NULL, 72, 0, 5, 4.9, 4.8, 4, 4.6, 4.7, '2023-11-07 21:17:00', NULL);
