INSERT INTO `comments` VALUES (1222, 160, 113, 'w***4', '服务很好，设备齐全高档，我每次出差四季酒店是首选早餐品种有点少，但食材精致，厨师做菜认真，太度很好，下次还住四季，公司员工深圳道选', NULL, 73, 0, 4.3, 5, 4.4, 4.6, 4.3, 4.5, '2024-03-17 14:07:55', NULL);
