INSERT INTO `comments` VALUES (1232, 164, 141, 'g***8', '特别表扬前台一位叫Rachel Chen 的女孩子  虽然只是个小姑娘  办事却很干练高效 本来因为一点小插曲想要投诉的  这位Rachel思路很清晰很迅速的解决好了  整个过程很舒服 这点给四季酒店加分 本人比较懒  平时不写评价的  特意过来给Rachel点个赞', NULL, 74, 1, 4.8, 4.8, 4.2, 4.3, 4.8, 4.6, '2024-02-25 17:40:32', NULL);
INSERT INTO `comments` VALUES (1233, 164, 228, '3***3', '前台服务非常好，看着带孩子让服务生马上送了小朋友用的东西。行政酒廊的有个大肚子准妈妈非常nice，很敬业。下午茶，鸡尾酒餐会都很棒。', NULL, 74, 0, 4.5, 4.7, 4.4, 4.9, 5, 4.7, '2024-02-26 05:37:55', NULL);
