INSERT INTO `comments` VALUES (1237, 165, 215, '2***2', '刚刚装修的酒店，异味儿严重到无法入睡', NULL, 74, 0, 5, 4.6, 4.9, 4.9, 4.7, 4.8, '2024-02-15 14:04:57', NULL);
