INSERT INTO `comments` VALUES (1239, 166, 132, 'K***0', '对四季一直都有一种特殊的情感，因为马尔代夫的小四季给了我非常美好的回忆，这次在深圳四季依然给我不错的体验。仍然是免费给孩子加床，提前给孩子准备的小点心、儿童洗浴用品等等很贴心。不过我住的这个房间空调有点问题，半夜热醒了，后来调很久才睡得着。', NULL, 74, 0, 4.1, 5, 4.8, 4.8, 4.4, 4.6, '2024-02-14 23:48:28', NULL);
INSERT INTO `comments` VALUES (1240, 166, 144, 'j***3', '第一次住四季酒店，期望很高，但总体上有点失望。先说说不太满意的地方：1、酒店前台在6楼，但是没有很显著的标志提醒，结果从停车场上来先跑到了1楼，看评论也有不少这种情况的；2、第一次给的房间应该做了额外升级，但是一进门一股霉味扑鼻而来，越往里走味道越重，难以忍受于是要求换房，又折腾了两次才换到一个味道稍小点的房间；3、中午办理退房之后先后两次收到前台的电话询问是否续租，一次是下午1点，一次是下午6点多，有点莫名其妙。', NULL, 74, 0, 5, 4.9, 4.7, 4.5, 4.6, 4.7, '2024-04-20 22:04:39', NULL);
INSERT INTO `comments` VALUES (1241, 167, 233, '8***1', '服务非常好、洗漱用品、床品都非常舒服', NULL, 75, 1, 4.9, 4.6, 4.2, 4.2, 4.2, 4.4, '2023-11-26 16:26:39', NULL);
INSERT INTO `comments` VALUES (1242, 167, 163, 'X***5', '服务一流，很干净，高雅的感觉', NULL, 75, 1, 4, 4.1, 4.1, 4.1, 4.9, 4.2, '2024-03-10 11:56:12', NULL);
INSERT INTO `comments` VALUES (1243, 167, 83, 'y***8', '免费升级了房型，服务好。', NULL, 75, 0, 4.4, 4.9, 4.7, 5, 4.4, 4.7, '2024-04-09 19:11:04', NULL);
INSERT INTO `comments` VALUES (1244, 167, 86, 'n***3', '比较方便的酒店', NULL, 75, 0, 4.4, 5, 4.2, 4.9, 4, 4.5, '2024-03-10 14:58:46', NULL);
INSERT INTO `comments` VALUES (1245, 167, 84, 'f***1', '出差已经很足够了，足够大的衣柜和卫生间，交通便利，隔壁就是商场，早餐非常丰富，满意', NULL, 75, 1, 4.3, 4.9, 4.6, 4.2, 4.7, 4.5, '2024-02-11 19:36:40', NULL);
INSERT INTO `comments` VALUES (1246, 167, 71, 'h***1', '酒店经理JACJY 张，服务超级好，素养也高，大半夜一个喝多了的客人跟他大吼大叫发牢骚，我补办房卡正好遇到，他微笑面对，毫无半点不耐烦，着素质，一般人没有。', NULL, 75, 0, 4.9, 4.6, 4.5, 4.1, 4.8, 4.6, '2024-03-25 10:09:54', NULL);
INSERT INTO `comments` VALUES (1247, 167, 150, 'O***8', '酒店房间有异味，估计地毯问题', NULL, 75, 0, 4.7, 4.9, 4.4, 4, 4.4, 4.5, '2024-01-04 09:49:41', NULL);
INSERT INTO `comments` VALUES (1248, 167, 85, 'I***6', '这次入住四季酒店实在太坑了', NULL, 75, 1, 4.9, 4.5, 4.5, 4.1, 4.7, 4.5, '2023-09-21 17:09:59', NULL);
INSERT INTO `comments` VALUES (1249, 167, 164, 'z***1', '商务出差 但顺便邀请老公来过生日 joyce帮忙安排了房型升级 蛋糕和气球 服务好好哦 四季有些年份了 但是细节都做的还不错 商务出行不错的选择', NULL, 75, 1, 4.9, 4.4, 4.3, 4.6, 4, 4.4, '2023-09-26 05:50:00', NULL);
INSERT INTO `comments` VALUES (1250, 167, 143, 'K***6', '行政套房还不错', NULL, 75, 0, 4.5, 4.1, 4.3, 4.1, 4.1, 4.2, '2023-08-31 15:01:04', NULL);
INSERT INTO `comments` VALUES (1251, 167, 170, 'S***4', '服务和早餐都很好', NULL, 75, 0, 4.6, 4.1, 4.3, 4.7, 4.5, 4.4, '2023-08-22 22:11:25', NULL);
INSERT INTO `comments` VALUES (1252, 167, 139, 'Z***3', '帮领导预定，里职场比较近。比较新，多次预订了。领导反馈还可以，以后会经常预定。', NULL, 75, 1, 4.1, 4.2, 4.2, 4.9, 4.2, 4.3, '2023-08-27 17:24:04', NULL);
INSERT INTO `comments` VALUES (1253, 167, 85, 'i***6', '各方面都非常好', NULL, 75, 1, 4.7, 4.2, 4.9, 4.3, 4.5, 4.5, '2023-06-29 12:26:40', NULL);
INSERT INTO `comments` VALUES (1254, 167, 150, 'O***8', '床品很舒服，还免费升级了房间', NULL, 75, 0, 4.6, 4.8, 4.8, 4.9, 4.1, 4.6, '2023-12-13 18:50:46', NULL);
INSERT INTO `comments` VALUES (1255, 167, 214, 'C***0', '不知道深圳这家四季让我清楚地意识到效率慢 服务意识不行', NULL, 75, 0, 4.8, 4.9, 4.6, 4.1, 4.9, 4.7, '2023-06-09 21:11:06', NULL);
INSERT INTO `comments` VALUES (1256, 167, 154, 'Q***2', '朋友来玩。特别满意', NULL, 75, 0, 4.8, 4.8, 4.1, 4.1, 4.3, 4.4, '2023-06-24 10:46:11', NULL);
INSERT INTO `comments` VALUES (1257, 167, 208, 'J***5', '礼宾部Connor实在太好了 服务态度特别好 特别到位', NULL, 75, 1, 4.4, 4.9, 4.4, 4.5, 4.7, 4.6, '2021-09-16 22:22:20', NULL);
INSERT INTO `comments` VALUES (1258, 167, 127, 'B***5', '价格非常良心，酒店环境非常干净，房间很安静，地理位置还不错，周围吃的玩的很多。早餐没去吃因为广州的吃的实在太多了。', NULL, 75, 1, 4.4, 4.2, 4.6, 4.9, 4.7, 4.6, '2021-12-07 17:01:10', NULL);
