INSERT INTO `comments` VALUES (1262, 168, 185, 'd***9', '还是以前一样', NULL, 75, 0, 4.6, 4.7, 4.7, 4.1, 4.6, 4.5, '2024-04-03 15:36:07', NULL);
INSERT INTO `comments` VALUES (1263, 168, 191, 'T***5', '住的很舒服', NULL, 75, 1, 4.9, 4.1, 4.8, 4.2, 4, 4.4, '2024-03-24 15:44:50', NULL);
INSERT INTO `comments` VALUES (1264, 168, 142, 'N***1', '酒店位于会展中心对面，附近也有一个大型的购物中心，每次来深开会，都会选择这家酒店，住的舒心，非常推荐！', NULL, 75, 0, 4.7, 4.7, 4.7, 4.3, 5, 4.7, '2024-04-13 20:51:10', NULL);
INSERT INTO `comments` VALUES (1265, 168, 131, 'p***1', '挺好，还给我升级成了套房', NULL, 75, 0, 4.2, 4.2, 4.4, 4.5, 4.8, 4.4, '2024-04-11 21:29:59', NULL);
INSERT INTO `comments` VALUES (1266, 168, 173, 'h***3', '非常一般，，，，，', NULL, 75, 0, 4, 4.8, 4, 4.7, 4, 4.3, '2024-04-09 19:05:10', NULL);
INSERT INTO `comments` VALUES (1267, 168, 128, 'Y***2', '服务顶级棒，餐饮质量更是没得说的优秀。每次住四季都有家一般的感觉。尽管深圳五星级酒店雨后春笋般涌现，我仍然只钟情于四季。', NULL, 75, 0, 4.5, 4.9, 4.8, 4.2, 4.6, 4.6, '2024-04-04 15:54:30', NULL);
INSERT INTO `comments` VALUES (1268, 168, 184, 'E***8', '感谢四季的工作人员为我这次生日旅行提供了一次很棒的体验。他们的服务真的让人感到很暖心，不仅精心为我准备了生日蛋糕和小卡片，更是在听到我女朋友肚子不舒服还专门送来了暖贴。第二天check out还帮我们延迟了退房，非常感谢Kitty 和Eve的用心.下次一定还会选择四季！', NULL, 75, 1, 4.7, 4.6, 4.4, 4.4, 4.5, 4.5, '2023-12-05 20:27:39', NULL);
INSERT INTO `comments` VALUES (1269, 168, 171, 'X***1', '酒店房间感觉精致奢华，早餐品种丰富，名副其实的五星级酒店。', NULL, 75, 0, 5, 4.7, 4.6, 4.1, 4.3, 4.5, '2024-03-10 23:31:22', NULL);
INSERT INTO `comments` VALUES (1270, 168, 82, 'i***0', '**前台，我开房在无烟楼层抽了一根烟，罚款1500进她自己口袋 臭**，脸呢', NULL, 75, 0, 4.2, 4.8, 4.6, 4.8, 4.5, 4.6, '2024-03-27 23:38:50', NULL);
INSERT INTO `comments` VALUES (1271, 168, 182, 'R***9', '早餐一般，说实话，第一时间就想到我干啥不去订深圳湾万丽，价格差不多，我白金一样能升房包早餐，而且全国的万丽早餐都弄得不错。离开餐厅才发现糕点制品在最最外面，算了，懒得回头再吃了。', NULL, 75, 0, 4.1, 4.6, 4.8, 4.1, 4.9, 4.5, '2024-03-24 16:37:48', NULL);
INSERT INTO `comments` VALUES (1272, 168, 66, 'd***3', '挺好的，就是前台有点不耐烦的态度', NULL, 75, 0, 4.2, 4.7, 4.9, 4.3, 4.4, 4.5, '2024-03-25 10:09:08', NULL);
INSERT INTO `comments` VALUES (1273, 168, 71, 'H***1', '酒店设施不错', NULL, 75, 1, 4.6, 4.8, 4.7, 4.3, 4.3, 4.5, '2023-12-30 22:20:34', NULL);
INSERT INTO `comments` VALUES (1274, 168, 232, '3***5', '位置，卫生，舒适性，服务 都非常好，大堂的Joyce亲切招待，还帮忙处理续住的问题。非常值得推荐。。', NULL, 75, 0, 4.9, 4.8, 4.8, 4.9, 4.5, 4.8, '2024-01-23 20:54:05', NULL);
INSERT INTO `comments` VALUES (1275, 168, 167, 'Q***0', 'a a a a a', NULL, 75, 0, 4.9, 4.6, 4.2, 5, 4.6, 4.7, '2023-12-25 21:00:31', NULL);
INSERT INTO `comments` VALUES (1276, 168, 186, 'M***2', '酒店和服务都好！', NULL, 75, 0, 4.8, 4.8, 4.6, 4.4, 4.4, 4.6, '2023-12-15 17:29:43', NULL);
INSERT INTO `comments` VALUES (1277, 168, 217, '3***2', '吃饭。逛街都很方便。前台服务热情', NULL, 75, 0, 4.3, 4, 4.8, 4.1, 5, 4.4, '2023-12-18 19:57:10', NULL);
INSERT INTO `comments` VALUES (1278, 168, 177, 'a***8', '还行吧，你们自己去体验', NULL, 75, 0, 4.3, 4.3, 4.3, 4.2, 4.8, 4.4, '2023-12-25 19:58:15', NULL);
INSERT INTO `comments` VALUES (1279, 168, 170, 's***4', '酒店视野开阔，环境优雅，服务细致，出差或游玩都是不错的选择！！！', NULL, 75, 0, 4.9, 4.1, 4.3, 4.9, 4, 4.4, '2023-11-03 17:13:47', NULL);
INSERT INTO `comments` VALUES (1280, 168, 206, 'Y***6', '失望、不是很愉快，到看到评论说生日那天入住会房间升级或有蛋糕送，所以生日那天特意选了这家酒店希望会有小惊喜，结果啥都没有，而且刚进入，不清楚酒店大堂在6楼，被一楼前台的员工嘲笑，很不尊重人，感觉他们挺没有素质。酒店除了贵、没有感受到五星级酒店应有的服务素质和待遇，而且早餐种类少，没有什么好吃的，还是觉得服务不怎么样，不受尊重', NULL, 75, 0, 4.4, 4.2, 4.2, 4.9, 4.2, 4.4, '2024-04-26 18:29:32', NULL);
INSERT INTO `comments` VALUES (1281, 169, 61, 'A***0', '我一年住100多天四季酒店，是我的最爱。服务非好，房间也舒服。', NULL, 75, 1, 4.8, 4.2, 4.9, 4.8, 4, 4.5, '2024-02-15 08:58:00', NULL);
INSERT INTO `comments` VALUES (1282, 169, 119, 'x***7', '康体中心整洁干净，酒店服务很好，位置正是福田中心吃喝玩乐都非常方便。', NULL, 75, 0, 4.3, 4.5, 4.9, 4.3, 4.4, 4.5, '2024-03-20 22:05:19', NULL);
INSERT INTO `comments` VALUES (1283, 169, 102, 't***7', '交通很方便', NULL, 75, 1, 4.6, 4.7, 4.2, 4.2, 4.4, 4.4, '2023-09-12 23:38:44', NULL);
INSERT INTO `comments` VALUES (1284, 169, 109, 'c***8', '很吵！一晚上都没睡好！', NULL, 75, 0, 4.8, 4.7, 4.9, 4.9, 4.4, 4.7, '2023-08-13 01:17:05', NULL);
INSERT INTO `comments` VALUES (1285, 169, 72, 'r***7', '感觉很满意', NULL, 75, 0, 4.1, 4.9, 4.3, 4.7, 4.5, 4.5, '2023-08-16 20:22:28', NULL);
