INSERT INTO `comments` VALUES (1290, 169, 123, 'P***7', '住宿方面非常棒，环境适中，停车位也充足。', NULL, 75, 0, 4.9, 5, 4.2, 4.9, 4.9, 4.8, '2023-07-14 09:49:26', NULL);
INSERT INTO `comments` VALUES (1291, 169, 67, 'a***6', '无论去到哪个城市，四季酒店都是我们整个家族的首选，感恩四季酒店所有同仁的辛勤付出', NULL, 75, 1, 4.1, 4, 4.7, 4.8, 4.9, 4.5, '2022-06-08 12:28:20', NULL);
INSERT INTO `comments` VALUES (1292, 169, 105, 'h***7', '对每一件事都有好处', NULL, 75, 0, 4.8, 4.3, 4.5, 4.6, 4.7, 4.6, '2023-07-01 20:38:21', NULL);
INSERT INTO `comments` VALUES (1293, 169, 166, 'z***7', '免费升级了！位置好，周边很多商场，吃饭逛街沒问题。早餐简单了点，可能期待有点高了。有些角落的地方卫生沒搞到，办公桌电话旁有灰，浴缸的水龙头座也有。希望可以坚持做好管理维护才配得起这品牌啊哈哈！', NULL, 75, 0, 4.7, 4.2, 4.2, 4.3, 4.4, 4.4, '2018-08-10 19:04:21', NULL);
INSERT INTO `comments` VALUES (1294, 169, 186, 'M***2', '四季酒店一直都很好，到每个城市我都会优先选择四季！', NULL, 75, 0, 4.8, 4.8, 4.3, 4.6, 4.6, 4.6, '2023-03-12 09:03:45', NULL);
INSERT INTO `comments` VALUES (1295, 169, 234, '毕***场', '早餐是这次出行的五个五星级酒店酒店最差的一个酒店，早餐品质很差，缺乏真诚和态度，对不起四季酒店的名称。很遗憾，下次不再考虑入住。', NULL, 75, 0, 4.1, 4.1, 4.1, 4.7, 4, 4.2, '2022-02-24 18:12:39', NULL);
INSERT INTO `comments` VALUES (1296, 169, 144, 'j***3', '非常满意，大，高级，软件，硬件，都非常好。推荐给所有人，不管商业出行，个人旅游，情侣，亲子出游，都是非常好的选择。', NULL, 75, 0, 4.1, 4.1, 4.8, 4.3, 4.9, 4.4, '2021-07-15 13:23:27', NULL);
INSERT INTO `comments` VALUES (1297, 169, 58, 'B***9', '一开始的房间风水怪怪的 后面换了一间还不错', NULL, 75, 1, 4.6, 4.9, 5, 4.5, 4.9, 4.8, '2018-06-11 12:39:18', NULL);
INSERT INTO `comments` VALUES (1298, 169, 99, 'q***8', '基本上去深圳入住首选', NULL, 75, 1, 4.1, 4.9, 4.5, 4.8, 4.3, 4.5, '2018-07-06 22:15:20', NULL);
