INSERT INTO `comments` VALUES (1300, 169, 161, 'M***8', '周边环境很好，吃东西很方便', NULL, 75, 0, 4.6, 4.7, 4.6, 4.2, 4.8, 4.6, '2023-01-06 10:12:22', NULL);
INSERT INTO `comments` VALUES (1301, 170, 157, 'O***0', '地理位置非常好 对面是平安大厦，工作人员服务热情走心。有地下停车场。', NULL, 75, 1, 4.2, 4, 4.6, 4.3, 4.3, 4.3, '2024-02-21 14:13:47', NULL);
