INSERT INTO `comments` VALUES (1305, 170, 161, 'm***8', '位于市中心出游方便，但也因此花园和泳池较小。', NULL, 75, 0, 4.3, 4.1, 4.5, 4.8, 4.3, 4.4, '2024-01-04 10:00:42', NULL);
