INSERT INTO `comments` VALUES (1307, 170, 70, 'O***6', '五星级酒店服务很好', NULL, 75, 0, 4, 4.8, 4.3, 4.3, 4.4, 4.4, '2024-04-09 16:11:57', NULL);
INSERT INTO `comments` VALUES (1308, 170, 88, 'X***3', '一般般这家四季。', NULL, 75, 1, 4.8, 4.9, 4.4, 4.5, 4.5, 4.6, '2023-09-23 08:44:38', NULL);
INSERT INTO `comments` VALUES (1309, 170, 92, 'l***9', '房间有电动马桶，非常舒适。早餐出品很棒。四季的整体服务都非常棒，无论是前台、礼宾还是客房服务员、餐厅服务员，服务态度都非常好。', NULL, 75, 0, 4.1, 4.7, 4.6, 4.3, 4.9, 4.5, '2023-07-15 20:16:16', NULL);
INSERT INTO `comments` VALUES (1310, 170, 115, 'J***7', '服务很好 房间很好', NULL, 75, 0, 4.2, 5, 5, 5, 4, 4.6, '2023-06-25 22:45:35', NULL);
INSERT INTO `comments` VALUES (1311, 170, 78, 'H***9', '去之前一直怕自己运气不好遇到评论里偶尔的不愉快事件，但是从进一楼大门就感觉到了酒店的服务还是不错的，从一楼坐电梯到六楼才是酒店的大堂，我们是下午三点左右到的，可能是大年三十，入住人员比较少，办理入住手续很顺利，三五分钟就搞定，疫情期间不想到处乱跑，所以就打算就近在广东省内找个地方走走，为的就是第二天去走海滨栈道。住了两晚，酒店设备虽说时间有点久了，但是还是很不错的，有BOSE音响，各种味道的茶包，还有胶囊咖啡机和几种口味的咖啡胶囊，对于我这种每天不能离咖啡的人来说非常的满意，进房放下东西后就在酒店周边走走看看，吃饭、逛商场、看电影都很方便，离地铁站也比较近，附近就有公交车直达大梅沙海边，但我们是为了走海滨栈道，所以坐了地铁再转公交到的盐田海鲜街开始走的那12公里海岸线，然后再走回到大梅沙附近坐的公交回到会展中心，还是很方便的，只不过这样下来路程就是20公里以上，当天步行了，3.5万步，那酸爽！但是非常值得，海岸线真的很美，很漂亮！再来说说酒店的早餐，想对于丽思、JW来说酒店的早餐真的比较简单，但是出品还是很不错的！中西结合，美美吃个早餐还是不错的！酒店服务还是不错的，打扫的干净，洗浴用品不错，我喜欢的味道！', NULL, 75, 0, 4.2, 4, 4.5, 4.9, 4.2, 4.4, '2021-07-19 20:22:13', NULL);
INSERT INTO `comments` VALUES (1312, 170, 136, 't***1', '经过一年疫情，身心疲惫，春节期间入住深圳四季酒店，休憩放松一下。给人印象深刻的是前台接待人员张令宇，热情、耐心、细致的解答我们的询问，不愧是有六十年历史的国际五星级酒店员工的高品质服务，给人宾至如归之感。很喜欢酒店房间洋溢着现代气息的装修格调，床上铺设的是软硬适中有百年历史的世界十大品牌美国丝涟床垫，日本TOTO智能冲洗马桶，不影响相互间盥洗的双洗脸盆及嵌入镜面的小电视，干湿分离的卫生间，西班牙奢华品牌系列护肤、洗漱用品悦碧施，可调节光源的灯光设施，宽大的衣帽间，让人惊喜的是酒店还送有一盘精致带有喜庆色彩的巧克力和中式糕点，配上房间小花瓶插的一枝智利百合鲜花，让人心旷神怡。最让人感动的是酒店的人性化服务，特别配置的防疫卫生包。洒店内有黑珍珠一钻经典粤菜歺厅“卓粤轩”，自助餐厅“馥”，“逸廊”的英式下午茶，这些美味佳肴让人大快朵颐。酒店位于CBD中心区，拉开窗帘就能看到有592米高的深圳最高楼平安金融中心，隔街就是国际会展中心，步行十来分钟可到除纽约中央火车站外世界第二大面积的福田高铁站，在此乘车去香港只需十四分钟。证券交易所、市民中心、文化中心、莲花山公园、博物馆、影剧院及一大批高端办公楼林立周围，徜徉在酒店附近绿树成荫，花团锦簇的街头，能感受到深圳这个现代化城市的时代脉博和繁华似锦。《福布斯旅游指南》是全球豪华旅游及酒店评定的业界权威标准，全球有36家四季酒店评定为五星最高殊荣，创该榜单61年纪录，是获得五星品牌最多的酒店。深圳四季酒店硬件虽不如广州四季酒店，但优质服务的口碑名不虚传。另外我有个建议：早歺的培根煎的太硬，我们不喜欢吃这种煎的干且硬的培根，能否象其它一些五星酒店在盘中将煎好的培根软、硬分开，满足不同口味。', NULL, 75, 1, 4.8, 4.6, 4.3, 4.1, 4.6, 4.5, '2023-02-10 15:34:12', NULL);
INSERT INTO `comments` VALUES (1313, 170, 105, 'h***7', '此次年三十至年初三入住深圳四季酒店行政楼层豪华行政大床房共三晚，物有超值，体验甚佳。同以往曾入住过的国内外包括香港的五星酒店行政楼相比较，深圳四季酒店独居特色、豪华典雅、服务周全贴心。首先位置优越、交通便利、景致独特。位于市中心的CBD以及会展和市民中心之间核心地带，周围是第一高楼‘平安大厦’和吃喝玩丰富的时尚大型购物中心。窗外望去彰显深圳现代化金融中心鳞次栉比、造型各异的摩天大楼以及中心花园的独到景致。酒店本身无论在设计、建筑、装饰、设施、健身、餐饮，特别是员工的专业和服务等，充分彰显了其豪华酒店的独特魅力。大年初一早上酒店特别举办的舞狮表演和祭拜仪式体现了浓厚的中华传统春节年味和文化特色。特别要提及的是聚贤阁的服务：环境优雅，员工服务超好；一日三餐，食物精美，品味优良，全天候供应饮品、酒水和小食。下次还会入住的。', '隔壁女孩', 75, 1, 4.5, 4.4, 4.7, 4.5, 4.5, 4.5, '2022-08-20 17:14:21', '2024-05-09 16:23:15');
INSERT INTO `comments` VALUES (1314, 170, 127, 'b***5', '懒，只有特别好或特别差才会点评。四季是妥妥前者！1.早餐带小孩，一般服务员通常会在门口拦住，告知你有额外的费用先，四季的服务员毫无停顿，直接带进去，路上再非常自然地娓娓问你孩子几岁了；2.适逢春节在房间里包完红包忘了收起来，一叠就放在床上，从外面回来时服务员已做了夜床服务，红包一个没少；3.一只不常用的手机一直没找到，离店后的第二天抱着试试看的心情电话酒店，居然回复说：有！ OMG，Four Seasons，very impressive！！', NULL, 75, 1, 4.1, 4.6, 4.2, 4.9, 4.1, 4.4, '2022-10-02 10:31:53', NULL);
INSERT INTO `comments` VALUES (1315, 170, 164, 'Z***1', '不错的一次入住体验，前提服务非常好。', NULL, 75, 1, 5, 4.3, 4.9, 4.6, 4.7, 4.7, '2023-04-04 11:47:00', NULL);
INSERT INTO `comments` VALUES (1316, 170, 88, 'x***3', '早餐超赞，服务超赞。位置好，跨年首选，度假首选，哈哈', NULL, 75, 0, 4.6, 4, 4.2, 4.7, 4.2, 4.3, '2023-03-25 13:50:11', NULL);
INSERT INTO `comments` VALUES (1317, 170, 178, 'R***1', '四季酒店地段很好，周围商场多，附近购物吃饭非常方便，离市民公园也非常近。酒店大堂不大，房间设施还不错。', NULL, 75, 1, 4.3, 4.5, 4.7, 4.7, 4.6, 4.6, '2018-02-19 05:38:29', NULL);
INSERT INTO `comments` VALUES (1318, 170, 108, 'Y***0', '酒店硬件设施齐全', NULL, 75, 0, 4.3, 4.7, 4.4, 4.5, 4.9, 4.6, '2023-05-07 15:27:52', NULL);
INSERT INTO `comments` VALUES (1319, 170, 75, 'j***1', '位置不错，周边交通和饮食娱乐都非常方便，只是酒店装饰一般，房间不大', NULL, 75, 0, 4.3, 4.6, 4.7, 4.6, 4.8, 4.6, '2022-07-27 21:33:44', NULL);
