INSERT INTO `comments` VALUES (1321, 171, 127, 'B***5', '前台Richard专业有加，中庭是个亮点，浪费的容积都让房价补了，窗帘四边没做遮光设计', NULL, 76, 1, 4.5, 4.8, 4.5, 4.2, 4.8, 4.6, '2024-04-08 16:45:36', NULL);
INSERT INTO `comments` VALUES (1322, 171, 71, 'H***1', '什么都好！只有一点，就是在早餐时间，餐厅里面老是有清洁工在搞拖地擦桌子等清洁工作，这个以前在任何酒店都没有碰到过，感觉稍微差一些。吃饭时候不是应当都清洁好了吗？客人一边在吃饭，清洁工一边在拖地这算神马名堂？以后得改进。吃饭的时候，餐厅里面好像只应当有三种人：客人、服务生、厨师。', NULL, 76, 1, 4.9, 4.9, 4.1, 4.2, 4.2, 4.5, '2024-03-01 08:28:15', NULL);
INSERT INTO `comments` VALUES (1323, 171, 170, 's***4', '位置很好，员工很友好而且乐于助人。', NULL, 76, 0, 4.8, 4.6, 5, 4.8, 4.3, 4.7, '2024-03-16 15:30:06', NULL);
