INSERT INTO `comments` VALUES (1326, 171, 79, 'g***4', '刚开始房间居然给了一间拐角的，房间格局奇怪的不得了，一根大柱子在房间，床和卫生间有个奇奇怪怪的长走廊，房间憋屈的不得了。明明是淡季，有很多房间，非要给一个这种房型！', NULL, 76, 1, 4.2, 4.4, 4.2, 4.5, 4.7, 4.4, '2023-06-06 15:06:41', NULL);
INSERT INTO `comments` VALUES (1327, 171, 137, 'l***3', '还不错吧！', NULL, 76, 1, 4, 4.8, 4.6, 4.6, 4.2, 4.4, '2022-03-01 02:42:03', NULL);
INSERT INTO `comments` VALUES (1328, 171, 119, 'x***7', '四季一直是我的首选，超级粉丝。深圳的四季，地理位置好，交通方便，有停车场，餐厅也是一个靓点。', NULL, 76, 0, 4.3, 4.3, 4.2, 4.6, 4.8, 4.4, '2022-06-29 20:22:53', NULL);
