INSERT INTO `comments` VALUES (1330, 171, 72, 'R***7', '连住了9晚，房间相对不够大，酒店也拒绝升级，这个态度对于常驻客人来说很少见。总体中规中矩，相比隔壁的Ritz，唯一好处是游泳池室内，在深圳的冬天可以运动一下。', NULL, 76, 0, 4.5, 4.4, 4.5, 4.5, 4.8, 4.5, '2023-02-23 14:45:01', NULL);
