INSERT INTO `comments` VALUES (1340, 172, 72, 'R***7', '因为是在疫情期间，给领导预订出差使用，还预订了酒店内部的中餐厅，体验感不错，作为出差使用还是很好的。', NULL, 76, 0, 4.5, 4.2, 4.3, 4.3, 4.5, 4.4, '2023-02-23 14:45:01', NULL);
