INSERT INTO `comments` VALUES (1342, 173, 145, 'o***2', '不错，很好，推荐！接下来的日子里面没有你是不是觉得简单粗暴起暴落实清楚乔传统盐焗鸡汤乡下周六别安排队中。', NULL, 76, 1, 4.9, 4.4, 4.6, 4.4, 4.6, 4.6, '2018-11-12 00:00:00', NULL);
