INSERT INTO `comments` VALUES (1346, 173, 187, 'u***2', '莫名其妙多扣半天房费 一开始保持理解的态度等了一个多星期 期间也是多次我在和酒店联系怎么解决 他们的回复一直都是十天又十天  期间也从来没有人主动联系我怎么解决 只是让我等着 这种服务态度真是无语至极………', NULL, 76, 0, 4.7, 4.6, 4.6, 4.1, 4.5, 4.5, '2018-08-18 20:54:20', NULL);
