INSERT INTO `comments` VALUES (1349, 173, 151, 'N***7', '市中心地理位置优越。房间保养的不错，缺点是停车场太小太窄且车位不足', NULL, 76, 0, 5, 4.8, 4.2, 4.3, 4.4, 4.5, '2018-12-08 17:41:39', NULL);
INSERT INTO `comments` VALUES (1350, 173, 94, 'G***0', '高档型的酒店，卫生干净，还帮忙升级客房了，好棒啊，房间大，床铺舒服，景观也不错，看到周边的高楼大厦，感觉自己很渺小～周边好多网红店，吃的，逛的都很多！', NULL, 76, 0, 4.4, 4.1, 4.5, 4.8, 4.9, 4.5, '2018-10-04 19:45:02', NULL);
INSERT INTO `comments` VALUES (1351, 173, 158, 'l***5', '作为大牌五星酒店没有令人失望 前台Jacky帅气小哥哥知道是我生日给我免费升了房  还送了蛋糕 非常贴心啊 房间也很干净整洁 不错滴 下次还会选择', NULL, 76, 0, 4.9, 4.4, 4.8, 4.9, 4.6, 4.7, '2021-02-25 22:37:07', NULL);
