INSERT INTO `comments` VALUES (1353, 173, 89, 'F***9', '早餐还算丰富，但儿童要收费。有停车场，停车免费。酒店位于市中心，周围很多商场，出行方便。但总体来讲，感觉服务不如隔壁的丽思卡尔顿好。', NULL, 76, 0, 4.7, 4, 4.8, 5, 4.6, 4.6, '2018-11-12 08:58:43', NULL);
