INSERT INTO `comments` VALUES (1397, 175, 104, 'W***0', '位置非常好，早餐精致好吃，游泳池很干净维护不错，我们有带宝宝提供我们很多宝宝用品，奶瓶消毒锅真是救星', NULL, 76, 0, 4.4, 4, 4.5, 4.5, 4.2, 4.3, '2023-02-26 15:00:43', NULL);
INSERT INTO `comments` VALUES (1398, 176, 80, 'c***2', '1.卫生间的淋浴头坏掉了 洗澡的时候一直掉下来 2.入住期间没有打扫服务只有夜床服务 连扔在地上的浴巾也没有人换 而办理入住的时候并没有告知 3. 打电话给总机反馈了这些问题 酒店派了提供夜床服务的服务员来道歉 这是要引起客人和员工的正面对抗么？还是让客人来代替酒店培训员工么？而且这个员工犯了一个致命的错误 房间开着请勿打扰 为什么还可以敲门？这个在酒店的SOP中应该有明文规定吧 4.客房部付总监随后虽然打了电话过来道歉 但这样的服务水平真的有失四季的水准。', NULL, 76, 0, 4.9, 4.2, 4.4, 4.6, 4.5, 4.5, '2023-11-02 14:28:07', NULL);
INSERT INTO `comments` VALUES (1399, 176, 97, 's***2', '酒店环境优雅大气而且安静舒适. 服务员服务态度实在好 我因为押金问题需要跟他们沟通 经理直接加微信跟我沟通解决 希望问题能尽快解决吧', NULL, 76, 0, 4.1, 4.7, 4.4, 4.4, 4.2, 4.4, '2021-05-13 14:41:32', NULL);
