INSERT INTO `comments` VALUES (1415, 176, 134, 'K***4', '第一次气的写差评 前台服务前所未有的差！！！2点到前台 前台说没打扫完房间 一个小时内打扫完联系我 一个小时内没联系我 我过了一个半小时后回到前台 结果前台操作了10分钟发现自己忘了 一点歉意没有 这种服务素质 不止五星级酒店 就算是快捷酒店 我也是没见过 你们真棒 让我大开眼界了', NULL, 76, 0, 4.6, 4.1, 4.3, 4.8, 4.3, 4.4, '2023-06-08 11:16:14', NULL);
