INSERT INTO `comments` VALUES (1436, 178, 180, '1***8', '四季果然名不虚传！下次有活动再囤，海豚比猪靠谱多了！', NULL, 77, 0, 4, 4.3, 4.3, 4.6, 4.9, 4.4, '2022-10-04 10:34:12', NULL);
INSERT INTO `comments` VALUES (1437, 178, 176, '1***9', '地理位置非常好 旁边有很多地方可以用餐 最繁华的地段 。就是酒店有点老啦', NULL, 77, 1, 5, 4.9, 4.1, 4, 4.2, 4.4, '2023-01-04 21:17:32', NULL);
INSERT INTO `comments` VALUES (1438, 178, 218, '1***1', '非常便利，酒店环境一流', NULL, 77, 1, 4.9, 4.1, 4.3, 4.6, 4.7, 4.5, '2022-07-28 11:26:41', NULL);
INSERT INTO `comments` VALUES (1439, 179, 239, '5***9', '比上海四季好很多', NULL, 77, 1, 4.7, 4.5, 4.5, 4.2, 4.5, 4.5, '2023-11-14 07:26:28', NULL);
INSERT INTO `comments` VALUES (1440, 179, 60, '匿名用户', '酒店环境舒适度都很棒，服务也符合五星级酒店定位，尤其joyce和kay，让人感受到宾至如归。', NULL, 77, 1, 4.5, 4.4, 4, 4.4, 4, 4.3, '2023-08-21 02:10:35', NULL);
INSERT INTO `comments` VALUES (1441, 179, 205, '2***8', '很好的酒店，位置很棒！', NULL, 77, 0, 4.1, 4.6, 4.1, 4.6, 4.1, 4.3, '2023-06-01 14:27:31', NULL);
INSERT INTO `comments` VALUES (1442, 179, 240, '8***3', '房间设备维护不是很好，显得有点老旧了。服务还是不错的………', NULL, 77, 1, 4.1, 4.9, 4, 4, 4.1, 4.2, '2023-01-25 22:04:26', NULL);
INSERT INTO `comments` VALUES (1443, 179, 241, '6***7', '我们有很棒的经验。我们在酒店度过了周年纪念日，客人体验经理帮助我们使住宿变得异常特别。她升级了我们的房间，为我们提供了蛋糕，还给了我妻子鲜花。除此之外，酒店很棒。很好的保存和伟大的装饰。我会向所有我的朋友和家人推荐这家酒店和四个季节。', NULL, 77, 0, 4.5, 4.1, 4.9, 4.7, 4.3, 4.5, '2023-02-01 20:08:17', NULL);
INSERT INTO `comments` VALUES (1444, 179, 57, '2***4', '不错哦！', NULL, 77, 0, 4.9, 4.7, 4.7, 4.5, 4.4, 4.6, '2023-07-05 11:17:40', NULL);
INSERT INTO `comments` VALUES (1445, 179, 55, '5***1', '位置很好，周围吃饭购物方便！', NULL, 77, 0, 4.8, 4.8, 4.3, 4.2, 5, 4.6, '2021-05-09 15:10:31', NULL);
INSERT INTO `comments` VALUES (1446, 179, 241, '6***7', '还地理位置很好 走过去就是cocopark 服务很好', NULL, 77, 0, 4.7, 4.1, 4.9, 4.7, 4.2, 4.5, '2023-01-19 20:26:29', NULL);
INSERT INTO `comments` VALUES (1557, 187, 115, 'J***7', '位置很不错', NULL, 79, 0, 4.8, 4, 4.4, 4.2, 4.7, 4.4, '2023-07-28 17:32:23', NULL);
INSERT INTO `comments` VALUES (1558, 187, 172, 'z***9', '房间非常简约，服务很好。健身房泳池配套设施都不错，挺好的！', NULL, 79, 0, 4.1, 5, 4.9, 4.2, 4.9, 4.6, '2023-06-10 18:41:17', NULL);
INSERT INTO `comments` VALUES (1559, 187, 154, 'q***2', '环境卫生都不错，前台服务一般', NULL, 79, 0, 4.4, 4.8, 4.9, 4.6, 4.7, 4.7, '2023-06-10 18:41:38', NULL);
INSERT INTO `comments` VALUES (1560, 187, 94, 'G***0', '比较适合旅居', NULL, 79, 0, 4.2, 4.6, 4.8, 4.3, 4.8, 4.5, '2022-02-14 13:38:56', NULL);
INSERT INTO `comments` VALUES (1561, 188, 60, '匿名用户', 'Roy Rao服务好', NULL, 80, 1, 4.6, 4, 4.4, 4.5, 4.7, 4.4, '2024-02-10 15:29:27', NULL);
INSERT INTO `comments` VALUES (1562, 188, 111, 'm***6', '属于四星级酒店水准，早餐很一般。设施稍旧。', NULL, 80, 0, 5, 4.7, 4.5, 4.7, 4.2, 4.6, '2024-04-21 15:57:47', NULL);
INSERT INTO `comments` VALUES (1563, 188, 149, 'B***1', '位置很好，出行方便。房间面积很大，洗澡水也很大，周围交通方便，是来到深圳的最佳入住之地，非常推荐入住。', NULL, 80, 0, 4.1, 4.4, 4.6, 4.2, 4.1, 4.3, '2024-04-21 15:59:41', NULL);
INSERT INTO `comments` VALUES (1564, 188, 60, '匿名用户', '四季质量有保障', NULL, 80, 0, 4.9, 4.5, 4.1, 4.4, 4.1, 4.4, '2024-03-07 08:08:04', NULL);
INSERT INTO `comments` VALUES (1565, 188, 135, 'w***2', '四季酒店一直是我喜欢的', NULL, 80, 0, 4.1, 4.8, 4.3, 4.3, 4.6, 4.4, '2024-03-07 08:12:42', NULL);
INSERT INTO `comments` VALUES (1566, 188, 178, 'r***1', '交通很便利。地理位置优越', NULL, 80, 0, 4.4, 4.8, 4.7, 4.3, 4.6, 4.6, '2023-11-10 15:49:43', NULL);
INSERT INTO `comments` VALUES (1567, 188, 104, 'W***0', '帮朋友定的 听上去还不错', NULL, 80, 0, 4.8, 4.1, 4.8, 4.9, 5, 4.7, '2023-11-10 16:04:14', NULL);
INSERT INTO `comments` VALUES (1568, 188, 88, 'x***3', '还可', NULL, 80, 0, 4.8, 4.6, 4.4, 4.4, 4.2, 4.5, '2023-10-19 21:25:39', NULL);
INSERT INTO `comments` VALUES (1569, 188, 83, 'Y***8', '位置真的好', NULL, 80, 0, 4.7, 4, 4.1, 4.7, 4.8, 4.5, '2024-02-18 21:58:55', NULL);
INSERT INTO `comments` VALUES (1570, 188, 141, 'g***8', '12月18.日是我们结婚40年结婚日非常感谢孙雪琪和陈丽宇俩位小妹妹为我们贴心的安排。.为我们免费升级了房间还送了红玖瑰和.红蜡烛。谢谢。', NULL, 80, 0, 4.9, 4.3, 4.5, 4.4, 4.6, 4.5, '2023-09-18 19:02:20', NULL);
INSERT INTO `comments` VALUES (1571, 188, 94, 'g***0', '不是太值，这家四季不是太四季', NULL, 80, 0, 4.8, 4.3, 4.6, 4.5, 4.8, 4.6, '2023-09-14 16:36:39', NULL);
INSERT INTO `comments` VALUES (1572, 188, 79, 'G***4', '环境早餐挺好，房间有点小', NULL, 80, 0, 4.1, 4.5, 4.1, 5, 4.6, 4.5, '2023-09-07 18:03:57', NULL);
INSERT INTO `comments` VALUES (1573, 188, 75, 'J***1', '圣诞节装饰超棒', NULL, 80, 0, 4.4, 4.9, 4.8, 4, 4, 4.4, '2023-09-21 17:02:43', NULL);
INSERT INTO `comments` VALUES (1574, 188, 66, 'D***3', '酒店位置挺好', NULL, 80, 0, 4.5, 4, 4.1, 4.5, 4.6, 4.3, '2023-09-28 16:55:51', NULL);
INSERT INTO `comments` VALUES (1575, 188, 166, 'z***7', '交通服务都好', NULL, 80, 0, 4.4, 4.5, 4.1, 4.7, 4.7, 4.5, '2023-09-07 18:42:12', NULL);
INSERT INTO `comments` VALUES (1576, 188, 94, 'G***0', '住的难受 风水不好 设计缺点多  住了要生病 恶心', NULL, 80, 0, 4.9, 4.6, 4.9, 4.5, 4.4, 4.7, '2023-09-14 16:51:11', NULL);
INSERT INTO `comments` VALUES (1577, 188, 165, 'V***7', '四季的床是出了名的舒服，虽然看得出是有些年份的酒店，但性价比还是匹配的。', NULL, 80, 0, 4.1, 4, 4.4, 5, 4.6, 4.4, '2023-09-22 21:10:05', NULL);
INSERT INTO `comments` VALUES (1578, 188, 157, 'o***0', '酒店很棒，表扬一下前台庄先生贴心服务……', NULL, 80, 0, 4.1, 4.6, 4.6, 4.3, 4.2, 4.4, '2023-08-17 14:17:29', NULL);
INSERT INTO `comments` VALUES (1579, 188, 61, 'a***0', '总体还是比较好的，品牌连锁酒店住起来还是比较放心！交通位置、服务环境都比较好！早餐也比较满意，品种较多！下次再来！', NULL, 80, 0, 4, 4.5, 4.1, 4.9, 4.3, 4.4, '2023-09-01 18:18:20', NULL);
INSERT INTO `comments` VALUES (1580, 188, 140, 'c***4', '都唔错，装修好靓，房间好大，好干浄，五星好评', NULL, 80, 1, 4.2, 4.7, 4.9, 4.3, 5, 4.6, '2023-08-11 14:24:38', NULL);
INSERT INTO `comments` VALUES (1581, 189, 60, '匿名用户', '每次到深圳出差必住的酒店，就在会展中心对面。交通方便，地铁口就在旁边。房间都打扫的一尘不染。，床很舒服。', NULL, 80, 1, 4.6, 4, 4.4, 4.5, 4.7, 4.4, '2024-02-10 15:29:27', NULL);
INSERT INTO `comments` VALUES (1582, 189, 111, 'm***6', '大品牌酒店当然还是有特别之处的，服务细节做的很到位，希望能一如既往的坚持', NULL, 80, 0, 5, 4.7, 4.5, 4.7, 4.2, 4.6, '2024-04-21 15:57:47', NULL);
INSERT INTO `comments` VALUES (1583, 189, 149, 'B***1', '超级喜欢室内风格 很酷的体验', NULL, 80, 0, 4.1, 4.4, 4.6, 4.2, 4.1, 4.3, '2024-04-21 15:59:41', NULL);
INSERT INTO `comments` VALUES (1584, 189, 60, '匿名用户', '超值，唯一不好的是没续到房不得已换了其他酒店', NULL, 80, 0, 4.9, 4.5, 4.1, 4.4, 4.1, 4.4, '2024-03-07 08:08:04', NULL);
INSERT INTO `comments` VALUES (1585, 189, 135, 'w***2', '非常满意，旁边就是皇庭广场，有蔡澜和各种各样的吃食和茶茶；对面就是展会，工作之余可以转悠转悠！卫生也很干净，床铺很舒服；下次来首选！', NULL, 80, 0, 4.1, 4.8, 4.3, 4.3, 4.6, 4.4, '2024-03-07 08:12:42', NULL);
INSERT INTO `comments` VALUES (1586, 189, 178, 'r***1', '床很舒适，有停车场', NULL, 80, 0, 4.4, 4.8, 4.7, 4.3, 4.6, 4.6, '2023-11-10 15:49:43', NULL);
INSERT INTO `comments` VALUES (1587, 189, 104, 'W***0', '还可以吧，地理位置好，出行方便。', NULL, 80, 0, 4.8, 4.1, 4.8, 4.9, 5, 4.7, '2023-11-10 16:04:14', NULL);
INSERT INTO `comments` VALUES (1588, 189, 88, 'x***3', '行政楼层很热情，很满意！后续换的房间风景很好，感谢行政楼层kay！', NULL, 80, 0, 4.8, 4.6, 4.4, 4.4, 4.2, 4.5, '2023-10-19 21:25:39', NULL);
INSERT INTO `comments` VALUES (1589, 189, 83, 'Y***8', '没有这价值，只是名气大，用的备品都是小众品牌，不符这个品牌的形象', NULL, 80, 0, 4.7, 4, 4.1, 4.7, 4.8, 4.5, '2024-02-18 21:58:55', NULL);
INSERT INTO `comments` VALUES (1590, 189, 141, 'g***8', '酒店开业时间比较久了，设计不过不失，免费升级房间，很开阔，舒适度不错，适合商务', NULL, 80, 0, 4.9, 4.3, 4.5, 4.4, 4.6, 4.5, '2023-09-18 19:02:20', NULL);
INSERT INTO `comments` VALUES (1591, 189, 94, 'g***0', '住了没有十次也有八次的酒店 在深圳只住四季 各方面都没得说 尤其要感谢前台的Jason Li先生 服务非常非常周到 是我见过最专业的服务最好的前台 没有之一', NULL, 80, 0, 4.8, 4.3, 4.6, 4.5, 4.8, 4.6, '2023-09-14 16:36:39', NULL);
INSERT INTO `comments` VALUES (1592, 189, 79, 'G***4', '酒店卫生很好', NULL, 80, 0, 4.1, 4.5, 4.1, 5, 4.6, 4.5, '2023-09-07 18:03:57', NULL);
INSERT INTO `comments` VALUES (1593, 189, 75, 'J***1', '酒店服务一般 房间大 但啥也没；刚从广州文华东方过来 感觉差远了', NULL, 80, 0, 4.4, 4.9, 4.8, 4, 4, 4.4, '2023-09-21 17:02:43', NULL);
INSERT INTO `comments` VALUES (1594, 189, 66, 'D***3', '楼有点低的', NULL, 80, 0, 4.5, 4, 4.1, 4.5, 4.6, 4.3, '2023-09-28 16:55:51', NULL);
INSERT INTO `comments` VALUES (1595, 189, 166, 'z***7', '好，非常满意', NULL, 80, 0, 4.4, 4.5, 4.1, 4.7, 4.7, 4.5, '2023-09-07 18:42:12', NULL);
INSERT INTO `comments` VALUES (1596, 189, 94, 'G***0', '作为四季来说，有点不够级别，其余的还好', NULL, 80, 0, 4.9, 4.6, 4.9, 4.5, 4.4, 4.7, '2023-09-14 16:51:11', NULL);
INSERT INTO `comments` VALUES (1597, 189, 165, 'V***7', '服务人员素质太差了', NULL, 80, 0, 4.1, 4, 4.4, 5, 4.6, 4.4, '2023-09-22 21:10:05', NULL);
INSERT INTO `comments` VALUES (1598, 189, 157, 'o***0', '市中心，会展，政务，高铁。', NULL, 80, 0, 4.1, 4.6, 4.6, 4.3, 4.2, 4.4, '2023-08-17 14:17:29', NULL);
INSERT INTO `comments` VALUES (1599, 189, 61, 'a***0', '位置特别好，步行到会展很方便。酒店服务员热情周到。下次还会光顾。', NULL, 80, 0, 4, 4.5, 4.1, 4.9, 4.3, 4.4, '2023-09-01 18:18:20', NULL);
INSERT INTO `comments` VALUES (1600, 189, 140, 'c***4', '早餐丰富，交通方便，服务好', NULL, 80, 1, 4.2, 4.7, 4.9, 4.3, 5, 4.6, '2023-08-11 14:24:38', NULL);
INSERT INTO `comments` VALUES (1604, 102, 4, 'kg', '高水准的酒店，除了价格贵，其它没有什么可以挑剔的', NULL, 53, 1, 5, 5, 4.5, 5, 5, 4.9, '2024-05-09 04:14:29', NULL);
INSERT INTO `comments` VALUES (1605, 102, 4, 'kg', '服务硬件都挺好', NULL, 53, 0, 4, 4, 3.5, 4.5, 4, 4, '2024-05-09 04:43:48', NULL);
INSERT INTO `comments` VALUES (1606, 102, 4, 'kg', '酒店很好！', NULL, 53, 0, 5, 3, 3.5, 5, 4.5, 4.2, '2024-05-09 04:44:31', NULL);
INSERT INTO `comments` VALUES (1607, 102, 4, 'kg', '地理位置优越，房内也很舒适，面积够大', NULL, 53, 0, 0, 0, 0, 0, 0, 0, '2024-05-09 04:44:43', NULL);
INSERT INTO `comments` VALUES (1608, 75, 4, 'kg', '整体感觉不错', NULL, 32, 0, 4.5, 5, 4.5, 4.5, 4.5, 4.6, '2024-05-09 11:39:15', NULL);
INSERT INTO `comments` VALUES (1609, 75, 4, 'kg', '前台小姐姐很热情，还帮我们升级了房间，空间很大，住的很舒适。周边交通餐饮也很方便，对面就有个商场有好多吃的。', NULL, 32, 0, 4.5, 5, 4.5, 4.5, 4.5, 4.6, '2024-05-09 11:39:15', NULL);
INSERT INTO `comments` VALUES (1610, 84, 4, 'kg', '感谢大堂吧sherry和lori', NULL, 40, 0, 5, 5, 5, 5, 5, 5, '2024-05-09 11:42:07', NULL);
INSERT INTO `comments` VALUES (1611, 77, 255, '手机用户18038439568', '很棒的一次体验哦。', NULL, 32, 1, 5, 5, 4.5, 5, 5, 4.9, '2024-05-13 10:31:12', NULL);
