INSERT INTO `house_features` VALUES (109, 70, '位置周边', '位置情况:\n周边情况:-距春熙路/太古里，地铁4个站，约8分钟到\n达;\n-距文殊院，步行约5分钟到达;\n距宽窄巷子，地铁4个站，约10分钟到达;\n距火车北站，地铁1站;\n距双流机场，打车约40分钟到达(也可步行200米机场专线2号线直达);');
INSERT INTO `house_features` VALUES (110, 70, '房源介绍', '这个民宿坐落在郁郁葱葱的森林深处，四周被茂密的树木环绕。小屋内部简洁温馨，装饰以自然色调为主。您可以在室外露台上喝杯茶，欣赏森林美景，感受大自然的宁静与祥和。');
INSERT INTO `house_features` VALUES (111, 71, '位置周边', '位置情况:\n周边情况:-距春熙路/太古里，地铁4个站，约8分钟到\n达;\n-距文殊院，步行约5分钟到达;\n距宽窄巷子，地铁4个站，约10分钟到达;\n距火车北站，地铁1站;\n距双流机场，打车约40分钟到达(也可步行200米机场专线2号线直达);');
INSERT INTO `house_features` VALUES (112, 71, '房源介绍', '这个民宿坐落在湖畔，周围是清澈的湖水和翠绿的树林。别墅内部装饰舒适温馨，配备了宽敞的客厅和明亮的卧室。您可以在湖畔漫步，欣赏湖水倒影，感受大自然的清新与宁静。');
INSERT INTO `house_features` VALUES (113, 72, '位置周边', '位置情况:\n周边情况:-距春熙路/太古里，地铁4个站，约8分钟到\n达;\n-距文殊院，步行约5分钟到达;\n距宽窄巷子，地铁4个站，约10分钟到达;\n距火车北站，地铁1站;\n距双流机场，打车约40分钟到达(也可步行200米机场专线2号线直达);');
INSERT INTO `house_features` VALUES (114, 72, '房源介绍', '这个民宿建筑风格仿照西部牛仔风格，充满了原始的野性和自然的气息。小屋内部装饰以木质为主，家具简单朴素。您可以在户外篝火旁品尝烤肉，感受到西部牛仔的生活方式。');
INSERT INTO `house_features` VALUES (115, 73, '位置周边', '位置情况:\n周边情况:-距春熙路/太古里，地铁4个站，约8分钟到\n达;\n-距文殊院，步行约5分钟到达;\n距宽窄巷子，地铁4个站，约10分钟到达;\n距火车北站，地铁1站;\n距双流机场，打车约40分钟到达(也可步行200米机场专线2号线直达);');
INSERT INTO `house_features` VALUES (116, 73, '房源介绍', '这个民宿设计师融合了东方传统与现代时尚，打造了一处东方雅居。房间内部装饰以东方风情为主题，配备了精美的家具和装饰品。您可以在这里感受到东方的神秘与魅力，度过一段舒适惬意的假期。');
INSERT INTO `house_features` VALUES (117, 74, '位置周边', '位置情况:\n周边情况:-距春熙路/太古里，地铁4个站，约8分钟到\n达;\n-距文殊院，步行约5分钟到达;\n距宽窄巷子，地铁4个站，约10分钟到达;\n距火车北站，地铁1站;\n距双流机场，打车约40分钟到达(也可步行200米机场专线2号线直达);');
INSERT INTO `house_features` VALUES (118, 74, '房源介绍', '这个民宿被美丽的花园环绕，四季花开，花香弥漫。房间简洁明亮，落地窗将花园的美景尽收眼底。您可以在花园里漫步，与花儿亲密接触，感受大自然的美妙。房间内配备了温馨的大床和设施齐全的浴室，为您带来一个轻松惬意的度假体验。');
INSERT INTO `house_features` VALUES (119, 75, '位置周边', '位置情况:\n周边情况:-距春熙路/太古里，地铁4个站，约8分钟到\n达;\n-距文殊院，步行约5分钟到达;\n距宽窄巷子，地铁4个站，约10分钟到达;\n距火车北站，地铁1站;\n距双流机场，打车约40分钟到达(也可步行200米机场专线2号线直达);');
INSERT INTO `house_features` VALUES (120, 75, '房源介绍', '这个民宿位于郊外的绿色庄园，周围是茂密的森林和广阔的草地。别墅内部装饰典雅豪华，配备了一流的设施和服务。您可以在这里享受到私密宁静的度假时光，感受大自然的美妙和神奇。');
INSERT INTO `house_features` VALUES (121, 76, '位置周边', '位置情况:\n周边情况:-距春熙路/太古里，地铁4个站，约8分钟到\n达;\n-距文殊院，步行约5分钟到达;\n距宽窄巷子，地铁4个站，约10分钟到达;\n距火车北站，地铁1站;\n距双流机场，打车约40分钟到达(也可步行200米机场专线2号线直达);');
INSERT INTO `house_features` VALUES (122, 76, '房源介绍', '这个民宿融合了西班牙传统文化与现代设计，室内装饰以西班牙风情为主题。房间内部设施一应俱全，配备了现代化的舒适家具。您可以在这里感受浓郁的西班牙文化氛围，享受到西班牙的美食与服务。');
INSERT INTO `house_features` VALUES (123, 77, '位置周边', '位置情况:\n周边情况:-距春熙路/太古里，地铁4个站，约8分钟到\n达;\n-距文殊院，步行约5分钟到达;\n距宽窄巷子，地铁4个站，约10分钟到达;\n距火车北站，地铁1站;\n距双流机场，打车约40分钟到达(也可步行200米机场专线2号线直达);');
INSERT INTO `house_features` VALUES (124, 77, '房源介绍', '这个民宿设计师以摇滚乐为灵感，打造了一间充满摇滚气息的小屋。房间内部装饰以复古摇滚风格为主题，配备了摇滚乐器和海报。您可以在这里感受到摇滚的狂放与激情，度过一段充满音乐的假期。');
INSERT INTO `house_features` VALUES (125, 78, '位置周边', '位置情况:\n周边情况:-距春熙路/太古里，地铁4个站，约8分钟到\n达;\n-距文殊院，步行约5分钟到达;\n距宽窄巷子，地铁4个站，约10分钟到达;\n距火车北站，地铁1站;\n距双流机场，打车约40分钟到达(也可步行200米机场专线2号线直达);');
INSERT INTO `house_features` VALUES (126, 78, '房源介绍', '这个民宿建筑风格古典典雅，内部装饰考究，彰显贵族气息。古典的家具和装饰品散发着典雅的气息，让人仿佛穿越到18世纪欧洲贵族社会。房间内配备了一流的设施和舒适的床铺，为您打造一个奢华的度假体验。');
INSERT INTO `house_features` VALUES (127, 79, '位置周边', '位置情况:\n周边情况:-距春熙路/太古里，地铁4个站，约8分钟到\n达;\n-距文殊院，步行约5分钟到达;\n距宽窄巷子，地铁4个站，约10分钟到达;\n距火车北站，地铁1站;\n距双流机场，打车约40分钟到达(也可步行200米机场专线2号线直达);');
INSERT INTO `house_features` VALUES (128, 79, '房源介绍', '这个民宿位于宁静的乡村，被绿树和花园环绕。别墅内部宽敞明亮，家具摆放简洁大方。室外有私人花园和露台，供您享受户外时光。房间内提供了一流的设施和舒适的床铺，确保您拥有一段难忘的度假体验。');
