INSERT INTO `house_features` VALUES (255, 143, '位置周边', '位置情况:\n周边情况:-距春熙路/太古里，地铁4个站，约8分钟到\n达;\n-距文殊院，步行约5分钟到达;\n距宽窄巷子，地铁4个站，约10分钟到达;\n距火车北站，地铁1站;\n距双流机场，打车约40分钟到达(也可步行200米机场专线2号线直达);');
INSERT INTO `house_features` VALUES (256, 143, '房源介绍', '这个民宿位于海边，拥有壮丽的海景。房间装饰充满海洋元素，蓝色调的家具和海洋风格的装饰品营造出轻松愉悦的度假氛围。您可以在私人露台上欣赏日出日落，感受海风的清爽。房间内还配备了舒适的大床和浴室，让您能够在海边尽情放松。');
INSERT INTO `house_features` VALUES (257, 144, '位置周边', '位置情况:\n周边情况:-距春熙路/太古里，地铁4个站，约8分钟到\n达;\n-距文殊院，步行约5分钟到达;\n距宽窄巷子，地铁4个站，约10分钟到达;\n距火车北站，地铁1站;\n距双流机场，打车约40分钟到达(也可步行200米机场专线2号线直达);');
INSERT INTO `house_features` VALUES (258, 144, '房源介绍', '这个民宿坐落在山涧之间，被清澈的溪水环绕。房间采用木质装饰，自然的色彩和材质营造出温馨舒适的氛围。您可以在阳台上欣赏山涧的美景，感受大自然的静谧和清新。房间内还配备了舒适的大床和木制家具，让您度过一个静心放松的山涧假期。');
