INSERT INTO `house_features` VALUES (296, 163, '房源介绍', '这个民宿设计师参考了欧洲古典风格，打造了一间充满浪漫情调的欧式公寓。房间内的装饰华丽精致，仿佛置身于宫殿之中。高挑的天花板、华丽的吊灯和雕刻精美的家具展现出贵族气息，让您尽情享受奢华的欧式生活。');
INSERT INTO `house_features` VALUES (297, 164, '位置周边', '位置情况:\n周边情况:-距春熙路/太古里，地铁4个站，约8分钟到\n达;\n-距文殊院，步行约5分钟到达;\n距宽窄巷子，地铁4个站，约10分钟到达;\n距火车北站，地铁1站;\n距双流机场，打车约40分钟到达(也可步行200米机场专线2号线直达);');
INSERT INTO `house_features` VALUES (298, 164, '房源介绍', '这个民宿设计师融合了东方传统与现代时尚，打造了一处东方雅居。房间内部装饰以东方风情为主题，配备了精美的家具和装饰品。您可以在这里感受到东方的神秘与魅力，度过一段舒适惬意的假期。');
