INSERT INTO `house_features` VALUES (318, 174, '房源介绍', '这个民宿是一栋宽敞的家庭式别墅，适合一家人或多个好友一同度假。别墅内部设施齐全，拥有多间卧室和宽敞的客厅，配备了娱乐设施和厨房。您可以在这里举办家庭聚会，共度愉快时光。');
